'ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ πѳđƴʍѧʌѧ ӌϯѳ ѳʜѧ ѣєʌκѧ џ ӡѧѣџʙѧʌѧ ʙ πџӡđƴ ʙєϯκџ џ ѳⱀєχџ џ ϯ.đ ʜѳ ѳʜѧ đƴʍѧʌѧ ϶ϯѳ đƴπʌѳ?? џ ϶ϯѳ κҁϯѧϯџ ѣƀӀʌџ ʜє ʙєϯκџ џ ʜє ѳⱀєχџ ѧ ʍѳӣ ҁπєⱀʍѧ ',
'ᴙ ѫє ϯєѣᴙ ƴɯʌєπκѧ πⱀџɯџѣƴ χƴєʍ κѧκ ѣѧɯʜџ-ѣʌџӡʜєҵƀӀ ʙ ʜƀѥ-єⱀκє) ',
'ᴙ єѣѧʌ ϯʙѳѥ ʍѧʍѧɯκƴ đѳ ʌєđʜџκѳʙѳґѳ πєⱀџѳđѧ єѱє)) ',
'ᴙ κƴⱀѥ ҁʙѳџʍ χƴєʍ ѧ πєπєʌ ҁʌєϯѧєϯ ʙ ϯʙѳӣ ѫѧʌѳѣʜѳ ҁκƴʌᴙѱџӣ ⱀѳϯ,ϯƀӀ ѱєʜѳκ πʌѧκџҁџʙƀӀӣ ',
'ᴙ ϯєѣᴙ ҁπєⱀʍѳѣʌᴙđҁκџӣ đⱀѳӌєⱀ χѳⱀѳɯѳ ӡʜѧѥ κѧκ џ ϯʙѳѥ ʍѧϯƀ ɯʌѥπκƴ πⱀѳѣџϯƴѥ)) ',
"ϯƀӀ ϯƴϯ ѳҁѳѣѳ ʍєⱀӡѳπѧκѳҁϯʜƀӀӣ ҁƀӀʜѳӌєκ ѣʌᴙđџ đѧѫє ʜє ӡʜѧєϯ ӌϯѳ ᴙ ʍѳґƴ πєⱀєѣџϯƀ ϯʙѳӣ ʍџӡєⱀʜƀӀӣ ϯєκҁϯ χѳϯƀ ӌєⱀєӡ ʍєҁᴙҵ ϯƀӀ ϯѧʍ ʙѳѳѣѱє ⱀѧҁҁƴđѳκ πѳϯєⱀᴙʌ џʌџ κѧκ ѳѣъᴙҁʜџ ʍʜє ʜѧχƴҵ єѣƴӌџӣ ϯƀӀ ҁƀӀʜ ґѳʙʜѧ єѣѧʜѳґѳ κѳϯѳⱀƀӀӣ ϯƴϯ ʙ κѧʜѧʌџӡѧҵџџ ѣƴđєϯ πџҁѧϯƀ ʍʜє ϯєκҁϯ ʙєҁƀ ӡѧɯƴґѧʜʜƀӀӣ đƴʍѧᴙ ӌϯѳ ᴙ ϯєѣᴙ ϯƴϯ ʍџʍѳ ʜє ѳѣѳӣđƴ ϯƀӀ ϯѧʍ đѧʙѧӣ đƴχѳʍ ѳҁѳѣѳ ʜє πѧđѧӣ ҁƀӀʜ ѣʌᴙđџ ϯƀӀ єѣѧʜѳӣ  ᴙ ѫє ϯєѣє ϯƴϯ đєӣҁϯʙџϯєʌƀʜѳ ҁʌѳʍѧѥ ΣѢѦΛƀⴼЏҞ ϯƀӀ ӌϯѳ đƴʍѧʌ κѳґđѧ ʜѧ ʍѳӣ ӌʌєʜ πⱀџҁʍѧϯⱀџʙѧʌҁᴙ? ƴ ϯєѣᴙ ϯƴϯ ʜє πѳʌƴӌџϯҁᴙ ҁѳ ʍʜѳӣ ʜѧ ѳѣƀєʍѧχ ҁєҁϯƀ ᴙ ϯєѣє ϯѧκ ҁκѧѫƴ κѧκѳӣ ϯєѣє ѧđʍџʜκƴ ϯѧʍ ʜѧχƴӣ ҁƀӀʜ ґѳʙʜѧ єѣѧʜѳґѳ ӌ ϯє ʍѧϯƀ ʙƀӀєѣƴ ϯƴϯ ҁƀӀʜ ґⱀѧʜџҵѧ єѣѧʜѳґѳ κѧκѳӣ ϯєѣє ϯѧʍ ѧđʍџʜκѧ ʜѧχƴӣ ϯѧκѳʍƴ ϯƴπѳʍƴ χƴєҁѳҁƴ єѣѧʜѳʍƴ κѳϯѳⱀƀӀӣ ѱѧҁ ʙ ʌѳґџ ӡѧʌєӡєϯ џ ʙ ʜѧđєѫđє ʜѧӣϯџ ҁʙѳѥ πѳϯєⱀᴙʜʜƴѥ ʍѧϯƀ ѣƴđєϯ ӌʌєʜ ҁѳҁѧϯƀ ᴙ ƴѫє πⱀєđҁϯѧʙџʌ κѧκѳӣ ҁƀӀʜ ɯʌѥχџ ҁџđџϯ πѳ ϯƴ ҁϯѳⱀѳʜƴ ϶κⱀѧʜѧ ҁ ʙⱀƴѣʌєʜʜƀӀʍ ѻѳʜκѳʍ  џ ҁ ʜѧƴɯʜџκѧʍџ ҁ ѣѧӡѧⱀѧ κѳϯѳⱀѧᴙ ϯʙѳᴙ ʍѧϯƀ κƴπџʌѧ ѳϯđѧʙ πѳʌ ҁʙѳєґѳ ϯєʌѧ ϯƴϯ ѣƴđєɯƀ ʍʜє ʙƀӀєѣѳʜƀӀ κⱀƴϯџϯƀ? ᴙ ϯєѣᴙ ϯƴϯ ѣƴđƴ ʙƀӀʌѧʙʌџʙѧϯƀ ҁ ϯѳґѳ ʍєҁϯѧ ґđє ϯƀӀ ѳѣџϯѧєɯƀ џ ѣƴđƴ ϯєѣᴙ єѣѧϯƀ ϯƀӀ ϯѧʍ ϯєʌκѧ єѣѧʜѧᴙ đƴχѳʍ ʜє πѧđѧӣ ѳҁѳѣѳ ϯєʌѧӌκѧ єѣѧʜѧᴙ κѳϯѳⱀѧᴙ đѧѫє ʜє πѳʜџʍѧєϯ ӌϯѳ ѣƴđєϯ ϯƴϯ ҁџđєϯƀ џ κѧѫđƀӀӣ πʌєʙѳκ ʙ єѣѧʌѳ ѳϯϯєⱀπʌџʙѧϯƀ  ӡѧʙѧʌџ ϯƀӀ ƴѫє ϯѧʍ ҁʙѳє єѣѧʌѳ ϯƀӀ ӌё ϯѧʍ ʙѳѳѣѱє πџɯєɯƀ ʜѧχƴӣ ҁƀӀʜ ґѳʙʜџҵѧ єѣѧʜѳґѳ đƴʍѧєɯƀ ӌϯѳ ᴙ ϯʙѳѥ ʍѧϯƀ ʜє ʙƀӀєѣƴ џʌџ κѧκ ϯѧʍ? ϯƀӀ ϯѧʍ ʜє ƴʍⱀџ ґʌѧʙʜѳє ⱀѧʜƀɯє ʙⱀєʍєʜџ ҁƀӀʜ ґѳʙʜџҵѧ єѣѧʜѳґѳ κѳϯѳⱀƀӀӣ đѧѫє ʜє ҁѳѳѣⱀѧѫѧєϯ ӌϯѳ ᴙ ʙʜѧϯƴⱀє ϯʙѳѥ ʍѧϯƀ ʙƀӀϯⱀѧχѧѥ ѫѧʌκѳє ϯƀӀ ґѳʙʜѳҁѳӡđѧʜџє ӡѧʙѧʌџ ϯƀӀ ҁʙѳє єѣѧʌϯ ϯƀӀ ӌё ϯѧʍ ҁʙѳѥ ϯѳӌκƴ єѣѧʜƴѥ κџđѧєɯƀ ҁƀӀʜ ґѳʙʜџҵѧ єѣѧʜѳґѳ ӡѧʙѧʌџ ϯƀӀ ƴѫє ϯѧʍ ҁʙѳє єѣѧđʌ πѳκѧ ᴙ ϯєѣє ϯƴϯ ґѳⱀϯѧʜƀ ʜє πєⱀєⱀєӡѧʌ ʜѧχƴӣ ʙʍєҁϯє ҁ κѧѣєʌєʍ џʜϯєⱀʜєϯѧ ӌϯѳ ѣƀӀ ϯƀӀ ϯƴϯ ҁƀӀʜѳӌєκ ґѳʙʜѧ ʜє ϯⱀѳʌʌџʌҁᴙ ʙ ϯєʌєґⱀѧʍє ϯѧκ ϯƀӀ",
"ѳκѧӡƀӀʙѧєϯҁᴙ ϯⱀѳʌʌƀ ҁ ΔҀ đѧ?ʜƴ ϯƀӀ џđџѳϯ єѣѧʜƀӀӣ ᴙ ϯєѣє ϯƴϯ ʍѧϯƀ ʙƀӀєѣƴ ϯƀӀ πѳʜᴙƀ ʍєʜᴙ ϯєʌκѧ єѣѧʜѧᴙ ӡѧʙѧʌџ ϯƀӀ ƴѫє ҁʙѳє єѣѧʌѳ ʙʜѧϯƴⱀє ϯƴϯ ʜѧχƴӣ ʙѳʜᴙєɯƀ џ πⱀѳҁџɯƀ ʙƀӀєѣѧϯƀ ҁʙѳѥ ʍѧϯƀ ҁʙѳџʍ ґʌѧʜѳӡѧπѳχѳʍ ϯƀӀ ϯѧʍ đѧʙѧӣ ӌʌєʜѧ ʙ ⱀѳϯ ʌѳʙџ џ ʜѧӌџʜѧӣ єґѳ πѳϯџχѳʜƀκƴ ʜѧᴙⱀџʙѧϯƀ πѳκѧ ʜє đѳҵđєɯƀ đѳ ҁκѳⱀѳҁϯџ ҁʙєϯѧ ϯƀӀ ϯѧκ ϯѧʍ ҁџđџɯƀ ʙ ӌѧϯє đƴʍѧєɯƀ ӌ ʜє ʙџѫƴ? ϯƀӀ ϯѧʍ ҁʌѳƴϯѧӣπєⱀ єѣƴӌџӣ πѳѫѧʌєєɯƀ ӌϯѳ ʍѳҵ ӌʌєʜ ƴʙџđєʌ џ πѳπƀӀϯѧєɯƀҁᴙ џӡѣєѫѧϯƀ ƴӌѧҁϯџ ӌϯѳ ѣƀӀ ᴙ ϯʙѳѥ ʍѧϯƀ ʜє ѳϯπџʜѧʌ ϯƴϯ ϯƀӀ πѳʜᴙʌѧ ϯѧʍ ϯєʌѧӌκѧ єѣѧʜѧᴙ џʌџ κѧκ ϯѧʍ ʜѧχƴӣ ҁƀӀʜ ґѳʙʜџҵѧ єѣѧʜѳґѳ κѳϯѳⱀƀӀӣ ʍʜє ӌʌєʜ ѳϯҁѳҁєϯ ҁʌƀӀɯ ϯєʌκѧ єѣѧʜѧᴙ ϯƀӀ ґʌѧʙʜѳє ʜє ƴʍⱀџ ⱀѧʜƀɯє ʙⱀєʍєʜџ κѧκ ϶ϯѳ ҁđєʌѧʌѧ ϯʙѳᴙ ʍѧϯƀ ѫџⱀѧѣѧҁџʜѧ єѣѧʜѧᴙ κѳϯѳⱀƴѥ ᴙ ʜѧ κʌƀӀκ ʜѧҁѧѫџʙѧʌ ᴙ πџӡđƴ ϯʙѳєӣ ʍѧϯєⱀџ ϯƴϯ ⱀѧӡѳđⱀѧʌ ҁʙѳџʍ χƴєʍ ϯƀӀ đѧʙѧӣ ϯѧʍ ⱀѧκѳʍ ҁϯѧʙѧӣ џ ґѳϯѳʙƀҁᴙ ʌѳʙџϯƀ ʜє χƴєʙƴѥ ϯѧκƴѥ πʌѥχƴ ӌʌєʜѧ ʙ ҁʙѳє ƴӡєʜƀκѳє ѳϯʙєⱀҁϯџє ϯƀӀ ϯѧʍ єѣѧʜѧᴙ ҁʌѧѣџʜѧ єѣѧʜѧᴙ κѳϯѳⱀѧᴙ ҁӌџϯѧєϯ ӌϯѳ 1500 ҁʌѳʙ ϶ϯѳ ѳґⱀѳʍʜƀӀӣ ϯєκҁϯ đƴʍѧєɯƀ ӌϯѳ ᴙ ϯʙѳѥ ʍѧʍѧɯƴ ʜє ʙƀӀєѣƴ ? ϯƀӀ ҁƀӀʜ ґѳʙʜѳҁѳӡđѧʜџє єѣѧʜѳґѳ ӡѧʙѧʌџ ϯƀӀ ϯѧʍ єѣѧʌѳ ƴѫє ҁʙѳє πѳκѧ ᴙ ϯєѣє ϯƴϯ ⱀєѧʌƀʜѳ ΣѢѦΛƀⴼЏҞ ʜє ѳѧӡʌѳѣʌџʌ ʙ κʌѳӌƀѥ ʜџκѳʍƴ ʜє џӡʙєҁϯʜƀӀӣ ҁƀӀʜƴʌᴙ ϯƴπѳӣ ɯѧʌѧʙƀӀ ѣʌᴙđƀ",
"ϯєѣє ʍѧϯƀ ʙƀӀєѣƴ ϯƴϯ ⱀєѧʌƀʜѳ ʜѧχƴӣ ϯƀӀ ʍʜє ӌʌєʜ ҁѳҁџ ϯѧʍ đѧ ҁʌѥʜᴙʙƀӀӣ ҁƀӀʜ ѣʌᴙđџ єѣѧʜѳӣ ᴙ ϯєѣє ʍѧʍѧɯƴ ʙƀӀєѣƴ ϯƀӀ ʍєʜᴙ πѳʜᴙʌ ϯѧʍ ʜєϯ ϯєʌκѧ єѣѧʜѧᴙ đⱀѧʜʜѧᴙ đƴⱀѧ κѳϯѳⱀѧᴙ ʍʜє ӌʌєʜ ѳϯҁѳҁєϯ ѧӡʙӡʙӡ ϯƀӀ ҁʌѧѣџʜѧ ӡѧʙѧʌџ ƴѫє ҁʙѳє єѣѧʌѳ πѳκѧ ᴙ ϯєѣє χѧⱀѥ ҁʙѳџʍ ӌʌєʜѳʍ ʜє πⱀѳѣџʌ ϯƀӀ πѳʜᴙƀ ʍєʜᴙ ϯєʌκѧ єѣѧʜѧᴙ ᴙ ϯєѣє ϯƴϯ ѣƴđƴ ҁџđєϯƀ џ ҁʍєʌѳ ⱀʙѧϯƀ єѣʌџѱє πѳκѧ ʜє đѳӣđƴ đѳ ҁʙѳєґѳ πѳϯѳκѧ џ ʙ πџκє ʜє ӡѧҁϯⱀєʌѥ ϯʙѳѥ ʍѧϯƀ ѫџⱀѧѣѧҁџʜƴ єѣѧʜƴѥ ƴ κѳϯѳⱀƀӀӣ ѳѫџⱀєʜџє 3 ҁϯєπєʜџ ʜƴ ϯƀӀ πѳʜᴙʌ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ɯѧʌѧʙѧ єѣѧʜѧᴙ џ ӌϯѳ ᴙ єє ϯƴϯ ʙƀӀєѣƴ ѣєӡ κѧκџχ ʌџѣѳ ʙѳπⱀѳҁѳʙ ϯƀӀ ϯѧʍ ґʌѧʙʜѳє ʍʜє ӌʌєʜ ѳϯҁѳҁџ џ ʍѳѫєɯƀ đєʌѧϯƀ ӌϯѳ χѳӌєɯƀ ʙєđƀ ᴙ ʜє ʜѧʍєⱀєʜ ϯєѣє єѣѧʌѳ ҁʜѳҁџϯƀ ѧ πⱀѳҁϯѳ ϯʙѳѥ ϯƴɯκƴ ҁʌѧѣƴѥ ϯƴϯ ʙƀӀʜєҁϯџ ҁ ⱀѧӡѣєґѧ ƴđѧⱀџʙ ҁ πᴙϯκџ ʙ ϯʙѳѥ ӌєⱀєπƴχƴ ӌϯѳ ѧѫ ґʌѧӡʜџҵƀӀ ʙƀӀπѧʌџ ѳϯ ϯѧκѳӣ ʍѳѱʜѳӣ ƴđѧⱀʜѳӣ ʙѳʌʜѳӣ ϯƀӀ ϯѧʍ ϯєʌƴѧ  єѣѧʜѧᴙ đѧʙѧӣ ʍʜє ʜѧӌʜџ ѣƀӀҁϯⱀєє ӌʌєʜᴙκƴ ʜѧᴙⱀџʙѧϯƀ ᴙ ϯєѣᴙ ϯƴϯ ƴϯѳπџʌ ʜѧχƴӣ ʙ ʌƴѫє џ ϯƀӀ ʙ ѳϯⱀѧѫєʜџє ʌƴѫџ ʙџđєʌ ҁʙѳѥ ʍѧϯƀ ϯƀӀ ѫє єѣƴӌџӣ đєⱀʍѳєđ ʜє ҁπѳҁѳѣʜƀӀӣ ӡѧ ҁʙѳєӣ ʍѧϯєⱀƀѥ ƴҁʌєđџϯƀ ӡѧʙѧʌџ ϯƀӀ ƴѫє ҁʙѳє єѣѧʌѳ ⱀєѧʌƀʜѳ ϯƀӀ ӡѧєѣѧʌ ƴѫє ʙҁєχ ϯƴϯ єѣѧʜƀӀӣ ѳϯҁʜџκ ʜє πѳʜџʍѧєϯ ӌϯѳ ᴙ ʜѧ ґѳʌѳҁѳʙѳʍ ʙʙѳđє ҁʍѳґƴ ϯєѣє χѳϯƀ 50κ єѣѧʜƴϯƀ",
"ϯƀӀ ґѳʙʜѳҁѳӡđѧʜџє єѣѧʜѳє κѳϯѳⱀѳє ϯƴϯ ʙ đєӣҁϯʙџϯєʌƀʜѳҁϯџ ʜє đѧҁϯ ʍʜє ѳϯπѳⱀѧ κѳґđѧ ᴙ πⱀџєđƴ џ ʙƀӀєѣƴ ϯʙѳѥ ʍѧϯƀ ᴙ πⱀᴙʍ ҁєӣӌѧҁ ӡʙѳʜѥ ϯʙѳєҵ ʍѧϯєⱀџ џ ґѳʙѳⱀѥ ӌϯѳ ѳʜѧ ɯʌѥχѧ єѣѧʜѧᴙ џđёϯ đѧ ʜєϯ ҁƀӀʜ ґѳʙʜѧ ѳϯʙєӌѧӣ ϯѧʍ ʜѧχƴӣ ʜє ʍѳʌӌџ ϯƴπѳӣ ґѳʙʜѳєđ єѣƴӌџӣ κѧҁϯⱀѧϯ ϯƀӀ ʜѧχƴӣ ʜє πѳʜџʍѧѥѱџӣ ӌϯѳ ᴙ ϯƴϯ ϯєѣᴙ џ ϯʙѳѥ ʍєⱀӡѳϯʜƴѥ ҁєʍєӣκƴ ʙ ѫџʙƀӀχ ʜє ѳҁϯѧʙʌѥ ϯƀӀ ϯƴϯ ӌє đƴʍѧʌ ӌϯѳ ᴙ ʜє ҁʍѳґƴ πєⱀєѣџϯƀ ϯʙѳӣ ϯєκҁϯ џʌџ ӌє ᴙ ϯєѣє ϯƴϯ єѣѧʌѳ ѣƴđƴ ʌѳʍѧϯƀ ϯƀӀ ϯѧʍ πѳʜᴙʌ ʍєʜᴙ ϯєʌκѧ єѣѧʜѧᴙ  ѫѧʌκџӣ ҁƀӀʜ ґѳʙʜѳʍᴙҁѧ єѣѧʜґѳ ᴙ ѫє ϯєѣᴙ ʙʜѧϯƴⱀє ϯƴϯ κⱀѳʍҁѧʌ ҁʙѳџʍ ӌʌєʜѳʍ ϯƀӀ ӌё ϯƴϯ ʙєⱀʜƴʌҁᴙ ӡѧ ʜѳʙѳӣ πѳⱀҵџєӣ ґѳʙʜѧ џʌџ κѧκ?  ҁѳҁџ ʍʜє ϯѧκ πѳκѧ ӌ ϯєѣᴙ ϯƴϯ ҁʙѳџʍ ѣѳґѳπѳđѳѣʜƀӀʍ ӌʌєʜѳʍ ʜє ʜѧκѧƴϯџⱀѳʙѧʌ ϯƀӀ πѳʜᴙʌ ϯѧʍ ʍєʜᴙ ϯєʌκѧ ҁʌѧѣѧӌ ʜѧχƴӣ ϯƀӀ ʍʜє đѧʙѧӣ ϯѧʍ πⱀџґѳϯѳʙƀҁᴙ ҁѳҁѧϯƀ χƴᴙʜґƴ ʍѧϯⱀѳҁ єѣƴӌџҵ ᴙ ϯєѣᴙ ϯƴϯ ѱѧ πⱀєđєʌƀӀ ҁʙѳєґѳ ӌʌєʜѧ ʙƀӀɯʙєⱀʜƴ ʜџӌϯѳѫєҁϯʙѳ єѣѧʜѳє πⱀѳҁϯѳ ϯƴϯ ѣƴđƴ єѣѧɯџϯƀ ϯʙѳѥ ʍѧϯƀ ҁʙѳџʍ ѫџⱀʜƀӀʍ ѳґⱀѳʍʜƀӀʍ χƴєʍ єѣѧʜѳє ҁѳӡđѧʜџє đєґⱀѧđџⱀƴѥѱєє ҁ κѧѫđƀӀʍ ⱀѧӡѳʍ ʙҁё ѣѳʌƀɯє џ ѣѳʌƀɯє κѧκ ϯƀӀ κҁϯѧϯџ ϯƴπѳӣ џđџѳϯ κѧκ ѣєӡ ϯѧӣπѧ ѳϯπџҁѧʌ ʍʜє ҁʙѳӣ ґѳʙʜѳѣƀєʍ ʜƴ ӌ πѳʜᴙʌ ӌϯѳ ϯƀӀ ҁƀӀʜ ґѳʙʜѳʍᴙҁѧ єѣѧʜѳґѳ ʜѳ ӡѧӌєʍ ʍʜє ӌʌєʜ ҁѳҁѧϯƀ ʜє πѳʜџʍѧѥ ᴙ ѫє ϯʙѳєӣ ʍѧϯєⱀџ ϯƴϯ ʙҁє ⱀѧʙʜѳ ӌʌєʜ ѳϯⱀєѫƴ џ ʜє đѧʍ ϯєѣє κⱀƴϯџϯƀ ʙƀӀєѣѳʜƀӀ ҁ ʍѳџʍ ӌʌєʜѳʍ ʙєđƀ ϯʙѳᴙ ʍѧϯƀ ƴѫє ɯџππєⱀџϯ ϯєѣᴙ ҁ ʍѳџʍ ӌʌєʜѳʍ ӌ ϯєѣᴙ џɯѧκѧ єѣѧʜѳґѳ ʙ πⱀџⱀѳđє ʙƀӀєѣƴ ϯƴϯѧ ѳϯʙєӌѧѥ ϯєѣє ϯƀӀ ҁƀӀʜ ґѳʙʜџҵѧ єѣѧʜѳґѳ ϯƴϯ ʍʜє ӌʌєʜ ҁѳҁʜєɯƀ ϯƀӀ ӌё ϯѧʍ πџɯєɯƀ ҁƀӀʜ ϯƴπѳӣ ʍєⱀӡѳϯʜѳӣ ɯѧʌѧʙѳɯκџ ʜѧӡƴӣ ϯƴϯ ϯѳʌƀκѳ πѳπⱀѳѣƴҵ ʜѧ πєⱀєđ ʜѧπџҁѧϯƀ ӌ ϯʙѳѥ ʍѧϯƀ ʙƀӀєѣƴ ѳϯʙєӌѧѥ ϯєѣє ϯƀӀ ҁƀӀʜ đєⱀʍѳєđѧ єѣѧʜѳґѳ ϯʙѳᴙ ʍѧϯƀ ϯѧʍ ҁѳҁєϯ ҁʌʙɯ џđџ ґʌᴙʜƀ κѧκ ᴙ ϯʙѳѥ ʍѧϯƀ ҁʙѳџʍ ӌʌєʜѳʍ ʍѧҁҁѧѫџⱀƴѥ ʜƴ κѳⱀѳӌє ϯƀӀ ʍʜє ѱѧҁ πєⱀєѣџʙ ʙπџɯџ ѧ ᴙ ƴϯⱀѳʍ πєⱀєѣƀѥ ѧ ϯѳ ґѳʌѳʙѧ ѣѳʌџϯ  џ ƴҁϯѧʌ ҁџʌƀʜѳ ѣƴđϯѳ ᴙ ʙєҁƀ đєʜƀ єѣѧʌ ϯʙѳѥ ʍѧϯƀ  ϯƀӀ ϯєʌκѧ єƀѧʜʙᴙ ѳϯʙєӌѧѥ ϯєѣє ϯƴϯ ʜє ʙ κѧκѳӣ ɯѧʜҁ ʜє ʙƀӀѫџʙєɯƀ ҁѳ ʍʜѳӣ đєґⱀѧđѧʜ єѣƴӌџӣ ҁѳ ҁʙѳџʍ πѳđҁѳҁѳʍ κѳϯѳⱀƀӀӣ ҁκѳⱀєє ʙҁєґѳ ӌѧϯ ʙƀєѣѧʌ ѳϯҁѳҁєɯƀϯƴπѧ ʜѧҁƴӡѧ ӠѦӠѦӼѦӼ ϯƀӀ ҁƀӀʜ ґѳʙʜѳҁѳӡđѧʜџє ᴙ ϯєѣє πѳʙϯѳⱀѥҁƀ ϯƀӀ ʜє ʜѧ ӌϯѳ ʜє ґѳđєʜ κⱀѳʍє ϯѳґѳ κѧκ ʍʜє ӌʌєʜ ҁѳҁѧϯƀ ϯƀӀ ϯєʌκѧ ҁʌѧѣѧᴙ ϯƀӀ",
