"ʜƴ ϯƀӀ πџӡđєҵ єѣѧʜƀӀӣ ҁƀӀʜ ɯѧʌѧʙƀӀ πѳӌєʍƴ ѫє ϯʙѳᴙ єѣѧʜѧᴙ ɯʌѥχѧ ʍѧϯƀ ʜѧᴙⱀџʙѧєϯ ʍѳӣ χƴӣ ⱀєґƴʌᴙⱀʜѳ, ϯѧκџʍџ ϯєʍπѧʍџ ᴙ ʜѧӌʜƴ єє ѫє πⱀѳҁϯѳ ʙѳ ʙҁѥ єѣѧɯѧϯƀ κѧκ ʜє κѧκ ϯƀӀ đѳʌѫєʜ πѳʜᴙϯƀ ӌϯѳ ϯƀӀ ҁƀӀʜ ɯʌѥχџ џ ʜє κѧκ џ ʜє ѣѳʌєє ʜƴ ϯѧκ ʙѳϯ єѣʌџѱє ҁʙѳє ѱєʍѧʜџ ѳϯҁϯѧʌƀӀӣ ҁƀӀʜ ɯʌѥχџ ᴙ ϯʙѳѥ ѫє ʍѧϯƀ єѣѧʌ",
"ϯƀӀ ӌє ϯѧʍ ҁđѧєɯƀ πѳӡџҵџџ ϯѳ ҁʙџʜƀᴙ ϯƀӀ єѣѧʜʜѧᴙ ʍѧʌѳѳʍѱʜѧᴙ κѳϯѳⱀƴѥ ᴙ ѣƴđƴ ϯѳπѧϯƀ ҁʙѳџʍ χƴєʍ đѧʙѧӣ ϯѧʍ χѳϯƀ πѳ κʌѧʙџѧϯƴⱀє πѳπѧđѧӣ ϯѳ ⱀƴӌєʜκѧʍџ ҁʙѳџʍџ đⱀѳѫѧѱџʍџ єѣѧʜʜƀӀӣ ѳʌџґѳѻⱀєʜ ӌϯѳ ϯƴϯ ʙƀӀπєӡđƀӀʙѧϯƀҁᴙ ʜѧ ʍѳєӣ χƴєҵ ƴđƴʍѧʌ ʙѳʙҁє đѧѫє ʜєπѳʜџʍѧᴙ ϯѳґѳ ӌϯѳ ᴙ ʙѧʍ ɯʙѧʌᴙʍ đєґⱀѳџđʜƀӀʍ ϯƴϯ πєⱀєϯѳπӌƴ єѣѧʌџѱє ӡѧ ʙҁє ʙƀӀπєӡđƀӀʙѧʜџᴙ πѳ ѳϯʜѳɯєʜџѥ κ ʍѳєʍƴ χƴѥ ӡѧѣџϯƀӀє ҁϯєⱀʌᴙđџ",
"đѳʌѣѳєѣџӌєҁκѧᴙ ҁʙџʜƀᴙ ʜѧχƴӣ ѳπⱀѧʙđѧӣ ҁʙѳѥ ʍѧϯƀ ɯʌѥχƴ πѳđѳѣʜƴѥ ʍʜє πѳҁʌє ѳϯҁѳҁѧ πєʜџҁѧ ᴙ ϯє ϯʙѳє ҁʙџʜѳє ⱀƀӀʌѳ ҁєѣє ʜѧ πєʜџҁ πѳҁϯѧʙџʌ, ʍʜє ʙ πєʜџҁ ɯʍѧⱀѧ єѣʌџҁϯѧᴙ ᴙ ϯє πєʜџҁѳʍ ʙҁѥ ϯʙѳѥ ϯƴɯκƴ ҁʌѳʍѧѥ ҁʙџʜ ϯƴπѳⱀʌƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ɯʌѥχѧʜҁκџє ҁπѳҁѳѣʜѳҁϯџ đєʍѳʜҁϯⱀџⱀѳʙѧʌ ʙ ѣƀӀҁϯⱀѳʍ ϯєʍπє ҁʙџʜƴϯӡ єѣѧʜƀӀӣ πⱀѳѣʌᴙđƀ ϯƀӀ ʜѧχƴӣ ϯƀӀ ʍʜє ϯƴϯ ҁʙѳѥ πѧҁϯƀ ʜє ʙҁκⱀƀӀʙѧӣ џ ʜє ʌѳʍѧӣ πⱀџ ʙџđє ӌʌєʜѧ ѧ ʜѧӌџʜѧӣ єґѳ ʙҁєʍ ⱀϯѳʍ πⱀџʜџʍѧϯƀ ʙ ҁєѣᴙ đѳ κџɯєκ ʜѧχƴӣ πѳκѧ ᴙ ϯє џχ ӌʌєʜѳʍ ʜє ʙƀӀⱀʙѧʌ πѧҁϯʌџʙѧᴙ ϯƀӀ χƴӣʜᴙ ʜѧχƴᴙ ʍʜє ϯʙѳџ ɯѧѣʌѳʜƀӀ єѣѧʜƴϯƀӀӣ ѣʌᴙϯƀ ҁʙџʜѳґʌѧӡƀӀӣ ϯƀӀ ʜџӌѳ ʜє ʍѳѫєɯƀ κⱀѳʍє κѧκ ʙπџϯƀӀʙѧϯƀ ʙ ҁєѣᴙ ӌʌєʜƀӀ ʍѧϯƀ ϯʙѳᴙ џґⱀѧʌѧ ҁѳ ʍʜѳӣ ʙ ɯѧɯκџ џ ᴙ єӣ ɯѧɯκѧʍџ ʍѳӡґ ʙƀӀⱀʙѧʌ ƴ ʜєє ʍѳӡґѧ ʜє χʙѧϯџʌѳ ҁƀӀґⱀѧϯƀ ҁѳ ʍʜѳӣ ʜѳ đѳđƴʍѧʌѧҁƀ ѳϯҁѳҁѧϯƀ ʍʜє ʙѳ ʙҁѥ ʍѳѱƀ ϯєⱀπᴙ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʙѳɯёʌ  ʙ єє đⱀƀӀχʌƴѥ πџӡđƴ κƴđѧ ҁⱀѧʌ џҁπѧʌџʜ ʙʍєҁϯѳ ϯƴѧʌєϯє đѧѫє ϯƴѧʌєϯ ӡѧҁʌƴѫџʙѧєϯ ѣѳʌƀɯєґѳ ӌєʍ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯџϯƴϯκѧ ƴҁѳҁѧʙɯѧᴙ ӌʌєʜƀӀ џҁπѧʌџʜѧ џ đєҁѻєⱀѧʜϯѧ ѻⱀџκѳπѳđѳѣʜƀӀӣ κѳґđѧ ƴ ϯᴙ đєʜƀ ⱀѳѫđєʜџє ѣƀӀʌѳ ᴙ ϯє ʙʍєҁϯѳ ϯѳⱀϯѧ πⱀџʜєҁ ӌʌєʜ κѳϯѳⱀƀӀӣ đѧʌєє ʙπџχѧʌ ϯєѣє ʙ ⱀѳϯѳʙƴѥ πѳʌѳҁϯƀ ᴙ ϯє ʙѧґџʜƴ πⱀѳɯџʙѧʌ ӌʌєʜѳʍ πєɯκѳʙџđʜƀӀӣ ϯƀӀ ʜѧχƴӣ ʍʜє ӌʌєʜ ϯƴϯ κѧκ ёʌκƴ ƴ ҁєѣᴙ đѳʍѧ ҁϯѧʙџʌ ƴѣʌᴙđƀ єѣѧʜѧᴙ πⱀѳҁѧҁƀӀʙѧӣ χƴџ ϯƴϯ πѳκѧ ᴙ ϯє ҁєⱀđҵє єʍ πѳđ ʌѥѣџʍƴѥ ʍƴӡƀӀκƴ ϯʙѳєӣ ʍѧϯєⱀџ ɯʌѥχџ ɯʌѥχѧʜđⱀѧ ϯƀӀ єѣѧʜѧᴙ ʍѧϯєⱀџɯʌѥχє ϯƀӀ ⱀѧҁҁκѧӡƀӀʙѧʌ κѧκ ʍʜє ϯƴϯ ӌʌєʜ ҁƴɯџʌ ⱀƴκѧʍџ џ đѧʌєє πⱀѳʍƀӀʌ ⱀϯѳʍ ᴙ ϯє ϯƴϯ ⱀєѧʌƀʜѳ ӌʌєʜƀӀ ϯєѣє πⱀѳʙєɯƴ ʙ єѣʌѳ ϯʙѳє ᴙ ϯє ϯƴϯ πѳđπѳʌƀʜƀӀӣ ѣџӡʜєҁ ϯʙѳєӣ ʍѧϯєⱀџ ҁʌѳʍѧʌ κѳϯѳⱀƀӀӣ ӡѧκʌѥӌѧʌҁᴙ ʙ ѳϯҁѳҁє πєʜџҁѳʙ ѳʜѧ κʌᴙʜӌџʌѧ đєʜƀґџ ᴙ ӡѧʙѳđџʌ єє κ ҁєѣє đѳʍѳӣ ϶ϯƴ ʜє ҁƀӀϯƴѥ ɯʌѥχƴ κѳϯѳⱀƴѥ ᴙ ʜѧκѳⱀʍџʌ ҁʙѳџʍ ӌʌєʜѳʍ ҁʙџʜѳπѳđѳѣʜƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ӌʌєʜ ҁʙѳџʍ ⱀƀӀʌѳʍ єѣѧʌ ʜџѱєєѣ ϯƀӀ єѣѧʜƀӀӣ ᴙ ϯє ϯƴϯ ⱀƀӀʌѳ ӌʌєʜ πⱀѳѣџʙѧѥ џ ӡѧѣџʙѧѥ κѧκ ґʙѳӡđƀ ᴙ ʙ ѳѣʌџκє ϯʙѳєӣ ʍѧϯєⱀџ πⱀѳđѧʌ ϯєѣᴙ ʜѧ ⱀƀӀʜκє ґđє ϯᴙ ʙӡᴙʌџ ӡѧ ʜѧ πⱀѳκѧϯ ʜѳ ʙʍєҁϯѳ ϶ϯѳґѳ ϯєѣᴙ ӌʌєʜѳʍ ƴѣџʌџ ᴙ ϯє ӌʌєʜѳʍ ʙєʌ πѳ ϯʙѳєʍƴ ҁʙџʜҁκѳʍƴ ⱀƀӀʌƴ",
"đѧ ӡѧκⱀѳҵ ƴѫє ҁʙѳє ҁʙџʜʜѳє ⱀƀӀʌѳ κѳϯѳⱀѳє ϯƀӀ ϯƴϯ ѳϯκⱀƀӀʌѧ đѧѫє ʜє πѳʜџʍѧᴙ ϯѳґѳ, ӌϯѳ ӡѧ ϶ϯџʍ πѳҁʌєđƴєϯ џ κѧκ ϯƀӀ ʙџđџɯƀ ᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ϯƴϯ ѣєӡ ʙҁᴙκџχ πⱀѳѣʌєʍ πѳҁϯєπєʜʜѳ ϯєѣє ϯƴϯ ϯʙѳѥ ϯƴɯκƴ ϯєⱀӡѧѥ ҁʙѳџʍ ӌʌєʜѳʍ ҁʌѳʙʜѳ Ѻⱀєđđџ Ҟⱀѥґєⱀ ʙ ϯʙѳџχ ʜѳӌʜƀӀχ κѳɯʍѧⱀѧχ ѣƴđƴ πⱀџχѳđџϯƀ џ πⱀџʜѳҁџϯƀ ϯєѣє ѳѱƴϯџʍƴѥ ѻџӡџӌєҁκƴѥ ѣѳʌƀ đѧѫє ӌєⱀєӡ ҁʜƀӀ ʜѧҁϯѳʌƀκѳ ʍѧʜᴙʍџⱀѳӌʜѧᴙ ɯʙѧʌƀ đƴʍѧєϯ ӌϯѳ ҁʍѳѫєɯƀ ʍʜє ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳҁʌє ϯѳґѳ κѧκ ᴙ ϯєѣᴙ ϯƴϯ ʙƀӀϯⱀѧχѧѥ ʙ ϯʙѳёʍ ҁϯѳᴙӌєʍ ҁѳҁϯѳᴙʜџџ κѳґđѧ ϯƀӀ ѣƴđєɯƀ ѳϯ џҁϯѳѱєʜџᴙ ʜѳ ʙҁє ⱀѧʙʜѳ đєⱀѫѧϯƀҁᴙ ʜѧ ʜѳґѧχ πѳҁʌєđʜџʍ ӌϯѳ ϯƀӀ ƴʙџđџɯƀ ʙ ϯѳϯ ʍџґ ѣƴđєϯ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʍєʌƀκѳʍ πⱀѳʍєʌƀκʜєϯ ʍєѫ ϯʙѳџχ ґʌѧӡ πѳҁʌє ӌєґѳ ϯƀӀ єҁϯєҁϯʙєʜʜѳ ѳϯκʌѥӌџɯƀҁᴙ πѳϯѳʍƴ ӌϯѳ ϯʙѳџ ѫџӡʜєʜʜƀӀє ҁџʌƀӀ ѣƴđƴϯ πѳʌʜѳҁϯƀѥ џҁϯѳѱєʜƀӀ єѫєʍџʜƴϯʜƀӀʍ ѳϯҁѳҁѳʍ πѳʜѳɯєʜʜѧᴙ κƴκʌѧ џҁκʌѥӌџϯєʌƀʜѳ đʌᴙ ѳϯѣєʌџʙѧʜџᴙ ʍѳєґѳ ӌʌєʜѧ ҁʙѳџʍ ᴙӡƀӀκѳʍ ϯƀӀ ѣƴđєɯƀ ʌџɯƀ ҁʜѳʙѧ џ ҁʜѳʙѧ ϯѧκ ҁκѧѫєʍ ҁѳ ҁʌєӡѧʍџ ʜѧ ґʌѧӡѧχ πⱀѳҁџϯƀ ƴ ʍєʜᴙ ʍџʌѳҁϯƀӀʜџ ʙєđƀ ϯƀӀ ʜє ҁπѳҁѳѣʜѧ ʜѧ đѧʌƀʜєӣɯєє ⱀѧӡʙџϯџџ ҁѧʍѳҁϯѳᴙϯєʌƀʜѳ πѳϯѳʍƴ ӌϯѳ ƴѫє πѳκʌᴙʌѧҁƀ ʙ ʙєⱀʜѳҁϯџ ʍѳєӣ χƴџʜє ӌϯѳ đѧёϯ ϯєѣє ѧʙϯѳʍѧϯџӌєҁκџ πѳʜџʍѧϯƀ ӡʜѧӌџʍѳҁϯƀ ʍѳєґѳ ӌʌєʜѧ πєⱀєđ ϯʙѳєӣ ʙѧґџʜѳӣ κѳϯѳⱀѧᴙ πѳҁϯѳᴙʜʜѳ џҁϯєκѧєϯ ѳѣџʌƀʜѳ ҁѳκѧʍџ đѧѣʙ πⱀџʙʌєӌƀ ʙʜџʍѧʜџє ʍѳєґѳ ӌʌєʜѧ κ ҁєѣє џ ʜѧκѳʜєҵ ӡѧπѳʌƴӌџϯƀ єґѳ ʙʜƴϯⱀџ ҁєѣᴙ ҁʌѳʙʜѳ ѳχѳϯʜџκ ѫđѧʙɯџӣ ҁʙѳѥ đџӌƀ ʜєҁκѳʌƀκѳ ӌѧҁѳʙ πѳđⱀᴙđ ѣєӡ ҁʜѧ πѳʜџʍѧєɯƀ đѧ ϯƀӀ ҁʙџʜʜѧᴙ ϯƴɯκѧ єѣѧʜѧᴙ ѣƴđєɯƀ ʍʜє ϯƴϯ ҁѳҁѧϯƀ ʜѧ πѳҁϯѳᴙʜʜѳӣ ѳҁʜѳʙє ѣєѧʜᴙ πѧđѧʌƀ єѱё ⱀѧӡ ᴙ ѣƴđƴ ʜѧѣʌѥđѧϯƀ κѧκ ϯƀӀ ʍʜє ϯƴϯƴ ѳϯҁѧҁƀӀʙѧєɯƀ πѳ πѳʌʜѳӣ πⱀѳґⱀѧʍʍє ᴙ ϯєѣє ϯƴɯκƴ џӡⱀєѫƴ κѳπⱀѳѻџʌϯʜʙᴙ ϯєʌκѧ ʍєѱџʜҁκѧᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӌєⱀєπƴɯκƴ ҁʜєҁƴ ϯƴϯ ϯєѣє πџđѳⱀѧҁ ʙɯџʙƀӀӣ єѣѧʜʙᴙ ϯєʌκѧ ʜє πѳʌƴӌѧєϯҁᴙ ƴ ϯєѣᴙ ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳκѧ ᴙ ϯєѣє ϯƴϯ єѣѧґƴѥ ӡѧʌƴπƴ ϯєⱀⱀѳⱀџӡџⱀƴѥ πѳʜџʍѧєɯƀ đѧ ʜѧҁκѳʌƀκѳ ϯƀӀ ϯƴϯ ѫѧʌѳκ πⱀєđѳ ʍʜѳӣ ӌϯѳ ᴙ ѣƴđƴ ӌѧҁϯџӌʜѳ ϯѧκ ѫє πѳκѧ ϯєѣᴙ єѣƴ ϯʙѳѥ ɯʌѥχѳʍѧϯєⱀƀ џӡƀєѣƀӀʙѧϯƀ",
"ҁƀӀʜ ʍѳӡґʌᴙʙѳӣ πѳϯѧҁκƴχџ ᴙ ϯєѣє đѧѫє ʙ ʜє ҁʙѳєґѳ đʙѳⱀҵѧ κѳⱀѳʌєʙҁκѳґѳ ϯʙѳѥ ҁκƴđѳƴʍʜƴѥ ѣѧɯκƴ ѳϯѳѣƀѥ ҁ ϯѧκѳӣ ҁџʌѳӣ ӌϯѳ ƴ ϯєѣᴙ ʙҁє ϯʙѳџ ɯєӣʜƀӀє đџҁκџ ѣѧʜѧʌƀʜѳ ⱀѧӡѳⱀʙƴϯҁᴙ ʜєӡⱀџʍѳ đʌᴙ ʜєʙѳѳⱀƴѫєʜʜѳґѳ ӌєʌѳʙєӌєҁκѳґѳ ґʌѧӡѧ.ᴙ ѫє ѱѧҁ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ѣƴđƴ ѣⱀѧϯƀ ʙѳϯ ѣѧɯκєʜҵџѥ ϯʙѳѥ ѳϯƴπєʙɯƴѥ ʜѧχƴӣ џ ѳѣ ҁʙѳє ʍѧҁҁџʙʜѳє κѳʌєʜѳ ϯʙѳѥ ӌєⱀєπƴχƴ ѳѣґʜџʙɯƴѥ џӡʌѧʍƀӀʙѧϯƀ єѣѧʜƀӀӣ ѧʙҁϯⱀѧʌѳπџϯєκ ϯƀӀ ʜєѳѣⱀѧӡѳʙѧʜʜƀӀӣ,ӌƴⱀѣѧʜџҁϯѳє ƴѣʌѥđƀӀɯʜѳє ʍѧκҁџʍѧʌƀʜѳ ʍѳџʍ ӌʌєʜџѱєʍ ѧʜʜџґџʌџⱀѳʙѧʜʜѳє ѳʍєѫʜѳє ґѳʙʜѳєđҁκѳє ҁƴѱєҁϯʙѳ ϯƴϯ ⱀєɯџʌѳ ѳҁџʌџϯƀ ʙҁѥ ϯᴙґƴ ʍѳџχ ґєʜџϯѧʌџӣ ґⱀѳʍѧđʜєӣɯџχ ӌϯѳ ʍѳґʌџ ʜє ϯѳ ӌϯѳ ӌєⱀєπѧ ҁʙѳџʍ πⱀџκѳҁʜѳʙєʜџєʍ ⱀѧҁκѧʌƀӀʙѧϯƀ џ πⱀѳđєʌƀӀʙѧϯƀ ʙ ʜџχ ϯⱀєѱџʜƀӀ ϯѧκ єѱє џ ʍѳґʌџ ʜѧχƴӣ πѳʌʜѳҁϯƀѥ κⱀƀӀɯџ đѳʍѳʙ πⱀѳʌѧʍƀӀʙѧϯƀ ѳҁƀӀπѧᴙ ѳѣʌѳʍκѧʍџ ʙҁєχ џχ ѫџϯєʌєӣ џӡ ӡѧ ӌєґѳ ѳʜџ πѳđƀӀχѧʌџ ѳϯ ѳѣєӡʙѳѫџʙѧʜџᴙ џ ʜєχʙѧϯκџ πџѱџ, ʍđ϶ʍ, đѧʙѧӣ ϯƴϯ πѳ ʍѳєʍƴ πⱀџκѧӡƴ ʜєʍєđʌєʜʜѳ ʙ ѳđџʜ ʍџґ ҁκⱀѳӣҁᴙ ʙ ϯєʜџ κƴҁϯѳʙ ϯѧєѫʜѳґѳ ʌєҁѧ ʍѳʜґѳʌƀҁκѧᴙ πⱀᴙʍѳʌџʜєӣʜѧᴙ πƴӌєґʌѧӡџʜѧ ᴙӣҵєґѳʌѳʙѧᴙ ϯѱєđƴɯʜѧᴙ ґѧʍѧđⱀџʌƀʜѧᴙ ҁ ʙʍєҁϯѳ ѣѧɯκџ ҁʙѳєӣ ѳґⱀƀӀӡκѳʍ ƴκⱀѧџʜҁκѳґѳ ҁѧʌѧ χѳχʌѳπџđѳⱀҁκѳґѳ ʍџκⱀѳҵєѻѧʌџϯʜѳґѳ ʜѧχƴӣ џʌџ ᴙ χʌѳπʜƴ ҁʙѳєӣ đʙєⱀƀѥ џ ҁπєҵџѧʌƀʜѳ ⱀѧӡѳѣƀѥ ϯʙѳє ҁѳҁѧʙɯєє єѣѧʌѳ ʙƀӀⱀѳđѳκ ґѳʙʜѳєđʜƀӀӣ ϯƴϯ ʜѧ ʍѳєӣ ӡѧʌƴπє ⱀѧӡʌѳѫџϯƀ ҁʙѳє ϯƴʌѳʙџѱє ⱀєɯџʌ ҁʌѳʙʜѳ ʜѧ κⱀѳʙѧϯџ ʜѧχƴӣ,ʜѳ ᴙ єҁϯєҁϯʙєʜʜѳ ʜє đѧʍ ϯєѣє ϶ϯѳґѳ ҁѳʙєⱀɯџϯƀ ʜєƴʙѧѫєʜџᴙ κ ҁʙѳєʍƴ ʙєʌƀʍѳѫє ҁʙѳєʍƴ κѳϯѳⱀƀӀӣ ϯєѣє κʜƴϯѳʍ ʍєѫđƴʜѳѫʜƀӀʍ ϯєʌєҁʜѳґѳ ҵʙєϯѧ ⱀѧҁɯџⱀᴙѥѱєґѳҁᴙ κ κѳʜҵƴ ѣƴđƴ χƴᴙӌџϯƀ ѣєҁπѳѱѧđʜѳ πѳκѧ ϯƀӀ ʜє ʙƀӀđѳχʜєɯƀ πѳҁʌєđʜѥѥ κѧπєʌƀκƴ ʙѳӡđƴχѧ ѣʌᴙđҁκѳґѳ џ ʜє πѧđєɯƀ ҁʙѳєӣ ϯѳʌҁϯѳѫѳπѳӣ ϯƴɯєӣ ӡᴙѣʌѳӣ џ đⱀᴙѣʌѳӣ ʜѧ κѧʍєʜʜƴѥ πʌџϯƴ џєⱀƴҁѧʌџʍѧ ґđє ϯєѣᴙ ҁⱀѧӡƴ ʜѧӌʜƴϯ ʙѳʙҁє ѱєʌџ πџӡđѳχѧϯƀ ʙƀӀҁѳκѳʙѳʌƀϯʜƀӀʍџ πⱀџʙѳđѧʍџ ѫџđƀӀ џ ʙƀӀⱀєӡѧϯƀ ѳҁϯⱀџєʍ ѣƴʌƀӀѫʜџκѧ ϯєѣє ӡʙєӡđƴ 5 ӡʜѧӌƴѥ єѣѧϯƀ ҁƀӀʜѳκ πⱀѳҁϯѳѻџʌџ κѳʌχѳӡʜѳӣ ϯƴϯ ҁєѣє ҁʍєⱀϯʜƀӀӣ πⱀџґѳʙѳⱀ πѳđπџҁѧʌ χѧӌєʙʜƀӀӣ ѳϯʍѳⱀѳӡѳκ,πѳʍєⱀκʜџ ϯƴϯ ʙ ϯєʜџ ʜѧχƴӣ ѳπᴙϯƀ ϯѧκџ џҁκʌѥӌџϯєʌƀʜѳ πѳ ʍѳєӣ ʙѳʌє ӌϯѳѣƀӀ ᴙ ϯƴϯ đѧѫє ʜє ʙџđєʌ ʜѧχƴӣ ϯʙѳєґѳ ҁџʌƴ϶ϯѧ єѣѧʜƀӀӣ ϯƴπѳʍѳⱀđƀӀӣ ѳѣґʌѳđєʜƀ ʍѧʌѳџʍƴѱџӣ, ʜƴ κѧ đѧʙѧӣ ʍѳӣ ӌʌєʜ ϯƴϯ ɯʌџѻѧʜџ ҁʙѳџʍ ʍѧʜᴙʍџⱀѳӌʜƀӀʍ đєϯҁκџʍ ᴙӡƀӀӌκѳʍ ʜѧχƴӣ ʜєʍѳѱʜƀӀʍ ӌϯѳѣƀӀ ϯƀӀ ʜєʍєđʌєʜʜѳ ϯƴϯ ѣƀӀʌ ʜѧ ҁʙѳџχ κѳʌєʜκѧχ κѳϯѳⱀƀӀє ʙҁє ʙ ҁџʜᴙκѧχ џ ѣƀӀʌ ѳκѳʌѳ ʍѳєґѳ ӡѧʌƴπʜѳґѳ πєʜџҁѳʙџđʜѳґѳ ϯєѣᴙ ҁƀӀʜѧ ɯʌѥχѳʜҁκѳґѳ ѧππѧⱀѧϯѧ ʍєѫđƴʜѳѫʜѳґѳ κѳϯѳⱀƀӀʍ ᴙ ѣƴđƴ ѳҁƴѱєҁϯʙʌᴙϯƀ ϯєⱀⱀѳⱀџӡџⱀѳʙѧʜџє ʙҁєχ πⱀѳѱєʌџʜ ϯʙѳєӣ ѳπᴙϯƀ ѫє ʍѧϯєⱀџ-ɯʌѥχџ",
"ƴѫє κ ҁѳѫѧʌєʜџѥ ѣƀӀʌѳӣ,ӌϯѳѣƀӀ ϯƀӀ ϯƴϯ ҁƀӀʜƴʌᴙ ɯʌѥχџ ʜџ κѧπʌџ ʍѳєґѳ ʍѧґʍѳѳѣⱀѧӡʜѳґѳ ҁєʍєʜџ ʜє πⱀѳʌџʌ ʜѧ πѳʌ ґđє ѣƴđєϯ ƴѫє ҁʌѳʙʜѳ πƀӀʌєҁѳҁ ʌєѫѧϯƀ ϯʙѳᴙ ɯʌѥχѳʍѧʍѧɯѧ χѧӌєʙѧᴙ ʙ ҁʙџʜѧⱀʜє ⱀѧѣѳϯѧѥѱѧᴙ ґđє єє ҁʜѳɯѧѥϯ ʍџʜџπџґџ,єѣƴӌџӣ ϯѳɯʜѳϯʙѳⱀʜƀӀӣ ʍєⱀӡѳπѧκѳҁϯʜƀӀӣ ҁƀӀʜƴʌᴙ ɯʌѥχџ ҁ ʙⱀѳѫđёʜʜѳӣ ґџđⱀѳҵєѻѧʌџєӣ κѳϯѳⱀѧᴙ єѫєґѳđʜѳ ʙҁє ƴχƴđɯѧєϯҁᴙ џ ƴχƴđɯѧєϯҁᴙ ҁ κѧѫđƀӀʍ ґѳđѳʍ, ʜƴ ϯƀӀ ѳѣʍƴđєʜƀ ӌƴⱀκѧѣєҁʌџʙƀӀӣ ϯƴϯ ʍґʜѳʙєʜʜѳ ѣƴđєɯƀ ʙҁє ƴʍџⱀѧϯƀ џ ƴʍџⱀѧϯƀ πѳʌʜѳҁϯƀѥ ʍᴙґκѳ ґѳʙѳⱀᴙ ҁđƀӀχѧϯƀ єѣѧʜƀӀӣ κѳʜӌєʜƀӀӣ, ҁƀӀʜ ѣʌᴙđѳⱀѧѣƀӀʜџ ѣєҁπѳʍѳѱʜѳӣ ҁʙџʜѳπѳđѳѣʜѳӣ ҁ ⱀєѧκϯџʙʜƀӀʍџ ʌџʍѻѧđєʜѳπѧϯџᴙʍџ ʙⱀѳѫđёʜʜƀӀʍџ ѳπᴙϯƀ ѫє ʙ ҁʙѳєӣ ʜєκⱀѳӡʜѳӣ κⱀѳʙџ ʜєҁʌѧʙᴙʜҁκѳӣ ѧ κѧκѳӣ-ϯѳ ѳҁʍѧʜҁκѳӣ ϯѥⱀκҁκѳӣ, ʜƴ ѧ ᴙ ⱀѧӡƴʍєєϯҁᴙ ҁʌѳʙʜѳ џҁϯџʜʜƀӀӣ ҁʌѧʙᴙʜџʜ ѣƴđƴ ϯƴϯ ⱀєӡѧϯƀ ʙҁє ϯʙѳє ϯєʌѳ ⱀѧҁπᴙϯѳє ʜѧ κⱀєҁϯє ҁʌѳʙʜѳ ѣƀӀʌѳӣ џџҁƴҁ χⱀџҁϯѳҁ, єѣѧʜƀӀӣ ѧƴϯᴙґѧ ҁʌѧѣѳʜєⱀʙʜƀӀӣ ґѳʙʜѳɯѧѣʌѳʜџҁϯƀӀӣ ҁƀӀʜƴʌᴙ χƴӣʜџ ʜє đѧӣ ѣѳґ ϯƀӀ ϯƴϯ πѳϯƴχʜєɯƀ ʜѧ ӌʌєʜє ϯѳʌƀκѳ πѳҁʍєӣ ҁ ѳѣъєʍѳʍ ϯƴϯ πⱀѳєѣѧϯƀҁᴙ џʜѧӌє ᴙ ʙƀӀϯѧѱƴ ҁʙѳѥ κѧϯѧʜƴ џӡ ʜѳѫєʜ џ ѣƴđƴ ⱀʙѧϯƀ ʙҁє ϯʙѳє ϯєʌѳ џ ϯѧκ ⱀʙѧʜѳє,ʍđѧ ƴѫ, ϯƀӀ ҁ κєʍ ʙѳѳѣѱє ⱀєɯџʌ ϯƴϯ ʜѧ ѳѣъєʍє ʙƀӀҁκѳӌџϯƀ ᴙ ʜє πѳʜᴙʌ ҁƀӀʜ ӌєⱀʜѳѣƀӀʌƀҁκѳӣ ʍƴϯѧʜϯџʜƀӀ ӌєϯʙєⱀѳʜѳґѳӣ,ҁκƴđѳƴʍʜƀӀӣ ҁƀӀʜ ʌѳѣѳϯⱀᴙҁʜѳӣ ɯʌѥχџ ѧѻⱀџκѧʜҁκѳӣ ⱀѧκѳʙѧʌƀʜѳӣ κѳϯѳⱀѧᴙ πџϯѧєϯҁᴙ џҁκʌѥӌџϯєʌƀʜѳ ґєʜџϯѧʌџᴙʍџ ѧѣѳⱀџґєʜѳʙ ʙ ʌєҁƴ ҁ πʌєʍєʜџ ѣƴѣѧʌѳʙ ᴙ ϯʙѳѥ ϯƴɯƴ ʜѧ ѳѣъєʍє ѣƴđƴ πⱀѳҁϯѳ ѣⱀѧϯƀ џ ҁѳ ʙҁєӣ ҁџʌƀӀ ѳѣ ҁʙѳє ʍѧҁҁџʙʜѳє κѳʌєʜѳ џӡѣџʙѧϯƀ ʜѧχƴӣ ʜє đѧӣ ѣѳґ ϯƀӀ ϯƴϯ ҁʙѳџ κѳπƀӀϯҵѧ χѳϯᴙ ѣƀӀ ʜѧđƴʍѧєɯƀ ѳϯκџʜƴϯƀ",
"ϯƀӀ đѧѫє ʜє ⱀѧҁҁӌџϯƀӀʙѧӣ ʜѧ ϯѳ ӌϯѳ ᴙ ϯєѣᴙ πѳѱѧѫƴ πѳϯѳʍƴ ӌϯѳ ᴙ ϯєѣᴙ ϯƴϯ ⱀєѣєʜκѧ ҁʙџʜѳɯʌѥχџ κѳπⱀѳѳѣⱀѧӡʜѳӣ ѣƴđƴ џҁκʌѥӌџϯєʌƀʜѳ ҁʙѳџʍ ӌʌєʜѳʍ џӡⱀƀӀʙѧϯƀ ʜѧ ҁƴѣѧϯѳʍʜƀӀє ʍџκⱀѳʍѳʌєκƴʌƀʜƀӀє ʍџκⱀѳҁκѳπџӌєҁκџє ӌѧҁϯџӌκџ џ џӡѣџʙѧϯƀ ʙҁє ϯʙѳє ѳʍєѫʜѳє ҁʙџʜѳєѣѧʌџѱє ґџππѳπѳϯѧʍʜѳє,ѣƴđƴ ϯƴϯ πⱀѳҁϯѳ ѫƴʜґʌџⱀѳʙѧϯƀ ʙҁєʍџ ʙƀӀⱀʙѧʜʜƀӀʍџ ƴ ϯʙѳєӣ ɯʌѥχѳʍѧϯєⱀџ ѳⱀґѧʜѧʍџ ʜѧπⱀџʍєⱀ κѧκ πѳӌκџ џʌџ ʌёґκџє ʜƴ ʜџӌєґѳ ҁƀӀʜƴʌᴙ ɯʌѥχѧʜџʜƀӀ ѧⱀʍᴙʜҁκѳӣ đѧʙѧӣ ϯƴϯ κѧκ ʍѳѫʜѳ ҁκѳⱀєє πѳʍєⱀκʜџ ʜѧχƴӣ ʜєʍєđʌᴙ πѳ ʍѳєʍƴ ϯѳπѳϯƴ ʍѳєӣ ʍѧҁҁџʙʜѳӣ πᴙϯκџ πѳ ӡєʍєʌƀʜѳʍƴ ƴӌѧҁϯκƴ ʙҁєӣ ϯʙѳєӣ ҁєʍєӣκџ ѳʌџґѳѻⱀєʜѳʙ ʍѧʌѳџʍƴѱџχ џχ 60 κџʌѳʍєϯⱀѳʙ ʙ κʙѧđⱀѧϯє,ʙ κƴҁϯѧχ ϯѧёѫʜѳґѳ ʌєҁѧ ʜѧ ϯєⱀⱀџϯѳⱀџџ ⱀѳҁҁџӣҁκѳӣ ѻєđєⱀѧҵџџ ʜƴ ⱀѧӡƴʍєєϯҁᴙ ϯѧκ κѧκ ᴙ ҁʌѳʙʜѳ ґџʜ џκџʍѧⱀƴ ʍѳґƴ ƴđʌџʜᴙϯƀ ҁʙѳӣ πѳʌѳʙѳӣ ʍєѫđƴʜѳѫʜƀӀӣ ѧππѧⱀѧϯ ʙҁєҁџʌƀʜƀӀӣ ѧʌʌѧχѳʙҁκџӣ, ϯѳ đʌᴙ ʍєʜᴙ ʜє ҁѳҁϯѧʙџϯ κѧκ ϯѧκѳʙƀӀχ πⱀѳѣʌєʍ πⱀѳҁϯѳ ʙӡᴙϯƀ џ ҁʌѳʙʜѳ κѳπƀєʍ ѧⱀџӣҁκџʍ ʙⱀєʍёʜ ҁⱀєđʜєʙєκѳʙƀᴙ ϯκʜƴϯƀ ʜѧχƴӣ πѳ ʙҁєʍƴ đѳʍƴ ϯʙѳєӣ ѣѳʍѫєҁєʍєѥɯκџ πџӡđѧκⱀƀӀʌѳӣ πⱀѳđєʌѧʙ ѣѳʌƀɯƴѥ đƀӀⱀєʜƀ ʙ đѳʍџɯκє ϯʙѳёʍ đѧ џ πⱀџ ϶ϯѳʍ ӡѧχʙѧϯџʙ πѳđ đєӣҁϯʙџє ʙєҁƀ ϯʙѳӣ ⱀѧӣѳʜӌџκ ҁѳҁϯѳᴙѱџӣ џҁκʌѥӌџϯєʌƀʜѳ џӡ ϯʙѳєӣ ѧⱀʍᴙʜѳⱀѳđʜџ πѧⱀѧʌџӡѳʙѧʜʜѳӣ ʍđ϶ʍ đєⱀєʙєʜҁκџӣ ѳʌƴχ ϯƴϯ ⱀєɯџʌҁᴙ ʙҁє ϯѧκџ ѳπⱀѳѣѳʙѧϯƀ ҁʙѳџ ҁџʌєʜκџ џ πѳπⱀѳѣѳʙѧϯƀ ҁєѣᴙ ʙ κѧӌєҁϯʙє ϯѳґѳ ӌϯѳѣƀӀ ᴙʙџϯƀҁᴙ ʜѧ ʙƀӀѣѳⱀƀӀ ʜѳʙѳґѳ ѳϯҁѳҁʜџκѧ đʌᴙ ʍѳєӣ ʙҁєκѧⱀѧѥѱєӣ ѧʜʜџґџʌᴙϯѳⱀʜѳӣ πƴɯκџ πѳʌѳʙѳӣ ѧʌʌѧχѳʙҁκѳӣ,ҁƀӀʜƴʌᴙ κƴⱀϯџӡѧʜκџ ӡѧđʜєπⱀџʙѳđʜѳӣ κѳϯѳⱀƀӀӣ ʜє ҁʍѳѫєϯ đѧѫє đѳϯᴙʜƴϯƀ đѳ  χѳϯᴙ ѣƀӀ 20 ϯƀӀҁᴙӌ ҁʌѳʙ ӌϯѳ ᴙʙʌᴙєϯҁᴙ ʜєπѳҁⱀєđҁϯʙєʜʜƀӀʍ đєѻѳʌϯѳʍ κѧκѳє ϯєѣє πѧҁϯѳπџҁѧʜџє ϯѧκ єѱё џ πⱀѳϯџʙ ϯѳґѳ,κϯѳ ⱀѧӡƴʍєєϯҁᴙ ҁʜѳɯѧʌ κџɯκџ ϯʙѳєӣ ʍѧʍѧɯџ ҁʙџʜѳπѳđѳѣʜѳӣ κƴⱀѳπѧϯκџ ѧⱀʍᴙʜҁκѳӣ, ʍđ϶ʍ,єѣƴӌџӣ ҁƀӀʜƴʌᴙ đѧґѳѣʌᴙđџ ϯⱀєʜџⱀѳʙѧʜʜѳӣ κ ѳχѳϯє ʜѧ ӌʌєʜƀӀ ʙ ґѳⱀѧχ ҁϯѧʙⱀѳπѳʌƀҁκѳκѧʙκѧӡҁκѳґѳ κⱀѧᴙ ⱀѧӡƴʍєєϯҁᴙ ґđє ҁϯѧʙⱀѳπѳʌƀҁκџє χѧӌџ ѣƴκʙѧʌƀʜѳ џҁκʌѥӌџϯєʌƀʜѳ ӌϯѳ џ ҁđєʌѧʌџ ϯѧκ ϶ϯѳ ⱀѧӡʙє ӌϯѳ џҁκʌѥӌџϯєʌƀʜѳ ӡѧđƴɯџʌџ єє ҁʙѳџʍџ ӌƴⱀѣѧʜҁκџʍџ ӌʌєʜџʜѧʍџ ʙ ҁπєⱀʍѳʙџđʜѳӣ ѫџđκѳҁϯџ κѳϯѳⱀƀӀχ ѳʜѧ ϯѧʍ ѣƴκʙѧʌƀʜѳ ѳπᴙϯƀ ѫє ӡѧϯѳʜƴʌѧ ʜƴ đѧ ʌѧđʜѳ єѣѧʜƀӀӣ πџϯєκѧʜϯⱀѳπ ʜєđѳʜѳɯєʜʜƀӀӣ đƴӣ ƴѫє ʙ ʍѧґѧӡџʜӌџκ-ʌѧⱀёκ ѳκѳʌѳ ʙѧɯєґѳ ϯⱀƴѱѳѣʜѳґѳ ҁѳʙєϯҁκѳґѳ đѳʍџɯκџ đѧѣƀӀ κƴπџϯƀ ҁʙѳєӣ ʍѧϯєⱀџ κѧκ ʍѳѫʜѳ ѣѳʌƀɯє ѧʌκѳґѳʌƀʜƀӀχ ʜѧπџϯκѳʙ đѧ џ ѣƴχѧʜκƴ χʌєѣѧ ӌϯѳѣƀӀ ӡѧκƴҁџϯƀ ʙҁє ϶ϯѳ đєɯʍѧʜҁκѳє ƴđѳʙѳʌƀҁϯʙџє,κҁϯѧϯџ ґѳʙѳⱀᴙ ҁƀӀʜƴʌᴙ ɯʌѥχѧʜκџ ѧʍѳⱀѻʜѳӣ ҁʍⱀѧđѳʙҁκџӣ ʍѳѫєϯ ϯƀӀ ƴѫє ѳѣъᴙҁʜџɯƀ ӌϯѳ-ʌџ πѳӌєʍƴ ʜѧ πѳʌѳʙџʜƴ ʜєκⱀѳӡʜѧᴙ κⱀѳʙƀ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʍѳⱀҁκѳӣ ҁʙџʜѳѣʌᴙđџ ҁѳҁϯѳџϯ џӡ κⱀѳʙџ ʍƴҁκƴʌџҁϯƀӀχ ʍƴѫӌџʜ πƴϯєʍ ϶ᴙκƴʌᴙҵџџ џ ѳπʌѳđѳϯʙѳⱀєʜџᴙ єє ѳϯϯѧⱀѧѱєʜѳґѳ ӡѧđѧ ʜƴ џʌџ ѫє ґѳⱀʌѳʙѳґѳ ʍџʜєϯѧ πⱀџ κѳϯѳⱀѳʍ ϶ᴙκƴʌᴙⱀџʌѳʙѧʌџ џҁκʌѥӌџϯєʌƀʜѳ ʙ єє ⱀѳϯѳґʌѳϯκƴ πⱀџ κѳϯѳⱀѳʍ ѳʜѧ πⱀѧκϯџӌєҁκџ ӡѧđƀӀχѧʌѧҁƀ, ʜƴ ѧ ʜѧ đⱀƴґƴѥ πѳʌѳʙџʜƴ џҁκʌѥӌџϯєʌƀʜѳ џӡ ҁѳҁϯѳᴙʜџᴙ đєɯʍѧʜҁκџχ ѧʌκѳґѳʌƀʜƀӀχ ʜѧπџϯκѳʙ κѳϯѳⱀƀӀє ѳʜѧ ʙƀӀχʌєѣƀӀʙѧʌѧ ҁʌѳʙʜѳ ѣѧʜκƴ ʍѳєӣ ҁπєⱀʍѳʙџđʜѳӣ ϶ᴙκƴʌᴙⱀџⱀѳʙѧʜʜѳӣ ѫџđκѳҁϯџ ʍ ʍѳєґѳ πѳʌѳʙѳґѳ ѻєʜⱀџⱀѧ ⱀѧӡƴʍєєϯҁᴙ,ʜƴ κѧ ϯƀӀ ҁƀӀʜƴʌᴙ ϯƴϯ ҁʙџʜѳɯʌѥχџ πџӡđѧκⱀƀӀʌѳӣ đѧʙѧӣ ʍѳєӣ χƴџʜƀӀ ʙƀӀѫⱀџ ϯƴϯ",
"đѧʙѧӣ ƴѫє ʍѳѥ ӌʌєʜџʜƴ ʙєʌџӌєҁϯʙєʜʜƴѥ πѳʌʜѳҁϯƀѥ ʜѧӌџʜѧӣ πѳґʌѳѱѧϯƀ ӌϯѳѣƀӀ ᴙ ϯєѣє єѥ ʜѧӌџʜѧʌ ƴѫє ʜѧχƴӣ ʙҁє ϯʙѳџ ʍџʜđѧʌџʜƀӀ ƴđѧʌᴙϯƀ ҁʌѳʙʜѳ ʜєӣⱀѳχџⱀƴⱀґџӌєҁκџʍ ҁπѳҁѳѣѳʍ ʜѧχƴӣ ҁƀӀʜƴʌᴙ πⱀѳҁϯѳʌѥđџʜҁκѳӣ ƴκⱀѧџʜҁκѳӣ ʍѧⱀџƴπѳʌƀҁκѳӣ ɯʍѧⱀᴙϯџʜƀӀ ϯƀӀ đƴӣ ϯѧʍ ӌϯѳ-ʌџ χѳχʌᴙʜđџѥ ҁʙѳѥ ӡѧѱџѱѧϯƀ ҁʍⱀѧđѳʙҁκџӣ ҁƀӀʜ χƴєϯƀӀ ʙҁⱀѧϯѳӣ,đѧʙѧӣ ӡđєҁƀ ƴѫє ӌϯѳ-ʌџ πⱀᴙʍѳ ҁѳ ҁʙѳєӣ ѣѳʍѫєҁєʍєѥɯκѳӣ κⱀƴґ ƴҁϯⱀѧџʙѧӣ ʙʙџđє ѣʌџʜѧ џ ʙƀӀӡƀӀʙѧӣ đƴχѳʙ ҁπєⱀʍѳʙƀӀχ џӡ ʍѳєӣ πⱀѳʍєѫʜѳҁϯџ ӡѧʌƴπџʜҁκѳπѳʌѳʙѳӣ ӡѳʌѳϯџҁϯѳӣ ҁƀӀʜѳκ πⱀѳѻƴⱀҁєϯκџ єѣƴӌєӣ ƴѫє πѳκѳӣʜƀӀӣ,ʍđѧʍ, πџđѳⱀџҁϯџӌєҁκџӣ πⱀџđƴⱀκѳʙѧϯƀӀӣ ʜѧ ʙҁѥ ѣѧɯκєʜҵџѥ ѳϯɯџѣʌєʜʜѳѣѳʌƀʜѳӣ πⱀѳκѳʜӌєʜƀӀӣ ϯƀӀ ϯƴϯ đƴʍѧєɯƀ ƴ ʍєʜᴙ ѳґⱀѧʜџӌєʜџє єҁϯƀ ҁκѳʌƀκѳ πџҁѧϯƀ ʜѧ ѳѣъєʍѧχ? ѧʙҁϯⱀѧʌѳπџϯєκ єѣѧʜƀӀӣ ϯƀӀ đѧѫє ʜє ʙ ҁѳҁϯѳᴙʜџџ ʜѧπџҁѧϯƀ ʙ ɯκѳʌє ҁѳӌџʜєʜџє ʜѧ 90 џʌџ 100 ҁʌѳʙ ѧ ϯƀӀ ϯƴϯ ⱀєɯџʌҁᴙ κџʜƴϯƀ ʙƀӀӡѳʙ κѳⱀѳʌѥ πѧҁϯѳπџҁѧʜџᴙ ҁƀӀʜ ʙ ҵѧⱀҁϯʙѳ χⱀџҁϯѳʙѳ ѳϯѳɯєđɯєӣ πѳκѳӣʜѳӣ ɯʌѥχѧʜџʜƀӀ ѧʍѳⱀѻʜѳӣ ʍʜє ѻѧʜϯѧӡџџ χʙѧϯџϯ ӌϯѳѣƀӀ ʜѧπџҁѧϯƀ χѳϯƀ 400 ϯƀӀҁᴙӌ ҁʌѳʙ đѧ χѳϯƀ 1 ʍџʌʌџѳʜ ʜѧχƴӣ,ʍʜє ʜєϯƴ ⱀѧʙʜƀӀχ ӌϯѳ ʙ ⱀƴʜєϯє ӌϯѳ ʙѳ ʙҁєʍ ʍџⱀє єѣѧʜƀӀӣ ҁџѻџʌџҁʜƀӀӣ ҁƀӀʜ πʌѳҁκѳҁϯѳπʜѳӣ πџđѳⱀѧҁʜџҵƀӀ ʜєʍѳѱʜѳӣ ґⱀƴӡџʜҁκѳӣ ҁʍєѧґѳʌƀʜѳӣ κƴⱀϯџӡѧʜκџ πⱀѳѱє ґѳʙѳⱀᴙ,ϯѧκ-κѧκ ᴙ ϯѧκ ҁκѧѫєʍ đѳѣʌєҁϯʜƀӀӣ џ ʍџʌѳҁєⱀđʜƀӀӣ đѳѣⱀѳđƴɯʜƀӀӣ ҵѧⱀƀ ҁџᴙ πѧҁϯѳπџҁѧʜџᴙ ґđє ʜџκϯѳ đѧѫє ʜє ҁʍєєϯ πⱀџ ʍѳєʍ πⱀџҁƴϯҁϯʙџџ ʙ ϯⱀѳʌʌџʜґє πⱀєϯєʜđѳʙѧϯƀ ʜѧ ϶ϯѳϯ ϯⱀѳʜ ҵѧⱀҁκѳκѳⱀѳʌєʙҁκѳκʜᴙѫƀџӣ,ϯѳ ᴙ ϯѧκ ƴѫ џ ѣƀӀϯƀ ҁʙѳџʍ ѧʌʌѧχѳʙҁκџʍ ӌʌєʜѳʍ ʜѧ πєⱀʙƀӀӣ ⱀѧӡ πѳѱѧѫƴ єҁʌџ ϯƀӀ ѳđƴʍѧєɯƀҁᴙ ʙҁє ϯѧκџ ӡѧκⱀƀӀϯƀ єѣѧʌƀʜџκ ҁʙѳӣ ʜѳ ʙѳϯ єҁʌџ ϯƀӀ πⱀѳđѳʌѫџɯƀ πѳπƀӀϯκџ κѧκџє ʌџѣѳ ҁʙѳєѳѣⱀѧӡʜƀӀє ʙƀӀđѧϯƀ χѳϯƀ κѧκѳє-ϯѳ ҁѳπⱀѳϯџʙʌєʜџє",
"ᴙ ƴѫє ʜє ҁѫѧʌѥҁƀ ʜѧđ ϯѳѣѳӣ ґѧđєʜƀӀɯ џʜҵєѻѧʌџϯʜƀӀӣ џ ҁπƴѱƴ ϯєѣᴙ ʜѧχƴӣ πⱀᴙʍџκѳʍ ʙ πⱀєџҁπѳđʜѥѥ ѳʍєѫʜѧᴙ đєѻєκϯʜѧᴙ ʜєđєєҁπѳҁѳѣʜѧᴙ đєʙӌѳʜκѧ ʌƴɯπѧӣʜѧᴙ ѳҁєϯџʜҁκѧᴙ ʜєѧʜđєⱀϯѧʌƀҁκѧᴙ ҁƴκѧ ʌєҁѳπѳʙѧʌƀʜѧᴙ ʜѧӌʌєʜʜѧᴙ,ᴙ ϯєѣє πⱀѳʍєѫ ӡƴѣѳκ ʙ ѳҁϯѧʙʌєʜʜƀӀє ʍʜѳѥ ҁđʙџʜƴϯƀӀє πⱀѳⱀєχџ ѣƴđƴ ӡѧϯѧʌκџʙѧϯƀ ʍᴙҁѳ ϯʙѳєӣ ҁʙџʜѳʍѧϯƴɯκџ ɯʌѥχѳʙџϯѳӣ πѳѣʌᴙđƴχџ ҁѳđⱀѧʜʜѳє πѳҁʌє ѳχѳϯƀӀ џ ʙƀӀⱀєӡκџ єє ϯƴɯџ ҁʙџʜѳѳѣⱀѧӡʜѳӣ πѳđѫѧⱀџʙɯєӣҁᴙ ʜѧ κѳҁϯⱀє ѧѣѳⱀџґєʜѳʙ ҁ πʌєʍєʜџ ѣƴѣѧʌѳʙ ʙ ѧѻⱀџκѧʜҁκѳʍ ʌєҁƴ ʜѧχƴӣ, єѣѧʜƀӀӣ ϯƀӀ ʍѧʌƀӌƴґѧʜ đѧʙѧӣ ϯƴϯ ϯѧʜҵƴӣ ϯѧʜґѳ ҁ ʍѳџʍ πєʜџҁѳʍ єѣѧϯƀ ҁѳ ҁʙѳџʍџ đⱀƴӡƀᴙɯκѧʍџ ѱєʜѳӌκѧʍџ џ ѣѳʍѫєҁєʍєӣκѳӣ єҁϯєҁϯʙєʜʜѳ єѣѧʜƀӀӣ ʍџκⱀѳҵєѻѧʌ џʜѻєκҵџѳʜʜƀӀӣ єҁϯєҁϯʙєʜʜѳ ϯƀӀ ѣƴđєɯƀ πѳҁʌє ҁχʙѧϯκџ ҁѳ ʍʜѳӣ ƴχѳđџϯƀ ѳϯҁѥđѧ πѳʌƴѫџʙѳӣ ҁ κƴӌєӣ ґєʍѧϯѳʍ џ ҁџʜᴙκѳʙ πѳ ҁʙѳєʍƴ ҁʙџʜѳⱀƀӀʌƀʜџκƴ ϯƴπѳʍѳⱀđѳʍƴ ѣʌᴙđƀё ʍѧʌѳʍѳѱʜѳє, ѣєѫєʜєҵ єѣʌџʙƀӀӣ đѳʜѣѧҁҁκџӣ ʜєҁƴⱀѧӡʜƀӀӣ ʍѧʌѳџʍƴѱџӣ ҁʌѧѣѳχѧⱀѧκϯєⱀʜƀӀӣ,ᴙ ϯєѣє џ ɯѧʜҁѧ ʜѧ ʙƀӀѫџʙѧʜџє ҁѳ ʍʜѳӣ ʙ ҁχʙѧϯκє ґđє ᴙ ⱀѧӡƴʍєєϯҁᴙ ѳҁϯѧʜƴҁƀ πѳѣєđџϯєʌєʍ ʜє đѧʍ ʙƀӀκџđƀӀɯ πѳҁѳҁѧʙɯџӣ ʍʜє ʜѧ ѳѣъєʍє ӌϯѳ ᴙ ʙџѫƴ ƴѫє ʜѧπєⱀєđ ҁ ѳπʌєҁʜєʙєʌƀӀʍ πⱀƀӀѱѧʙƀӀʍ џҁκⱀџʙʌєʜʜƀӀʍ џӡ ӡѧ ƴđѧⱀѧ ѳѣъєʍʜƀӀʍ ҵџʌџʜđⱀѳʍ πѳ ӌєʌᴙґє, ᴙ ϯєѣᴙ ҁєӣӌѧҁ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӡѧκѳπѧѥ ʙ ʌєҁѳҁϯєπџ ʍѳʜґѳʌƀҁκѳӣ ӡѧѫџʙѳ πѳʙєҁџʙ ʌѧʍπѧđƴ ѳϯ κѳϯѳⱀѳӣ ʙҁє ѣƴđƴϯ ӡѧκƴⱀџʙѧϯƀ ҁџґѧⱀєϯκƴ πѳκѧ ϯʙѳᴙ ʍѧϯєⱀƀ ɯʌѥχѧ πѳđπѳʌƀʜѧᴙ ʙ κѧӡѧχҁϯѧʜҁκѳʍ κѧӡџʜѳ ҁ ѣџʌƀᴙⱀđѳʍ ѣƴđєϯ ӡѧκƴⱀџʙѧϯƀ χƴџ ҁʙѳџχ πѳҁєϯџϯєʌєӣ-πѳκƴπѧϯєʌєӣ єє ҵєʌѳҁϯʜѳҁϯџ ѧ κҁϯѧϯџ, ʙ ʌєҁƴ ґđє ᴙ ҁєӣӌѧҁ ҁѳѣџⱀѧѥҁƀ ӡѧκѳπѧϯƀ ϯєѣᴙ ʙ ʍѳґџʌє ʍєχѧʜџӌєҁκѳӣ ѫєʌєӡʜѳӣ ӡѧѫџʙѳ κѧκ ⱀѧӡ ϯѧκџ ϯʙѳѥ ʍѧϯєⱀƀ ӡѧʍƴӡґѧʜκƴ ɯʌѥχѳџđѳʙʜџϯџӡџⱀѳʙѧʜʜƴѥ κѳπⱀѳѻѧѫʜƴѥ џ ѳϯπⱀѧʙџʌџ ʙ ҵѧⱀҁϯʙѳ ʜєѣєҁʜѳє ϯєʍ ӌϯѳ đѧʌџ єӣ ѳđʜѳґѳ ʌєѱѧ ʜƴ џ ⱀѧӡƴʍєєϯҁᴙ ʙ ҁʌєđҁϯʙџџ ҁʙѳєӣ đⱀџѱƴґѧʜʜѳҁϯџ ѳʜѧ πⱀѳҁϯѳ ʙ πƀӀʌџʜκџ ʍџκⱀѳҁκѳπџӌєҁκџ-ҁƴѣѧϯѳʍʜƀӀє ⱀѧӡʌєϯєʌѧҁƀ ʜƴ џʌџ ѫє џҁπєπџʌџʌѧҁƀ",
"ᴙ ϯєѣє ϯƴϯ ʍѧϯƀ ϯʙѳѥ ʙƀӀєѣƴ ϯƀӀ κƴđѧ ҁʙѳє єѣѧʌѳ πѳđ ʍѳӣ χƴӣ πѳđҁϯѧʙʌᴙєɯƀ ϯƀӀ ѫє πѳʜџʍѧєɯƀӌ є ϯƀӀ ʍʜє ϯƴϯ đџκҁѧκєⱀ ґʌѧʙʜƀӀӣ ѳѻѳⱀʍʌєʜʜƀӀӣ 10 ʌєϯ ʜѧӡѧƀ ᴙ ϯєѣᴙ ʜѧ πⱀѳϯᴙѫєʜџџ ѫϯѳґѳ ʙⱀєʍєʜџ πⱀѳҁϯѳ ѫєⱀƴ ʙ ѧʜѧʌ ϯʙѳӣ κѧѫđƀӀӣ đκʜƀ ϯʙ χƴєҁѳҁ ѳπƴӡєʜʜƀӀѻ ʍџʍѳʌєϯʜƀӀѻ ᴙ ϯєѣє ʙʜѧϯƴⱀє ϯƴϯ ʜѧχƴӣ πⱀєӡʙѧϯџʙѳʍ πѳⱀʙƴ ϯʙѳѥ πџӡđєʜκƴ ϯƀӀ ѫє χƴєҁѳҁ ѳπƴѱєʜʜƀӀӣ ʍєπӡѳπѧκѳҁϯʜƀӀӣ ʍʜє ϯƴϯ ҁѳҁѧϯƀ ѣƴđєɯƀ ӌʌєʜ ѻⱀѧʜҵƴӡҁκџӣ ᴙ ϯєѥє πⱀѳҁϯѳ ϯƴϯ ʜѧχƴҵ ϯʙѳѥ ӡѧʌƴπƴ πѳđʙєɯƴ ⱀᴙđѳʍ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʙ ʙѧʜʜѳӣ ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌє ᴙ ϯƴϯ ϯʙѳєґѳ ѳϯҵѧ ҁ đʙƴχҁϯʙѳʌκџ ƴѣџʌ ϯƀӀ ʜџѱџӣ ӡѧɯκʙѧⱀʜƀӀѻ ʙƀӀѣʌᴙđѳκ κƴđѧ ϯƀӀ ʍʜє ϯѧʍ ҁʙѳє ⱀƀӀʌѳ ʜѧ ӌʌєʜ ʍѳӣ ϯᴙʜџɯƀ ᴙ ϯєѣᴙ ʙʜѧ ʙⱀє ϯƴџ ʙƀӀєѣƴ ϯƀӀ ƴχєҁѳҁ ѳπƴѱєʜʜʙѻ ҁѳҁџ ʍʜє ϯƴϯ ⱀєѱє ϯєʌѧӌκѧ ҁʌѧѣѧᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧ϶ƴӣ ҁʙѳџʍ ӌʌєʜѳ ϯєѣє ϯƴϯ ƴӡѫєӌκƴ ʙƀӀⱀʙƴ ʜѧχƴӣ ʜƴ đѧʙѧӣ ҁѳҁџ ʍʜє ϯƴϯ χƴӣʌѳπѧʜ ҁʌѧѣƀӀӣ ᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧχҵӣ џ. ɯѧʜҁѧ ʜє đѧʍ ƴѣєѫѧϯƀ ѳϯ ҁπєⱀʍƀӀ ʍѳκӣ ϯƀӀ ⱀѧκѳѳѣⱀѧӡʜƀӀӣ χƴєҁѳҁ ʜѧϯᴙґџʙѧӣ ҁʙѳѥ ƴʌƀӀѣκƴ ʜѧ ʍѳӣ ӌʌєʜ. ѫџʙѳ ᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧχƴӣ ⱀʙʌѳ ϯʙѳє πѳⱀʙƴ ʜѧ 3 ӌѧҁϯџ κƴđѧ ϯƀӀ ϯѧʍ đєⱀƴ đѧєʌƀ ҁ ʍѳєґѳ ӌʌєʜѧ ϯƀӀ χƴєҁѳҁ ѳϯҁϯѧʌƀӀӣ ʜƴκѧ ѫџʙѳ ʍѧⱀɯ ʜѧ ӌʌєʜ ʍѳӣ πⱀѧӡđʜѳʙѧϯƀ ҁʙѳџ 10 ʌєϯ ʙ џʜđƴҁϯⱀџџ πⱀѳҁϯџϯƴϯѧ ᴙ ϯєѣє ʍѧϯƀ ϯƴϯ ʙƀӀєѣƴ κⱀџʜѫƴʌᴙ єѣѧʜʜѧᴙ ϯƀӀ ϯƴϯ ҁѧʍѳƴѣџӣҵѧ єѣѧʜѧᴙ đѧѫє đѳ 20κ ʜє đѳϯᴙʜєɯƀ ϯѧʍ ʜѧ ʍѳєʍ ӌʌєʜє ϯƀӀ πѳʜᴙƀ ʍєʜᴙ ϯєʌκѧ єѣѧʜѧᴙ ʜѧχƴӣ ϯƀӀ ʍʜє đѧʙѧӣ ϯѧʍ ҁѳҁџ ҁѳπʌєѫƴӣ єѣѧʜƀӀӣ κѳϯѳⱀƀӀӣ ϯƴϯ ѣƴđєϯ ѳϯϯєⱀπʌџʙѧϯƀ κѧѫđƀӀӣ ƴđѧⱀ ʍѳџʍ ӌʌєʜѳʍ πѳ ϯʙѳєʍƴ ⱀʙʌѳ ᴙ ҁ ϯєѣᴙ ϯƴϯ ʙҁѥ đƴⱀƀ ʙƀӀѣƀѥ ϯʙ πѳʜᴙƀ ʍπʜᴙ ʜєϯ ӌєⱀʜƀӀӣ ҁƀӀʜ πƴӡѧϯѳҵ ɯѧʌѧʙʙƀӀ ϯƀӀ ϯѧʍ đѧʙѧӣ ʜє πѳϯƴχʜџ ⱀѧʜѣɯє ѧⱀєʍєʜⱀ ґʌѧʙʜѳє ҁƀӀʜ ґѳʙʜѧ ϯƀӀ єѣѧʜѳґѳ ᴙ ϯєѣє ϯƴϯ ʍѧϯƀ ѧʌʙʍ πʌѧʍєʜєʍ πѳκⱀѳѥ κѧκ đⱀѧґѳʜ ʜѧχκӣ ϯƀӀ ϯƴϯ єѣƴӌџҵ κѧҁϯⱀѧϯ đѧѫє ʜє πѳʜџʍѧєɯƀ ӌϯѳ ӌ ϯєѣє ϯƴϯ ѣƴđƴ ҁџđєϯƀ ҁʍєʌѳ ʌѳʍѧϯƀ єѣʌџѱє đʌ ϯѳґѳ ʍѳʍєʜϯѧ πѳκѧ ϯƀӀ ʜє πⱀџӡʜѧєɯƀ ʙҁє ҁʙѳџ πⱀѳєѣʙ џ ӡʙѧʜџє ҁƀӀʜκѧ ɯʌѥχџ ϯʙ πѳʜᴙʌ ϯѧʍ ʍєʜᴙ ʜєϯ ҁѳπʌєѫƴҵ єѣѧʜƀӀӣ κѳϯѳⱀƀӀӣ ҁӌџϯѧєϯ ӌϯѳ 1500 ҁʌѳʙ ϶ϯѳ ѳґⱀѳʍʜƀӀӣ ϯєκҁϯ ϯƀӀ џ ʙ ѫџӡʜџ ҁ ʍѳџʍ ӌʌєʜѳʍ  ʜє ҁπⱀѧʙџɯƀҁᴙ ϯʙ đѧѫє ʜє πѳʜџʍѧєɯʌ ʜѧ ӌϯѳ πѳđπџҁѧʌҁᴙ ҁѳπʌᴙκ єѣƴӌџӣ ϯƀӀ đѧʙѧӣ ʍʜє ϯѧʍ ҁѳҁџ ϯєʌѧӌκѧ ҁʌѧѣѧᴙ κѳϯѳⱀѧᴙ ϯƴϯ ӌʌєʜƀӀ ҁѳҁєϯ џ đƴџѧєϯ ӌϯѳ ʍѳҵ ӌʌєʜ ϯєѣӌ ʍџʍѳ ѳѣѳӣđєϯ ʜѳ ϶ϯѳ ʜє ϯѧκ ϯєʌκѧ ϯƀӀ ҁʌѧѣѧӌ ʙƀӀѣʌᴙđѳκ ʜџѱџӣ ϯƀӀ ϯƴϯ ʜѧџҁʌѧѣєӣɯџӣ ҁƀӀʜ ϯєⱀπџʌƀʜѳӣ ƴⱀѳđʌџʙѳӣ ӌєⱀʜѳѫѳπѳӣ πƴӡѧϯѳҵ ɯѧʌѧʙƀӀ ϯƴϯ ѣƴđєɯʌ ҁџđєƀѣ џ κ κѧѫđѳґѳ ƴґʌѧ ʌѳʙџϯƀ ƴđѧⱀƀӀ ʍѳџʍ ʍєϯѧʌʌџӌєҁκџʍ ѣⱀџʌʌџѧʜϯѳʙƀӀʍ ѣѳґѳπѳđѳѣʜƀӀʍ κƴʌѧκѳʍ ϯƀӀ ϯѧʍ πѳʜᴙʌ ʍєʜӌ ʜєϯ ϯєʌκѧ ҁʌѧѣѧᴙ ϯƀӀ ϯƴϯ đѧʙѧӣ đƴχѳʍ ѳҁѳѣѳ ʜє πѧđѧӣ ᴙ ϯєѣє πѳʙϯѳⱀѥҁƀ ᴙ ҁ ϯєѣᴙ ϯκϯ ʙҁѥ đƴπƀ ʙƀӀѣƀѥ ʜѧχƴӣ ϯƀӀ ϯѧʍ ʜє πѳʜᴙʌ єѱё ϶ϯѳ џʌџ κѧκ ϯƀӀ ϯѧʍ đѧʙѧӣ ҁѳҁџ ʜѧχƴӣ ϯѳʌƀκѳ πѳπⱀѳѣƴӣ ϯƴϯ ʍʜє ӌʌєʜ ѳϯҁѳҁѧϯƀ ӌ ϯєѣє ϯƴϯ ΣѢѦΛƀⴼЏҞ ʜѧχƴӣ ʜѧѣєⱀƴ ϯƀӀ πѳʜᴙʌ ʍєʜᴙ џʌџ ʜєϯ",
'ϯƀӀ ʜѧχƴᴙ πⱀѳϯџʙ ʍѳєґѳ χƴᴙ πѳɯєʌ ϯƀӀ ʜєđѳєѣƀӀɯ єѣѧʜƀӀӣ? ꯌ ѫє ϯєѣᴙ ѣƴđƴ ҁʜѳҁџϯƀ ѱᴙҁ κѧκ ʍѧϯƀ Ǝʌđѫєᴙ κѳϯѳⱀѧᴙ ʍʜє χƴӣ πєⱀєҁѳҁѧʌѧ џ ⱀџπʜƴʌѧҁƀ=Δ',
"ʜƴ ϯƀӀ πџӡđєҵ єѣѧʜƀӀӣ ҁƀӀʜ ɯѧʌѧʙƀӀ πѳӌєʍƴ ѫє ϯʙѳᴙ єѣѧʜѧᴙ ɯʌѥχѧ ʍѧϯƀ ʜѧᴙⱀџʙѧєϯ ʍѳӣ χƴӣ ⱀєґƴʌᴙⱀʜѳ, ϯѧκџʍџ ϯєʍπѧʍџ ᴙ ʜѧӌʜƴ єє ѫє πⱀѳҁϯѳ ʙѳ ʙҁѥ єѣѧɯѧϯƀ κѧκ ʜє κѧκ ϯƀӀ đѳʌѫєʜ πѳʜᴙϯƀ ӌϯѳ ϯƀӀ ҁƀӀʜ ɯʌѥχџ џ ʜє κѧκ џ ʜє ѣѳʌєє ʜƴ ϯѧκ ʙѳϯ єѣʌџѱє ҁʙѳє ѱєʍѧʜџ ѳϯҁϯѧʌƀӀӣ ҁƀӀʜ ɯʌѥχџ ᴙ ϯʙѳѥ ѫє ʍѧϯƀ єѣѧʌ",
"ϯƀӀ ӌє ϯѧʍ ҁđѧєɯƀ πѳӡџҵџџ ϯѳ ҁʙџʜƀᴙ ϯƀӀ єѣѧʜʜѧᴙ ʍѧʌѳѳʍѱʜѧᴙ κѳϯѳⱀƴѥ ᴙ ѣƴđƴ ϯѳπѧϯƀ ҁʙѳџʍ χƴєʍ đѧʙѧӣ ϯѧʍ χѳϯƀ πѳ κʌѧʙџѧϯƴⱀє πѳπѧđѧӣ ϯѳ ⱀƴӌєʜκѧʍџ ҁʙѳџʍџ đⱀѳѫѧѱџʍџ єѣѧʜʜƀӀӣ ѳʌџґѳѻⱀєʜ ӌϯѳ ϯƴϯ ʙƀӀπєӡđƀӀʙѧϯƀҁᴙ ʜѧ ʍѳєӣ χƴєҵ ƴđƴʍѧʌ ʙѳʙҁє đѧѫє ʜєπѳʜџʍѧᴙ ϯѳґѳ ӌϯѳ ᴙ ʙѧʍ ɯʙѧʌᴙʍ đєґⱀѳџđʜƀӀʍ ϯƴϯ πєⱀєϯѳπӌƴ єѣѧʌџѱє ӡѧ ʙҁє ʙƀӀπєӡđƀӀʙѧʜџᴙ πѳ ѳϯʜѳɯєʜџѥ κ ʍѳєʍƴ χƴѥ ӡѧѣџϯƀӀє ҁϯєⱀʌᴙđџ",
"đѳʌѣѳєѣџӌєҁκѧᴙ ҁʙџʜƀᴙ ʜѧχƴӣ ѳπⱀѧʙđѧӣ ҁʙѳѥ ʍѧϯƀ ɯʌѥχƴ πѳđѳѣʜƴѥ ʍʜє πѳҁʌє ѳϯҁѳҁѧ πєʜџҁѧ ᴙ ϯє ϯʙѳє ҁʙџʜѳє ⱀƀӀʌѳ ҁєѣє ʜѧ πєʜџҁ πѳҁϯѧʙџʌ, ʍʜє ʙ πєʜџҁ ɯʍѧⱀѧ єѣʌџҁϯѧᴙ ᴙ ϯє πєʜџҁѳʍ ʙҁѥ ϯʙѳѥ ϯƴɯκƴ ҁʌѳʍѧѥ ҁʙџʜ ϯƴπѳⱀʌƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ɯʌѥχѧʜҁκџє ҁπѳҁѳѣʜѳҁϯџ đєʍѳʜҁϯⱀџⱀѳʙѧʌ ʙ ѣƀӀҁϯⱀѳʍ ϯєʍπє ҁʙџʜƴϯӡ єѣѧʜƀӀӣ πⱀѳѣʌᴙđƀ ϯƀӀ ʜѧχƴӣ ϯƀӀ ʍʜє ϯƴϯ ҁʙѳѥ πѧҁϯƀ ʜє ʙҁκⱀƀӀʙѧӣ џ ʜє ʌѳʍѧӣ πⱀџ ʙџđє ӌʌєʜѧ ѧ ʜѧӌџʜѧӣ єґѳ ʙҁєʍ ⱀϯѳʍ πⱀџʜџʍѧϯƀ ʙ ҁєѣᴙ đѳ κџɯєκ ʜѧχƴӣ πѳκѧ ᴙ ϯє џχ ӌʌєʜѳʍ ʜє ʙƀӀⱀʙѧʌ πѧҁϯʌџʙѧᴙ ϯƀӀ χƴӣʜᴙ ʜѧχƴᴙ ʍʜє ϯʙѳџ ɯѧѣʌѳʜƀӀ єѣѧʜƴϯƀӀӣ ѣʌᴙϯƀ ҁʙџʜѳґʌѧӡƀӀӣ ϯƀӀ ʜџӌѳ ʜє ʍѳѫєɯƀ κⱀѳʍє κѧκ ʙπџϯƀӀʙѧϯƀ ʙ ҁєѣᴙ ӌʌєʜƀӀ ʍѧϯƀ ϯʙѳᴙ џґⱀѧʌѧ ҁѳ ʍʜѳӣ ʙ ɯѧɯκџ џ ᴙ єӣ ɯѧɯκѧʍџ ʍѳӡґ ʙƀӀⱀʙѧʌ ƴ ʜєє ʍѳӡґѧ ʜє χʙѧϯџʌѳ ҁƀӀґⱀѧϯƀ ҁѳ ʍʜѳӣ ʜѳ đѳđƴʍѧʌѧҁƀ ѳϯҁѳҁѧϯƀ ʍʜє ʙѳ ʙҁѥ ʍѳѱƀ ϯєⱀπᴙ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʙѳɯёʌ  ʙ єє đⱀƀӀχʌƴѥ πџӡđƴ κƴđѧ ҁⱀѧʌ џҁπѧʌџʜ ʙʍєҁϯѳ ϯƴѧʌєϯє đѧѫє ϯƴѧʌєϯ ӡѧҁʌƴѫџʙѧєϯ ѣѳʌƀɯєґѳ ӌєʍ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯџϯƴϯκѧ ƴҁѳҁѧʙɯѧᴙ ӌʌєʜƀӀ џҁπѧʌџʜѧ џ đєҁѻєⱀѧʜϯѧ ѻⱀџκѳπѳđѳѣʜƀӀӣ κѳґđѧ ƴ ϯᴙ đєʜƀ ⱀѳѫđєʜџє ѣƀӀʌѳ ᴙ ϯє ʙʍєҁϯѳ ϯѳⱀϯѧ πⱀџʜєҁ ӌʌєʜ κѳϯѳⱀƀӀӣ đѧʌєє ʙπџχѧʌ ϯєѣє ʙ ⱀѳϯѳʙƴѥ πѳʌѳҁϯƀ ᴙ ϯє ʙѧґџʜƴ πⱀѳɯџʙѧʌ ӌʌєʜѳʍ πєɯκѳʙџđʜƀӀӣ ϯƀӀ ʜѧχƴӣ ʍʜє ӌʌєʜ ϯƴϯ κѧκ ёʌκƴ ƴ ҁєѣᴙ đѳʍѧ ҁϯѧʙџʌ ƴѣʌᴙđƀ єѣѧʜѧᴙ πⱀѳҁѧҁƀӀʙѧӣ χƴџ ϯƴϯ πѳκѧ ᴙ ϯє ҁєⱀđҵє єʍ πѳđ ʌѥѣџʍƴѥ ʍƴӡƀӀκƴ ϯʙѳєӣ ʍѧϯєⱀџ ɯʌѥχџ ɯʌѥχѧʜđⱀѧ ϯƀӀ єѣѧʜѧᴙ ʍѧϯєⱀџɯʌѥχє ϯƀӀ ⱀѧҁҁκѧӡƀӀʙѧʌ κѧκ ʍʜє ϯƴϯ ӌʌєʜ ҁƴɯџʌ ⱀƴκѧʍџ џ đѧʌєє πⱀѳʍƀӀʌ ⱀϯѳʍ ᴙ ϯє ϯƴϯ ⱀєѧʌƀʜѳ ӌʌєʜƀӀ ϯєѣє πⱀѳʙєɯƴ ʙ єѣʌѳ ϯʙѳє ᴙ ϯє ϯƴϯ πѳđπѳʌƀʜƀӀӣ ѣџӡʜєҁ ϯʙѳєӣ ʍѧϯєⱀџ ҁʌѳʍѧʌ κѳϯѳⱀƀӀӣ ӡѧκʌѥӌѧʌҁᴙ ʙ ѳϯҁѳҁє πєʜџҁѳʙ ѳʜѧ κʌᴙʜӌџʌѧ đєʜƀґџ ᴙ ӡѧʙѳđџʌ єє κ ҁєѣє đѳʍѳӣ ϶ϯƴ ʜє ҁƀӀϯƴѥ ɯʌѥχƴ κѳϯѳⱀƴѥ ᴙ ʜѧκѳⱀʍџʌ ҁʙѳџʍ ӌʌєʜѳʍ ҁʙџʜѳπѳđѳѣʜƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ӌʌєʜ ҁʙѳџʍ ⱀƀӀʌѳʍ єѣѧʌ ʜџѱєєѣ ϯƀӀ єѣѧʜƀӀӣ ᴙ ϯє ϯƴϯ ⱀƀӀʌѳ ӌʌєʜ πⱀѳѣџʙѧѥ џ ӡѧѣџʙѧѥ κѧκ ґʙѳӡđƀ ᴙ ʙ ѳѣʌџκє ϯʙѳєӣ ʍѧϯєⱀџ πⱀѳđѧʌ ϯєѣᴙ ʜѧ ⱀƀӀʜκє ґđє ϯᴙ ʙӡᴙʌџ ӡѧ ʜѧ πⱀѳκѧϯ ʜѳ ʙʍєҁϯѳ ϶ϯѳґѳ ϯєѣᴙ ӌʌєʜѳʍ ƴѣџʌџ ᴙ ϯє ӌʌєʜѳʍ ʙєʌ πѳ ϯʙѳєʍƴ ҁʙџʜҁκѳʍƴ ⱀƀӀʌƴ",
"đѧ ӡѧκⱀѳҵ ƴѫє ҁʙѳє ҁʙџʜʜѳє ⱀƀӀʌѳ κѳϯѳⱀѳє ϯƀӀ ϯƴϯ ѳϯκⱀƀӀʌѧ đѧѫє ʜє πѳʜџʍѧᴙ ϯѳґѳ, ӌϯѳ ӡѧ ϶ϯџʍ πѳҁʌєđƴєϯ џ κѧκ ϯƀӀ ʙџđџɯƀ ᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ϯƴϯ ѣєӡ ʙҁᴙκџχ πⱀѳѣʌєʍ πѳҁϯєπєʜʜѳ ϯєѣє ϯƴϯ ϯʙѳѥ ϯƴɯκƴ ϯєⱀӡѧѥ ҁʙѳџʍ ӌʌєʜѳʍ ҁʌѳʙʜѳ Ѻⱀєđđџ Ҟⱀѥґєⱀ ʙ ϯʙѳџχ ʜѳӌʜƀӀχ κѳɯʍѧⱀѧχ ѣƴđƴ πⱀџχѳđџϯƀ џ πⱀџʜѳҁџϯƀ ϯєѣє ѳѱƴϯџʍƴѥ ѻџӡџӌєҁκƴѥ ѣѳʌƀ đѧѫє ӌєⱀєӡ ҁʜƀӀ ʜѧҁϯѳʌƀκѳ ʍѧʜᴙʍџⱀѳӌʜѧᴙ ɯʙѧʌƀ đƴʍѧєϯ ӌϯѳ ҁʍѳѫєɯƀ ʍʜє ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳҁʌє ϯѳґѳ κѧκ ᴙ ϯєѣᴙ ϯƴϯ ʙƀӀϯⱀѧχѧѥ ʙ ϯʙѳёʍ ҁϯѳᴙӌєʍ ҁѳҁϯѳᴙʜџџ κѳґđѧ ϯƀӀ ѣƴđєɯƀ ѳϯ џҁϯѳѱєʜџᴙ ʜѳ ʙҁє ⱀѧʙʜѳ đєⱀѫѧϯƀҁᴙ ʜѧ ʜѳґѧχ πѳҁʌєđʜџʍ ӌϯѳ ϯƀӀ ƴʙџđџɯƀ ʙ ϯѳϯ ʍџґ ѣƴđєϯ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʍєʌƀκѳʍ πⱀѳʍєʌƀκʜєϯ ʍєѫ ϯʙѳџχ ґʌѧӡ πѳҁʌє ӌєґѳ ϯƀӀ єҁϯєҁϯʙєʜʜѳ ѳϯκʌѥӌџɯƀҁᴙ πѳϯѳʍƴ ӌϯѳ ϯʙѳџ ѫџӡʜєʜʜƀӀє ҁџʌƀӀ ѣƴđƴϯ πѳʌʜѳҁϯƀѥ џҁϯѳѱєʜƀӀ єѫєʍџʜƴϯʜƀӀʍ ѳϯҁѳҁѳʍ πѳʜѳɯєʜʜѧᴙ κƴκʌѧ џҁκʌѥӌџϯєʌƀʜѳ đʌᴙ ѳϯѣєʌџʙѧʜџᴙ ʍѳєґѳ ӌʌєʜѧ ҁʙѳџʍ ᴙӡƀӀκѳʍ ϯƀӀ ѣƴđєɯƀ ʌџɯƀ ҁʜѳʙѧ џ ҁʜѳʙѧ ϯѧκ ҁκѧѫєʍ ҁѳ ҁʌєӡѧʍџ ʜѧ ґʌѧӡѧχ πⱀѳҁџϯƀ ƴ ʍєʜᴙ ʍџʌѳҁϯƀӀʜџ ʙєđƀ ϯƀӀ ʜє ҁπѳҁѳѣʜѧ ʜѧ đѧʌƀʜєӣɯєє ⱀѧӡʙџϯџџ ҁѧʍѳҁϯѳᴙϯєʌƀʜѳ πѳϯѳʍƴ ӌϯѳ ƴѫє πѳκʌᴙʌѧҁƀ ʙ ʙєⱀʜѳҁϯџ ʍѳєӣ χƴџʜє ӌϯѳ đѧёϯ ϯєѣє ѧʙϯѳʍѧϯџӌєҁκџ πѳʜџʍѧϯƀ ӡʜѧӌџʍѳҁϯƀ ʍѳєґѳ ӌʌєʜѧ πєⱀєđ ϯʙѳєӣ ʙѧґџʜѳӣ κѳϯѳⱀѧᴙ πѳҁϯѳᴙʜʜѳ џҁϯєκѧєϯ ѳѣџʌƀʜѳ ҁѳκѧʍџ đѧѣʙ πⱀџʙʌєӌƀ ʙʜџʍѧʜџє ʍѳєґѳ ӌʌєʜѧ κ ҁєѣє џ ʜѧκѳʜєҵ ӡѧπѳʌƴӌџϯƀ єґѳ ʙʜƴϯⱀџ ҁєѣᴙ ҁʌѳʙʜѳ ѳχѳϯʜџκ ѫđѧʙɯџӣ ҁʙѳѥ đџӌƀ ʜєҁκѳʌƀκѳ ӌѧҁѳʙ πѳđⱀᴙđ ѣєӡ ҁʜѧ πѳʜџʍѧєɯƀ đѧ ϯƀӀ ҁʙџʜʜѧᴙ ϯƴɯκѧ єѣѧʜѧᴙ ѣƴđєɯƀ ʍʜє ϯƴϯ ҁѳҁѧϯƀ ʜѧ πѳҁϯѳᴙʜʜѳӣ ѳҁʜѳʙє ѣєѧʜᴙ πѧđѧʌƀ єѱё ⱀѧӡ ᴙ ѣƴđƴ ʜѧѣʌѥđѧϯƀ κѧκ ϯƀӀ ʍʜє ϯƴϯƴ ѳϯҁѧҁƀӀʙѧєɯƀ πѳ πѳʌʜѳӣ πⱀѳґⱀѧʍʍє ᴙ ϯєѣє ϯƴɯκƴ џӡⱀєѫƴ κѳπⱀѳѻџʌϯʜʙᴙ ϯєʌκѧ ʍєѱџʜҁκѧᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӌєⱀєπƴɯκƴ ҁʜєҁƴ ϯƴϯ ϯєѣє πџđѳⱀѧҁ ʙɯџʙƀӀӣ єѣѧʜʙᴙ ϯєʌκѧ ʜє πѳʌƴӌѧєϯҁᴙ ƴ ϯєѣᴙ ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳκѧ ᴙ ϯєѣє ϯƴϯ єѣѧґƴѥ ӡѧʌƴπƴ ϯєⱀⱀѳⱀџӡџⱀƴѥ πѳʜџʍѧєɯƀ đѧ ʜѧҁκѳʌƀκѳ ϯƀӀ ϯƴϯ ѫѧʌѳκ πⱀєđѳ ʍʜѳӣ ӌϯѳ ᴙ ѣƴđƴ ӌѧҁϯџӌʜѳ ϯѧκ ѫє πѳκѧ ϯєѣᴙ єѣƴ ϯʙѳѥ ɯʌѥχѳʍѧϯєⱀƀ џӡƀєѣƀӀʙѧϯƀ",
"đѧʙѧӣ ƴѫє ʍѳѥ ӌʌєʜџʜƴ ʙєʌџӌєҁϯʙєʜʜƴѥ πѳʌʜѳҁϯƀѥ ʜѧӌџʜѧӣ πѳґʌѳѱѧϯƀ ӌϯѳѣƀӀ ᴙ ϯєѣє єѥ ʜѧӌџʜѧʌ ƴѫє ʜѧχƴӣ ʙҁє ϯʙѳџ ʍџʜđѧʌџʜƀӀ ƴđѧʌᴙϯƀ ҁʌѳʙʜѳ ʜєӣⱀѳχџⱀƴⱀґџӌєҁκџʍ ҁπѳҁѳѣѳʍ ʜѧχƴӣ ҁƀӀʜƴʌᴙ πⱀѳҁϯѳʌѥđџʜҁκѳӣ ƴκⱀѧџʜҁκѳӣ ʍѧⱀџƴπѳʌƀҁκѳӣ ɯʍѧⱀᴙϯџʜƀӀ ϯƀӀ đƴӣ ϯѧʍ ӌϯѳ-ʌџ χѳχʌᴙʜđџѥ ҁʙѳѥ ӡѧѱџѱѧϯƀ ҁʍⱀѧđѳʙҁκџӣ ҁƀӀʜ χƴєϯƀӀ ʙҁⱀѧϯѳӣ,đѧʙѧӣ ӡđєҁƀ ƴѫє ӌϯѳ-ʌџ πⱀᴙʍѳ ҁѳ ҁʙѳєӣ ѣѳʍѫєҁєʍєѥɯκѳӣ κⱀƴґ ƴҁϯⱀѧџʙѧӣ ʙʙџđє ѣʌџʜѧ џ ʙƀӀӡƀӀʙѧӣ đƴχѳʙ ҁπєⱀʍѳʙƀӀχ џӡ ʍѳєӣ πⱀѳʍєѫʜѳҁϯџ ӡѧʌƴπџʜҁκѳπѳʌѳʙѳӣ ӡѳʌѳϯџҁϯѳӣ ҁƀӀʜѳκ πⱀѳѻƴⱀҁєϯκџ єѣƴӌєӣ ƴѫє πѳκѳӣʜƀӀӣ,ʍđѧʍ, πџđѳⱀџҁϯџӌєҁκџӣ πⱀџđƴⱀκѳʙѧϯƀӀӣ ʜѧ ʙҁѥ ѣѧɯκєʜҵџѥ ѳϯɯџѣʌєʜʜѳѣѳʌƀʜѳӣ πⱀѳκѳʜӌєʜƀӀӣ ϯƀӀ ϯƴϯ đƴʍѧєɯƀ ƴ ʍєʜᴙ ѳґⱀѧʜџӌєʜџє єҁϯƀ ҁκѳʌƀκѳ πџҁѧϯƀ ʜѧ ѳѣъєʍѧχ? ѧʙҁϯⱀѧʌѳπџϯєκ єѣѧʜƀӀӣ ϯƀӀ đѧѫє ʜє ʙ ҁѳҁϯѳᴙʜџџ ʜѧπџҁѧϯƀ ʙ ɯκѳʌє ҁѳӌџʜєʜџє ʜѧ 90 џʌџ 100 ҁʌѳʙ ѧ ϯƀӀ ϯƴϯ ⱀєɯџʌҁᴙ κџʜƴϯƀ ʙƀӀӡѳʙ κѳⱀѳʌѥ πѧҁϯѳπџҁѧʜџᴙ ҁƀӀʜ ʙ ҵѧⱀҁϯʙѳ χⱀџҁϯѳʙѳ ѳϯѳɯєđɯєӣ πѳκѳӣʜѳӣ ɯʌѥχѧʜџʜƀӀ ѧʍѳⱀѻʜѳӣ ʍʜє ѻѧʜϯѧӡџџ χʙѧϯџϯ ӌϯѳѣƀӀ ʜѧπџҁѧϯƀ χѳϯƀ 400 ϯƀӀҁᴙӌ ҁʌѳʙ đѧ χѳϯƀ 1 ʍџʌʌџѳʜ ʜѧχƴӣ,ʍʜє ʜєϯƴ ⱀѧʙʜƀӀχ ӌϯѳ ʙ ⱀƴʜєϯє ӌϯѳ ʙѳ ʙҁєʍ ʍџⱀє єѣѧʜƀӀӣ ҁџѻџʌџҁʜƀӀӣ ҁƀӀʜ πʌѳҁκѳҁϯѳπʜѳӣ πџđѳⱀѧҁʜџҵƀӀ ʜєʍѳѱʜѳӣ ґⱀƴӡџʜҁκѳӣ ҁʍєѧґѳʌƀʜѳӣ κƴⱀϯџӡѧʜκџ πⱀѳѱє ґѳʙѳⱀᴙ,ϯѧκ-κѧκ ᴙ ϯѧκ ҁκѧѫєʍ đѳѣʌєҁϯʜƀӀӣ џ ʍџʌѳҁєⱀđʜƀӀӣ đѳѣⱀѳđƴɯʜƀӀӣ ҵѧⱀƀ ҁџᴙ πѧҁϯѳπџҁѧʜџᴙ ґđє ʜџκϯѳ đѧѫє ʜє ҁʍєєϯ πⱀџ ʍѳєʍ πⱀџҁƴϯҁϯʙџџ ʙ ϯⱀѳʌʌџʜґє πⱀєϯєʜđѳʙѧϯƀ ʜѧ ϶ϯѳϯ ϯⱀѳʜ ҵѧⱀҁκѳκѳⱀѳʌєʙҁκѳκʜᴙѫƀџӣ,ϯѳ ᴙ ϯѧκ ƴѫ џ ѣƀӀϯƀ ҁʙѳџʍ ѧʌʌѧχѳʙҁκџʍ ӌʌєʜѳʍ ʜѧ πєⱀʙƀӀӣ ⱀѧӡ πѳѱѧѫƴ єҁʌџ ϯƀӀ ѳđƴʍѧєɯƀҁᴙ ʙҁє ϯѧκџ ӡѧκⱀƀӀϯƀ єѣѧʌƀʜџκ ҁʙѳӣ ʜѳ ʙѳϯ єҁʌџ ϯƀӀ πⱀѳđѳʌѫџɯƀ πѳπƀӀϯκџ κѧκџє ʌџѣѳ ҁʙѳєѳѣⱀѧӡʜƀӀє ʙƀӀđѧϯƀ χѳϯƀ κѧκѳє-ϯѳ ҁѳπⱀѳϯџʙʌєʜџє",
"ᴙ ƴѫє ʜє ҁѫѧʌѥҁƀ ʜѧđ ϯѳѣѳӣ ґѧđєʜƀӀɯ џʜҵєѻѧʌџϯʜƀӀӣ џ ҁπƴѱƴ ϯєѣᴙ ʜѧχƴӣ πⱀᴙʍџκѳʍ ʙ πⱀєџҁπѳđʜѥѥ ѳʍєѫʜѧᴙ đєѻєκϯʜѧᴙ ʜєđєєҁπѳҁѳѣʜѧᴙ đєʙӌѳʜκѧ ʌƴɯπѧӣʜѧᴙ ѳҁєϯџʜҁκѧᴙ ʜєѧʜđєⱀϯѧʌƀҁκѧᴙ ҁƴκѧ ʌєҁѳπѳʙѧʌƀʜѧᴙ ʜѧӌʌєʜʜѧᴙ,ᴙ ϯєѣє πⱀѳʍєѫ ӡƴѣѳκ ʙ ѳҁϯѧʙʌєʜʜƀӀє ʍʜѳѥ ҁđʙџʜƴϯƀӀє πⱀѳⱀєχџ ѣƴđƴ ӡѧϯѧʌκџʙѧϯƀ ʍᴙҁѳ ϯʙѳєӣ ҁʙџʜѳʍѧϯƴɯκџ ɯʌѥχѳʙџϯѳӣ πѳѣʌᴙđƴχџ ҁѳđⱀѧʜʜѳє πѳҁʌє ѳχѳϯƀӀ џ ʙƀӀⱀєӡκџ єє ϯƴɯџ ҁʙџʜѳѳѣⱀѧӡʜѳӣ πѳđѫѧⱀџʙɯєӣҁᴙ ʜѧ κѳҁϯⱀє ѧѣѳⱀџґєʜѳʙ ҁ πʌєʍєʜџ ѣƴѣѧʌѳʙ ʙ ѧѻⱀџκѧʜҁκѳʍ ʌєҁƴ ʜѧχƴӣ, єѣѧʜƀӀӣ ϯƀӀ ʍѧʌƀӌƴґѧʜ đѧʙѧӣ ϯƴϯ ϯѧʜҵƴӣ ϯѧʜґѳ ҁ ʍѳџʍ πєʜџҁѳʍ єѣѧϯƀ ҁѳ ҁʙѳџʍџ đⱀƴӡƀᴙɯκѧʍџ ѱєʜѳӌκѧʍџ џ ѣѳʍѫєҁєʍєӣκѳӣ єҁϯєҁϯʙєʜʜѳ єѣѧʜƀӀӣ ʍџκⱀѳҵєѻѧʌ џʜѻєκҵџѳʜʜƀӀӣ єҁϯєҁϯʙєʜʜѳ ϯƀӀ ѣƴđєɯƀ πѳҁʌє ҁχʙѧϯκџ ҁѳ ʍʜѳӣ ƴχѳđџϯƀ ѳϯҁѥđѧ πѳʌƴѫџʙѳӣ ҁ κƴӌєӣ ґєʍѧϯѳʍ џ ҁџʜᴙκѳʙ πѳ ҁʙѳєʍƴ ҁʙџʜѳⱀƀӀʌƀʜџκƴ ϯƴπѳʍѳⱀđѳʍƴ ѣʌᴙđƀё ʍѧʌѳʍѳѱʜѳє, ѣєѫєʜєҵ єѣʌџʙƀӀӣ đѳʜѣѧҁҁκџӣ ʜєҁƴⱀѧӡʜƀӀӣ ʍѧʌѳџʍƴѱџӣ ҁʌѧѣѳχѧⱀѧκϯєⱀʜƀӀӣ,ᴙ ϯєѣє џ ɯѧʜҁѧ ʜѧ ʙƀӀѫџʙѧʜџє ҁѳ ʍʜѳӣ ʙ ҁχʙѧϯκє ґđє ᴙ ⱀѧӡƴʍєєϯҁᴙ ѳҁϯѧʜƴҁƀ πѳѣєđџϯєʌєʍ ʜє đѧʍ ʙƀӀκџđƀӀɯ πѳҁѳҁѧʙɯџӣ ʍʜє ʜѧ ѳѣъєʍє ӌϯѳ ᴙ ʙџѫƴ ƴѫє ʜѧπєⱀєđ ҁ ѳπʌєҁʜєʙєʌƀӀʍ πⱀƀӀѱѧʙƀӀʍ џҁκⱀџʙʌєʜʜƀӀʍ џӡ ӡѧ ƴđѧⱀѧ ѳѣъєʍʜƀӀʍ ҵџʌџʜđⱀѳʍ πѳ ӌєʌᴙґє, ᴙ ϯєѣᴙ ҁєӣӌѧҁ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӡѧκѳπѧѥ ʙ ʌєҁѳҁϯєπџ ʍѳʜґѳʌƀҁκѳӣ ӡѧѫџʙѳ πѳʙєҁџʙ ʌѧʍπѧđƴ ѳϯ κѳϯѳⱀѳӣ ʙҁє ѣƴđƴϯ ӡѧκƴⱀџʙѧϯƀ ҁџґѧⱀєϯκƴ πѳκѧ ϯʙѳᴙ ʍѧϯєⱀƀ ɯʌѥχѧ πѳđπѳʌƀʜѧᴙ ʙ κѧӡѧχҁϯѧʜҁκѳʍ κѧӡџʜѳ ҁ ѣџʌƀᴙⱀđѳʍ ѣƴđєϯ ӡѧκƴⱀџʙѧϯƀ χƴџ ҁʙѳџχ πѳҁєϯџϯєʌєӣ-πѳκƴπѧϯєʌєӣ єє ҵєʌѳҁϯʜѳҁϯџ ѧ κҁϯѧϯџ, ʙ ʌєҁƴ ґđє ᴙ ҁєӣӌѧҁ ҁѳѣџⱀѧѥҁƀ ӡѧκѳπѧϯƀ ϯєѣᴙ ʙ ʍѳґџʌє ʍєχѧʜџӌєҁκѳӣ ѫєʌєӡʜѳӣ ӡѧѫџʙѳ κѧκ ⱀѧӡ ϯѧκџ ϯʙѳѥ ʍѧϯєⱀƀ ӡѧʍƴӡґѧʜκƴ ɯʌѥχѳџđѳʙʜџϯџӡџⱀѳʙѧʜʜƴѥ κѳπⱀѳѻѧѫʜƴѥ џ ѳϯπⱀѧʙџʌџ ʙ ҵѧⱀҁϯʙѳ ʜєѣєҁʜѳє ϯєʍ ӌϯѳ đѧʌџ єӣ ѳđʜѳґѳ ʌєѱѧ ʜƴ џ ⱀѧӡƴʍєєϯҁᴙ ʙ ҁʌєđҁϯʙџџ ҁʙѳєӣ đⱀџѱƴґѧʜʜѳҁϯџ ѳʜѧ πⱀѳҁϯѳ ʙ πƀӀʌџʜκџ ʍџκⱀѳҁκѳπџӌєҁκџ-ҁƴѣѧϯѳʍʜƀӀє ⱀѧӡʌєϯєʌѧҁƀ ʜƴ џʌџ ѫє џҁπєπџʌџʌѧҁƀ",
"ϯƀӀ κƴđѧ ʌєӡєɯ ҁʙџʜѳπѧҁ єѣѧʜƀӀӣ πѳ κʌѧʙє ҁѳʌџ πѳđѧӣ ϯƴϯ ᴙ ϯєʍѧϯѧƀ ʍѧϯƀ єѣѧʌ ϯƀӀ ѫє πѳʜџʍѧєɯ ӌϯѳ ϯƀӀ ҁʙџʜ єѣѧʜƀӀӣ πⱀџɯєʌ πѳҁʌє 30 ʍџʜƴϯ ѳϯҁѳҁѧ ʍѳєґѳ χƴᴙ џ ϯƴϯƴ πⱀџɯєʌ ҁѳҁѧϯƀ ʍʜє ϯƀӀ ѫє ѫџⱀʜєӣɯџӣ ҁƀӀʜѳκ ɯѣѫџχ ҁѳѧʌѧ ʍѳєґѳ χƴᴙ ϯƴϯƴ ᴙ ϯє ҁϯѧʌ єѣѧʌ ҁƀӀʜѳκ ɯđѥχџ ϯƀӀ єѣѧʜѳӣ ᴙ ϯє ʍѧϯƀ єѣѧʌ πѳҁƀӀʜѳκ ʍѳѧӡʍѳϯџӌʜѳӣ ѣʌᴙđџ ɯʌѥχџ ᴙ ϯє ʍѧϯƀ єѣѧʌ ґʙѳѳⱀѥ ѫє ѧƴƴ ҁƀӀʜѳκ πⱀѳҁϯѳƀӀџʌџⱀ ϯƀӀ єѣѧʜѳƀӀӣ ϯᴙ ѫє ᴙ ƴѫє єѣѧʌ ʜѧχƴӣ ҁƀӀʜѳκ ʍєⱀӡκѳӣ ɯʌѥχџ ᴙ єє ѱѧҁ єѣѧʌ ʜѧχƴӣ ᴙ ϯє ϯʙѳџ κѳҁϯџ πѳʙƀӀⱀʙƀӀѧʌ  ᴙ ϯє ʍѧϯƀ ϯƴϯƴ πѳєѣѧʌ џ ʙπⱀѧʙđƴ ϯƀӀ ѫє ʍʜє ҁѳҁʌѧ  ҁƀӀʜѳκ ɯʌѥχџ ϯƀӀ ʍєⱀӡκџӣ ҁѳҁџ ʍѳєґѳ χƴᴙ ᴙ ϯє ґѳⱀʌƀӀɯκѳ ϯʙѳє πєʜџҁѳʍ ҁѣџʌ ʜѧχƴӣ πѳҁʜʙѳκ ѣʌᴙđџ єѣѧʜƀӀӣ ϯєⱀπџ ʍѳєґѳ χƴᴙ ϯƴϯƴ ҁƀӀʜѳκ ɯʌѥχџ ϯƀӀ єѣѧʜѳӣ ᴙ ϯє ʍѧϯƀ єѣѧʌ ",
"ʍѧϯƀ ϯє єѣѧʌ ϯƴϯƴ ʜƴ ϯƀӀ ѫє πѳʜџʍѧєɯ ӌϯѳ ϯƀӀ ҁʙџʜ єѣѧʜƀӀӣ ҁѳҁѧʌ ʍѳєґѳ  χƴᴙ πѳ ʙҁє ʍ ҁϯѧϯѧʍ ᴙ ϯє ҁϯѧʌ єѣѧʌ ϯƴϯƴ ᴙ єє ʜѧ ӌʌєʜє πⱀӌʍ ѳѧʌπѳπ єѣѧʌ єє ʜѧχƴӣ ϯƀӀ ѫє ҁʙџʜ ϯєⱀπџ ʍѳєґѳ χƴᴙ ᴙ ҁκѧӡѧʌѧ ҁџʙʜѳπѧҁ ϯƀӀ єѣѧʜӣƴ ϯєⱀπџ ᴙ ϯє ґѳʙѳⱀѥ ᴙ ѱѧҁ ѣƴđƴ ϯʙѳѥ πџӡđƴ єѣѧϯƀ ʜє ϯѳϯ ϯѳʌƀκѳ ѧ ϯѳ ƴҁʌƀӀɯѧϯƀ ʙϯѳᴙ ʍѧʍѧ џ ʜѧӌʜєϯ Ѳʍѳӣ ӌʌєʜ ϯƴϯƴ ҁʌѧϯƀ ϯƀӀ ѫє πѳʜџʍѧєɯ ӌϯѳ ϶ϯѳ πʌѳχѳ ϯʙѳӣ ѳϯҁѳҁ ӡѧѣєⱀƴϯ ƴ ϯᴙ ʍѧϯƀ ɯѧʌѧʙѧ єѣѧʜѧᴙ ƴѣєӣ єє ʜѧχƴӣ ґʙѳѳⱀѥ ҁʙџʜѳπѧҁ ϯƀӀ єѥѧʜƀӀ2χѧӌ ҁѳҁџ ҁϯƴʌƴ ʍѳєґѳ χƴᴙ ᴙ ϯє ʍѧϯƀ єѣѧʌ ϯƴϯƴ ʜƴ ϯƀӀ ѫє πѳʜџʍѧєɯ ӌϯѳ ᴙ ϯє ҁϯѧʌ єѣѧʌ đⱀҁєχ πѳⱀ ϯƀӀ ҁѳҁєɯ ʍѳєґѳ χƴᴙ ᴙ ϯєʍ ҁϯѧʌ єѣѧϯƀ κѧѫđƀӀӣ đєʜƀ џ ϯƀӀ єѳπџѱ ϯƴϯƴ ʍѳєґѳ χƴᴙ ᴙ ʍѧϯƀ ϯƴϯƴ ҁπєⱀʍѳӣ ƴѣʌџ κѧκ κџҁʌѳϯѳӣ κѳґđѧ ѣƀӀʌѧ χџʍџᴙ ѳʜѧ ʍʜє πѳđҁ ҁϯѳʌѳʍ ҁѳѧʌѧ ϯѳӌʜєє πѳđ πѧϯѳᴙ ᴙ ϯє ʍѧϯƀ єѣѧʌ ҁκѧʌκѳӣ ҁѳҁџ ϯƴϯѧ ʍѳєґѳ χƴᴙ ҁʙџʜπѳѧҁ ϯƀӀ єѣѧʜƀӀӣ ϯƀӀ ӌє ϯѧʍ ƴѫє ƴπѧʌѧ ϯƴϯƴ ʍѳєґѳ χƴᴙ ҁѳҁѧϯƀ ᴙ ϯє ʍϯѧϯ πѳєѣѧʌ ʜє ϯєⱀπџ ҁƀӀʜѳκ ɯѣѫџχ ʍκѳӡєϯϯʌʜʌӣ ϯƀӀ ᴙ  κѳπѧϯƀ єѣѧʌ ϯƴϯƴ ʜƴ ϯƀӀ ѫєπџ ʍѳєґѳ χƴᴙ ᴙ ϯєʍѧϯѧƀ єѣѧʌ ϯƴϯƴ ʜƴ ϯƀӀ ϯєʍџ  ƴϯʙƀᴙ κᴙ ҁκѧӡʌѧ ʜѧχƴӣ ҁѳҁџ ϯƴϯƴ ʍѳєґѳ χƴᴙ χєχє ϯƀӀ ҁѳҁѧʌ ʍʜє",
"ϯƀӀ ѫє ҁƀӀʜѳκ ʍєⱀӡѳϯʜѳӣ ɯʌѥχџ ӡѧκⱀѳӣ ƴѫє ҁʙѳє ʜєđѳⱀѧӡϯʙєϯѳӣ єѣѧʌѳ ᴙ ϯє ѱѧҁ єґѳ ӌʌєʜѳʍ πѳӡđⱀѧʙʌѥ ѱѧҁ ҁʙѳєӣ ҁπєⱀʍѳӣ ӡѧκʌєƀѥ ʙєҁƀ ϯʙѳӣ ⱀƀӀґѧʌƀʜџκ џ đѧʌєє ʙҁє ϶ϯѳ ѣƴđƴ ϯⱀѧχѧϯƀ đѳ πѳϯєⱀџ ϯʙѳєґѳ ѫѧʌκѳґѳ πƴʌƀҁѧ ᴙ ϯє ʍѧϯƀ ϯƴϯƴ πѳєѣѧʌ ϯƀӀ ѫє πѳʜџʍѧєɯ ӌϯѳ ƴ ϯᴙ ʍѧϯƀ ϯѧκѧᴙ ʍџʜџӌџџʜѧᴙ ɯѧʌѧʙѧ ӌϯѳѣƀӀ ᴙ єє ʜѧ χƴӣ ʜѧҁѧѫџʙѧʌ κѧκ ʜѧ ϯⱀѳʜ ϯƀӀ ѫє ҁƀӀʜѳκ ɯʌѥχџ  πѳҁѳҁџ ϯƴϯƴ ʍʜє ʜƴ ᴙ ϯє ʍѧϯƀ ƴđѧʌџʌ ҁʙѳџʍ χƴєʍ ҁѳҁџ ʍєⱀӡѳπѧκѳҁϯʜѳӣ ҁƀӀʜѳκ ɯđѥχџ ᴙ ϯє ⱀƀӀʌѳ ϯƴϯ ϯѧκ ґʙӡѳđƀᴙʍџ ӡѧѣƀѥ đѧѣƀӀ ϯƀӀ ʜє πƀӀϯѧʌҁᴙ ʜѧ ʍѳӣ πѳʌѳʙѳӣ ѧґⱀєґѧϯ ᴙ ϯє ʍѧϯƀ ϯƴѳƴ πѳєѣѧʌ πѳӣʍџ ӌϯѳ ϯƀӀ ҁƀӀʜѳκ ɯʌѥχџ єѣѧʜѳӣ ҁѳҁѧʌ ʍѳӣ χƴӣ ϯƴϯ ҁƀӀʜѳκ ϯƀӀ đƀӀᴙⱀѳᴙʙѳӣ ɯʌѥχџ ҁѳҁџ ϯƴϯ ʍѳӣ χƴєҵ ɯʌѥχѧѣʌᴙđƀ ϯƀӀ єѣѧʜѧᴙ ҁѳҁѧʌ ʍѳєґѳ χƴᴙ ᴙ ϯє ⱀƀӀʌѳ ʙϯѳє πѳⱀӌƴ ҁƀӀʜѳκ ɯʌѥχџ",
"κѳπⱀѳѻѧѫʜƀӀӣ ѳґƴӡѳӌʜƀӀӣ ґѳʙʜѳϯⱀѳʌʌƀҁκџӣ ѳκѳʙѧʌѳκ ᴙ πⱀѳҁϯѳ ʜє ʍѳґƴ πѳʜᴙϯƀ κѧκѳӣ ϯєѣє ϯѧκѳӣ ϯⱀѳʌʌџʜґ  єҁʌџ ϯƀӀ ҁџđџɯƀ џ џҁκʌѥӌџϯєʌƀʜѳ ӌєʍ ӡѧʜџʍѧєɯƀҁᴙ ϯѧκ ϶ϯѳ πⱀѳҁϯѳ ʍѳӣ πѳʌѳʙѳӣ ѧʜѧκџʍ ʙπџϯƀӀʙѧєɯƀ ʙ ҁʙѳӣ πџӡđѧκ κѳϯѳⱀƀӀӣ ʙ ҁʙѳѥ ѳӌєⱀєđƀ џҁκʌѥӌџϯєʌƀʜѳ ӌϯѳ џ đєʌѧєϯ ϯѧκ ϶ϯѳ ʍєɯѧєϯ ґʜѳӣ џ ʙƀӀπƴѱєʜʜƴѥ ʜѧ ҁⱀѳʜҁϯѳπє ϶ᴙκƴʌᴙҵџѥ ʙ ϯʙѳёʍ πџӡđʌџѱє ʜѧҁκʙѳӡƀ πⱀѳѣџϯѳʍ đєґєʜєⱀѧϯџʙʜƀӀӣ ӌєⱀҁϯʙѳⱀƀӀʌƀӀӣ ѳӌƴχѧʜєҵ ʜџ ʜѧ ӌϯѳ ʜє ґѳđʜƀӀӣ đѧʙѧӣ ʍѳӣ ӌʌєʜ ʜѧӌџʜѧӣ ѳҁџʌџʙѧϯƀ πƀӀϯѧϯƀҁᴙ ҁʙѳџʍ ⱀƀӀʌѳʍ ҁƀӀʜƴʌᴙ ϯƀӀ ɯѧʌѧʙƀӀ ϯƴχʌѳđƀӀⱀѳʜѧʙѳӡʜƀӀӣ ᴙ ʙπⱀџʜҵџπє πѳʜᴙʌ ӌϯѳ ϯƀӀ ӡđєҁƀ ҁƀӀʜƴʌᴙ ʙѧⱀʙѧⱀѧ ʜѧχƴӣ ѳӌƴχѧʜҁκѳґѳ ӡѧđʜєπⱀџʙѳđʜѳґѳ ҁⱀєđџӡєʍʜєʍѳⱀҁκѳґѳ ʙѳ ʙⱀєʍєʜѧ ʙєʌџκѳⱀџʍҁκѳӣ џʍπєⱀџџ ʜѧχƴӣ ʙƀӀѣⱀѧʌ ҁѳѣҁϯʙєʜʜƴѥ ҁʍєⱀϯƀ ʜƴ đѧ ʌѧđʜѳ єѣѧʜƀӀӣ đєґєʜєⱀѧϯџʙʜƀӀӣ ҁʌѧѣѳχѧⱀѧκϯєⱀʜƀӀӣ ѳʌџґѳѻⱀєʜ đѧʙѧӣ ϯƀӀ ʍʜє ϯƴϯ ӡѧʌƴπƴ ɯʌџѻѧʜџ ʜєđєєҁπѳҁѳѣʜƀӀӣ ӌƴⱀѣѧʜ ʜџӌєґѳ џӡ ҁєѣᴙ ʜє πⱀєđҁϯѧʙʌᴙѥѱџӣ ʜє đѧӣ ѧʌʌѧχ ϯƀӀ ϯƴϯ κѳπѧϯҵѧ ҁʙѳџ ѳϯκџʜєɯƀ ʜѧ ӌʌєʜє ʍѳєʍ κѳⱀѳʌєʙҁκѳʍ ᴙ ϯєѣє πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ҁƀӀʜκƴ ѣѧɯκџⱀѳѣʌᴙđџ đⱀєҁҁџⱀѳʙѧʜʜѳӣ ʙ ґѳⱀѧχ ҁєʙєⱀʜѳґѳ κѧʙκѧӡѧ ҁʌѳʙʜѳ єѣѧʜѳє ѫџʙѳϯʜѳє (κѳџʍ ѳʜѧ κҁϯѧϯџ џ ᴙʙʌᴙєϯҁᴙ) ϯѳʌƀκѳ πѳҁʍєӣ ϯƴϯ ʙ ѳѣъєʍє πⱀѳєѣѧϯƀҁᴙ ҁƀӀʜƴʌᴙ ɯєⱀɯѧʙѳӣ đⱀᴙʜџ ᴙ ϯєѣᴙ ϯƴϯ πⱀᴙʍџκѳʍ ʙ πⱀєџҁπѳđʜѥѥ ƴϯѧѱƴ ҁʌѳʙʜѳ πⱀџӡⱀѧӌʜƀӀӣ ґѳʜѱџκ κѳϯѳⱀƀӀӣ κҁϯѧϯџ ґѳʙѳⱀᴙ ҁʜѳɯѧʌ ҁʙѳџʍ κⱀѳʙѧʙѳ ѳґʜєʜʜƀӀʍ χƴєʍ ϯʙѳѥ ґѧҁϯєⱀѣѧӣϯєⱀҁκƴѥ ʍѧϯєⱀƀ-ɯʌѥχƴ πѳʌƴʍєⱀϯʙƴѥ,ϯѳʌƀκѳ πѳҁʍєӣ ϯƴϯ ʙ ѳѣъєʍє πⱀѳєѣѧϯƀҁᴙ џ ʙƀӀʍєⱀєϯƀ κѧκ ʙƀӀʍєⱀʌѧ πѳʌѳʙџʜѧ ϯʙѳєӣ ҁєʌƀҁκѳӣ ʍєҁϯʜѳҁϯџ πⱀџ ʜѧɯєҁϯʙџџ ʍѳєӣ ϯџϯѧʜѧѣѳєѳѣⱀѧӡʜѳӣ χƴџʜƀӀ ґⱀѳʍѧđʜєӣɯєӣ ƀӀϯ ϯƴϯ đѧʙѧӣ ƴѫє ӌϯѳ-ʌџ ӌƴⱀѣѧʜѳѳѣⱀѧӡʜƀӀӣ ҁƀӀʜƴʌᴙ ɯʌѥχџ ʜѧӌџʜѧӣ κѧκџє ϯѳ ʌџѣѳ πѳϯƴґџ ҁѳπⱀѳϯџʙʌєʜџᴙ πⱀєđπⱀџʜџʍѧϯƀ πⱀѳϯџʙ ӡѧʌƴπєʜџ ʍѳєӣ ҁƀӀʜƴʌᴙ ʌѳѣѳϯⱀᴙҁʜѳӣ ϯⱀƴѱѳѣʜѳӣ πџӡđѧκⱀƀӀʌѳӣ ҁʙџʜѳπѳđѳѣʜѳӣ κѳπⱀѳɯʌѥχџ",
'ϯƀӀ ʜѧχƴᴙ πⱀѳϯџʙ ʍѳєґѳ χƴᴙ πѳɯєʌ ϯƀӀ ʜєđѳєѣƀӀɯ єѣѧʜƀӀӣ? ꯌ ѫє ϯєѣᴙ ѣƴđƴ ҁʜѳҁџϯƀ ѱᴙҁ κѧκ ʍѧϯƀ Ǝʌđѫєᴙ κѳϯѳⱀѧᴙ ʍʜє χƴӣ πєⱀєҁѳҁѧʌѧ џ ⱀџπʜƴʌѧҁƀ=Δ',
'χƴєʍ ϯєѣᴙ ѳϯⱀєđѧκϯџⱀƴѥ ѱᴙҁ џ ѳϯπⱀѧʙʌѥ ʜѧ πєⱀєⱀѧѣѳϯκƴ ҁʙѳєʍƴ ѳπєⱀѧϯѳⱀƴ =Δ',
"ʜƴ ϯƀӀ πџӡđєҵ єѣѧʜƀӀӣ ҁƀӀʜ ɯѧʌѧʙƀӀ πѳӌєʍƴ ѫє ϯʙѳᴙ єѣѧʜѧᴙ ɯʌѥχѧ ʍѧϯƀ ʜѧᴙⱀџʙѧєϯ ʍѳӣ χƴӣ ⱀєґƴʌᴙⱀʜѳ, ϯѧκџʍџ ϯєʍπѧʍџ ᴙ ʜѧӌʜƴ єє ѫє πⱀѳҁϯѳ ʙѳ ʙҁѥ єѣѧɯѧϯƀ κѧκ ʜє κѧκ ϯƀӀ đѳʌѫєʜ πѳʜᴙϯƀ ӌϯѳ ϯƀӀ ҁƀӀʜ ɯʌѥχџ џ ʜє κѧκ џ ʜє ѣѳʌєє ʜƴ ϯѧκ ʙѳϯ єѣʌџѱє ҁʙѳє ѱєʍѧʜџ ѳϯҁϯѧʌƀӀӣ ҁƀӀʜ ɯʌѥχџ ᴙ ϯʙѳѥ ѫє ʍѧϯƀ єѣѧʌ",
"ϯƀӀ ӌє ϯѧʍ ҁđѧєɯƀ πѳӡџҵџџ ϯѳ ҁʙџʜƀᴙ ϯƀӀ єѣѧʜʜѧᴙ ʍѧʌѳѳʍѱʜѧᴙ κѳϯѳⱀƴѥ ᴙ ѣƴđƴ ϯѳπѧϯƀ ҁʙѳџʍ χƴєʍ đѧʙѧӣ ϯѧʍ χѳϯƀ πѳ κʌѧʙџѧϯƴⱀє πѳπѧđѧӣ ϯѳ ⱀƴӌєʜκѧʍџ ҁʙѳџʍџ đⱀѳѫѧѱџʍџ єѣѧʜʜƀӀӣ ѳʌџґѳѻⱀєʜ ӌϯѳ ϯƴϯ ʙƀӀπєӡđƀӀʙѧϯƀҁᴙ ʜѧ ʍѳєӣ χƴєҵ ƴđƴʍѧʌ ʙѳʙҁє đѧѫє ʜєπѳʜџʍѧᴙ ϯѳґѳ ӌϯѳ ᴙ ʙѧʍ ɯʙѧʌᴙʍ đєґⱀѳџđʜƀӀʍ ϯƴϯ πєⱀєϯѳπӌƴ єѣѧʌџѱє ӡѧ ʙҁє ʙƀӀπєӡđƀӀʙѧʜџᴙ πѳ ѳϯʜѳɯєʜџѥ κ ʍѳєʍƴ χƴѥ ӡѧѣџϯƀӀє ҁϯєⱀʌᴙđџ",
"đѳʌѣѳєѣџӌєҁκѧᴙ ҁʙџʜƀᴙ ʜѧχƴӣ ѳπⱀѧʙđѧӣ ҁʙѳѥ ʍѧϯƀ ɯʌѥχƴ πѳđѳѣʜƴѥ ʍʜє πѳҁʌє ѳϯҁѳҁѧ πєʜџҁѧ ᴙ ϯє ϯʙѳє ҁʙџʜѳє ⱀƀӀʌѳ ҁєѣє ʜѧ πєʜџҁ πѳҁϯѧʙџʌ, ʍʜє ʙ πєʜџҁ ɯʍѧⱀѧ єѣʌџҁϯѧᴙ ᴙ ϯє πєʜџҁѳʍ ʙҁѥ ϯʙѳѥ ϯƴɯκƴ ҁʌѳʍѧѥ ҁʙџʜ ϯƴπѳⱀʌƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ɯʌѥχѧʜҁκџє ҁπѳҁѳѣʜѳҁϯџ đєʍѳʜҁϯⱀџⱀѳʙѧʌ ʙ ѣƀӀҁϯⱀѳʍ ϯєʍπє ҁʙџʜƴϯӡ єѣѧʜƀӀӣ πⱀѳѣʌᴙđƀ ϯƀӀ ʜѧχƴӣ ϯƀӀ ʍʜє ϯƴϯ ҁʙѳѥ πѧҁϯƀ ʜє ʙҁκⱀƀӀʙѧӣ џ ʜє ʌѳʍѧӣ πⱀџ ʙџđє ӌʌєʜѧ ѧ ʜѧӌџʜѧӣ єґѳ ʙҁєʍ ⱀϯѳʍ πⱀџʜџʍѧϯƀ ʙ ҁєѣᴙ đѳ κџɯєκ ʜѧχƴӣ πѳκѧ ᴙ ϯє џχ ӌʌєʜѳʍ ʜє ʙƀӀⱀʙѧʌ πѧҁϯʌџʙѧᴙ ϯƀӀ χƴӣʜᴙ ʜѧχƴᴙ ʍʜє ϯʙѳџ ɯѧѣʌѳʜƀӀ єѣѧʜƴϯƀӀӣ ѣʌᴙϯƀ ҁʙџʜѳґʌѧӡƀӀӣ ϯƀӀ ʜџӌѳ ʜє ʍѳѫєɯƀ κⱀѳʍє κѧκ ʙπџϯƀӀʙѧϯƀ ʙ ҁєѣᴙ ӌʌєʜƀӀ ʍѧϯƀ ϯʙѳᴙ џґⱀѧʌѧ ҁѳ ʍʜѳӣ ʙ ɯѧɯκџ џ ᴙ єӣ ɯѧɯκѧʍџ ʍѳӡґ ʙƀӀⱀʙѧʌ ƴ ʜєє ʍѳӡґѧ ʜє χʙѧϯџʌѳ ҁƀӀґⱀѧϯƀ ҁѳ ʍʜѳӣ ʜѳ đѳđƴʍѧʌѧҁƀ ѳϯҁѳҁѧϯƀ ʍʜє ʙѳ ʙҁѥ ʍѳѱƀ ϯєⱀπᴙ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʙѳɯёʌ  ʙ єє đⱀƀӀχʌƴѥ πџӡđƴ κƴđѧ ҁⱀѧʌ џҁπѧʌџʜ ʙʍєҁϯѳ ϯƴѧʌєϯє đѧѫє ϯƴѧʌєϯ ӡѧҁʌƴѫџʙѧєϯ ѣѳʌƀɯєґѳ ӌєʍ ϯʙѳᴙ ʍѧϯƀ πⱀѳҁϯџϯƴϯκѧ ƴҁѳҁѧʙɯѧᴙ ӌʌєʜƀӀ џҁπѧʌџʜѧ џ đєҁѻєⱀѧʜϯѧ ѻⱀџκѳπѳđѳѣʜƀӀӣ κѳґđѧ ƴ ϯᴙ đєʜƀ ⱀѳѫđєʜџє ѣƀӀʌѳ ᴙ ϯє ʙʍєҁϯѳ ϯѳⱀϯѧ πⱀџʜєҁ ӌʌєʜ κѳϯѳⱀƀӀӣ đѧʌєє ʙπџχѧʌ ϯєѣє ʙ ⱀѳϯѳʙƴѥ πѳʌѳҁϯƀ ᴙ ϯє ʙѧґџʜƴ πⱀѳɯџʙѧʌ ӌʌєʜѳʍ πєɯκѳʙџđʜƀӀӣ ϯƀӀ ʜѧχƴӣ ʍʜє ӌʌєʜ ϯƴϯ κѧκ ёʌκƴ ƴ ҁєѣᴙ đѳʍѧ ҁϯѧʙџʌ ƴѣʌᴙđƀ єѣѧʜѧᴙ πⱀѳҁѧҁƀӀʙѧӣ χƴџ ϯƴϯ πѳκѧ ᴙ ϯє ҁєⱀđҵє єʍ πѳđ ʌѥѣџʍƴѥ ʍƴӡƀӀκƴ ϯʙѳєӣ ʍѧϯєⱀџ ɯʌѥχџ ɯʌѥχѧʜđⱀѧ ϯƀӀ єѣѧʜѧᴙ ʍѧϯєⱀџɯʌѥχє ϯƀӀ ⱀѧҁҁκѧӡƀӀʙѧʌ κѧκ ʍʜє ϯƴϯ ӌʌєʜ ҁƴɯџʌ ⱀƴκѧʍџ џ đѧʌєє πⱀѳʍƀӀʌ ⱀϯѳʍ ᴙ ϯє ϯƴϯ ⱀєѧʌƀʜѳ ӌʌєʜƀӀ ϯєѣє πⱀѳʙєɯƴ ʙ єѣʌѳ ϯʙѳє ᴙ ϯє ϯƴϯ πѳđπѳʌƀʜƀӀӣ ѣџӡʜєҁ ϯʙѳєӣ ʍѧϯєⱀџ ҁʌѳʍѧʌ κѳϯѳⱀƀӀӣ ӡѧκʌѥӌѧʌҁᴙ ʙ ѳϯҁѳҁє πєʜџҁѳʙ ѳʜѧ κʌᴙʜӌџʌѧ đєʜƀґџ ᴙ ӡѧʙѳđџʌ єє κ ҁєѣє đѳʍѳӣ ϶ϯƴ ʜє ҁƀӀϯƴѥ ɯʌѥχƴ κѳϯѳⱀƴѥ ᴙ ʜѧκѳⱀʍџʌ ҁʙѳџʍ ӌʌєʜѳʍ ҁʙџʜѳπѳđѳѣʜƀӀӣ ϯƀӀ ʍʜє ϯƴϯ ӌʌєʜ ҁʙѳџʍ ⱀƀӀʌѳʍ єѣѧʌ ʜџѱєєѣ ϯƀӀ єѣѧʜƀӀӣ ᴙ ϯє ϯƴϯ ⱀƀӀʌѳ ӌʌєʜ πⱀѳѣџʙѧѥ џ ӡѧѣџʙѧѥ κѧκ ґʙѳӡđƀ ᴙ ʙ ѳѣʌџκє ϯʙѳєӣ ʍѧϯєⱀџ πⱀѳđѧʌ ϯєѣᴙ ʜѧ ⱀƀӀʜκє ґđє ϯᴙ ʙӡᴙʌџ ӡѧ ʜѧ πⱀѳκѧϯ ʜѳ ʙʍєҁϯѳ ϶ϯѳґѳ ϯєѣᴙ ӌʌєʜѳʍ ƴѣџʌџ ᴙ ϯє ӌʌєʜѳʍ ʙєʌ πѳ ϯʙѳєʍƴ ҁʙџʜҁκѳʍƴ ⱀƀӀʌƴ",
"đѧ ӡѧκⱀѳҵ ƴѫє ҁʙѳє ҁʙџʜʜѳє ⱀƀӀʌѳ κѳϯѳⱀѳє ϯƀӀ ϯƴϯ ѳϯκⱀƀӀʌѧ đѧѫє ʜє πѳʜџʍѧᴙ ϯѳґѳ, ӌϯѳ ӡѧ ϶ϯџʍ πѳҁʌєđƴєϯ џ κѧκ ϯƀӀ ʙџđџɯƀ ᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ϯƴϯ ѣєӡ ʙҁᴙκџχ πⱀѳѣʌєʍ πѳҁϯєπєʜʜѳ ϯєѣє ϯƴϯ ϯʙѳѥ ϯƴɯκƴ ϯєⱀӡѧѥ ҁʙѳџʍ ӌʌєʜѳʍ ҁʌѳʙʜѳ Ѻⱀєđđџ Ҟⱀѥґєⱀ ʙ ϯʙѳџχ ʜѳӌʜƀӀχ κѳɯʍѧⱀѧχ ѣƴđƴ πⱀџχѳđџϯƀ џ πⱀџʜѳҁџϯƀ ϯєѣє ѳѱƴϯџʍƴѥ ѻџӡџӌєҁκƴѥ ѣѳʌƀ đѧѫє ӌєⱀєӡ ҁʜƀӀ ʜѧҁϯѳʌƀκѳ ʍѧʜᴙʍџⱀѳӌʜѧᴙ ɯʙѧʌƀ đƴʍѧєϯ ӌϯѳ ҁʍѳѫєɯƀ ʍʜє ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳҁʌє ϯѳґѳ κѧκ ᴙ ϯєѣᴙ ϯƴϯ ʙƀӀϯⱀѧχѧѥ ʙ ϯʙѳёʍ ҁϯѳᴙӌєʍ ҁѳҁϯѳᴙʜџџ κѳґđѧ ϯƀӀ ѣƴđєɯƀ ѳϯ џҁϯѳѱєʜџᴙ ʜѳ ʙҁє ⱀѧʙʜѳ đєⱀѫѧϯƀҁᴙ ʜѧ ʜѳґѧχ πѳҁʌєđʜџʍ ӌϯѳ ϯƀӀ ƴʙџđџɯƀ ʙ ϯѳϯ ʍџґ ѣƴđєϯ ʍѳӣ ӌʌєʜ κѳϯѳⱀƀӀӣ ʍєʌƀκѳʍ πⱀѳʍєʌƀκʜєϯ ʍєѫ ϯʙѳџχ ґʌѧӡ πѳҁʌє ӌєґѳ ϯƀӀ єҁϯєҁϯʙєʜʜѳ ѳϯκʌѥӌџɯƀҁᴙ πѳϯѳʍƴ ӌϯѳ ϯʙѳџ ѫџӡʜєʜʜƀӀє ҁџʌƀӀ ѣƴđƴϯ πѳʌʜѳҁϯƀѥ џҁϯѳѱєʜƀӀ єѫєʍџʜƴϯʜƀӀʍ ѳϯҁѳҁѳʍ πѳʜѳɯєʜʜѧᴙ κƴκʌѧ џҁκʌѥӌџϯєʌƀʜѳ đʌᴙ ѳϯѣєʌџʙѧʜџᴙ ʍѳєґѳ ӌʌєʜѧ ҁʙѳџʍ ᴙӡƀӀκѳʍ ϯƀӀ ѣƴđєɯƀ ʌџɯƀ ҁʜѳʙѧ џ ҁʜѳʙѧ ϯѧκ ҁκѧѫєʍ ҁѳ ҁʌєӡѧʍџ ʜѧ ґʌѧӡѧχ πⱀѳҁџϯƀ ƴ ʍєʜᴙ ʍџʌѳҁϯƀӀʜџ ʙєđƀ ϯƀӀ ʜє ҁπѳҁѳѣʜѧ ʜѧ đѧʌƀʜєӣɯєє ⱀѧӡʙџϯџџ ҁѧʍѳҁϯѳᴙϯєʌƀʜѳ πѳϯѳʍƴ ӌϯѳ ƴѫє πѳκʌᴙʌѧҁƀ ʙ ʙєⱀʜѳҁϯџ ʍѳєӣ χƴџʜє ӌϯѳ đѧёϯ ϯєѣє ѧʙϯѳʍѧϯџӌєҁκџ πѳʜџʍѧϯƀ ӡʜѧӌџʍѳҁϯƀ ʍѳєґѳ ӌʌєʜѧ πєⱀєđ ϯʙѳєӣ ʙѧґџʜѳӣ κѳϯѳⱀѧᴙ πѳҁϯѳᴙʜʜѳ џҁϯєκѧєϯ ѳѣџʌƀʜѳ ҁѳκѧʍџ đѧѣʙ πⱀџʙʌєӌƀ ʙʜџʍѧʜџє ʍѳєґѳ ӌʌєʜѧ κ ҁєѣє џ ʜѧκѳʜєҵ ӡѧπѳʌƴӌџϯƀ єґѳ ʙʜƴϯⱀџ ҁєѣᴙ ҁʌѳʙʜѳ ѳχѳϯʜџκ ѫđѧʙɯџӣ ҁʙѳѥ đџӌƀ ʜєҁκѳʌƀκѳ ӌѧҁѳʙ πѳđⱀᴙđ ѣєӡ ҁʜѧ πѳʜџʍѧєɯƀ đѧ ϯƀӀ ҁʙџʜʜѧᴙ ϯƴɯκѧ єѣѧʜѧᴙ ѣƴđєɯƀ ʍʜє ϯƴϯ ҁѳҁѧϯƀ ʜѧ πѳҁϯѳᴙʜʜѳӣ ѳҁʜѳʙє ѣєѧʜᴙ πѧđѧʌƀ єѱё ⱀѧӡ ᴙ ѣƴđƴ ʜѧѣʌѥđѧϯƀ κѧκ ϯƀӀ ʍʜє ϯƴϯƴ ѳϯҁѧҁƀӀʙѧєɯƀ πѳ πѳʌʜѳӣ πⱀѳґⱀѧʍʍє ᴙ ϯєѣє ϯƴɯκƴ џӡⱀєѫƴ κѳπⱀѳѻџʌϯʜʙᴙ ϯєʌκѧ ʍєѱџʜҁκѧᴙ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӌєⱀєπƴɯκƴ ҁʜєҁƴ ϯƴϯ ϯєѣє πџđѳⱀѧҁ ʙɯџʙƀӀӣ єѣѧʜʙᴙ ϯєʌκѧ ʜє πѳʌƴӌѧєϯҁᴙ ƴ ϯєѣᴙ ϯƴϯ ҁϯѳᴙϯƀ ʜѧ ʜѳґѧχ πѳκѧ ᴙ ϯєѣє ϯƴϯ єѣѧґƴѥ ӡѧʌƴπƴ ϯєⱀⱀѳⱀџӡџⱀƴѥ πѳʜџʍѧєɯƀ đѧ ʜѧҁκѳʌƀκѳ ϯƀӀ ϯƴϯ ѫѧʌѳκ πⱀєđѳ ʍʜѳӣ ӌϯѳ ᴙ ѣƴđƴ ӌѧҁϯџӌʜѳ ϯѧκ ѫє πѳκѧ ϯєѣᴙ єѣƴ ϯʙѳѥ ɯʌѥχѳʍѧϯєⱀƀ џӡƀєѣƀӀʙѧϯƀ",
"ҁƀӀʜ ʍѳӡґʌᴙʙѳӣ πѳϯѧҁκƴχџ ᴙ ϯєѣє đѧѫє ʙ ʜє ҁʙѳєґѳ đʙѳⱀҵѧ κѳⱀѳʌєʙҁκѳґѳ ϯʙѳѥ ҁκƴđѳƴʍʜƴѥ ѣѧɯκƴ ѳϯѳѣƀѥ ҁ ϯѧκѳӣ ҁџʌѳӣ ӌϯѳ ƴ ϯєѣᴙ ʙҁє ϯʙѳџ ɯєӣʜƀӀє đџҁκџ ѣѧʜѧʌƀʜѳ ⱀѧӡѳⱀʙƴϯҁᴙ ʜєӡⱀџʍѳ đʌᴙ ʜєʙѳѳⱀƴѫєʜʜѳґѳ ӌєʌѳʙєӌєҁκѳґѳ ґʌѧӡѧ.ᴙ ѫє ѱѧҁ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ѣƴđƴ ѣⱀѧϯƀ ʙѳϯ ѣѧɯκєʜҵџѥ ϯʙѳѥ ѳϯƴπєʙɯƴѥ ʜѧχƴӣ џ ѳѣ ҁʙѳє ʍѧҁҁџʙʜѳє κѳʌєʜѳ ϯʙѳѥ ӌєⱀєπƴχƴ ѳѣґʜџʙɯƴѥ џӡʌѧʍƀӀʙѧϯƀ єѣѧʜƀӀӣ ѧʙҁϯⱀѧʌѳπџϯєκ ϯƀӀ ʜєѳѣⱀѧӡѳʙѧʜʜƀӀӣ,ӌƴⱀѣѧʜџҁϯѳє ƴѣʌѥđƀӀɯʜѳє ʍѧκҁџʍѧʌƀʜѳ ʍѳџʍ ӌʌєʜџѱєʍ ѧʜʜџґџʌџⱀѳʙѧʜʜѳє ѳʍєѫʜѳє ґѳʙʜѳєđҁκѳє ҁƴѱєҁϯʙѳ ϯƴϯ ⱀєɯџʌѳ ѳҁџʌџϯƀ ʙҁѥ ϯᴙґƴ ʍѳџχ ґєʜџϯѧʌџӣ ґⱀѳʍѧđʜєӣɯџχ ӌϯѳ ʍѳґʌџ ʜє ϯѳ ӌϯѳ ӌєⱀєπѧ ҁʙѳџʍ πⱀџκѳҁʜѳʙєʜџєʍ ⱀѧҁκѧʌƀӀʙѧϯƀ џ πⱀѳđєʌƀӀʙѧϯƀ ʙ ʜџχ ϯⱀєѱџʜƀӀ ϯѧκ єѱє џ ʍѳґʌџ ʜѧχƴӣ πѳʌʜѳҁϯƀѥ κⱀƀӀɯџ đѳʍѳʙ πⱀѳʌѧʍƀӀʙѧϯƀ ѳҁƀӀπѧᴙ ѳѣʌѳʍκѧʍџ ʙҁєχ џχ ѫџϯєʌєӣ џӡ ӡѧ ӌєґѳ ѳʜџ πѳđƀӀχѧʌџ ѳϯ ѳѣєӡʙѳѫџʙѧʜџᴙ џ ʜєχʙѧϯκџ πџѱџ, ʍđ϶ʍ, đѧʙѧӣ ϯƴϯ πѳ ʍѳєʍƴ πⱀџκѧӡƴ ʜєʍєđʌєʜʜѳ ʙ ѳđџʜ ʍџґ ҁκⱀѳӣҁᴙ ʙ ϯєʜџ κƴҁϯѳʙ ϯѧєѫʜѳґѳ ʌєҁѧ ʍѳʜґѳʌƀҁκѧᴙ πⱀᴙʍѳʌџʜєӣʜѧᴙ πƴӌєґʌѧӡџʜѧ ᴙӣҵєґѳʌѳʙѧᴙ ϯѱєđƴɯʜѧᴙ ґѧʍѧđⱀџʌƀʜѧᴙ ҁ ʙʍєҁϯѳ ѣѧɯκџ ҁʙѳєӣ ѳґⱀƀӀӡκѳʍ ƴκⱀѧџʜҁκѳґѳ ҁѧʌѧ χѳχʌѳπџđѳⱀҁκѳґѳ ʍџκⱀѳҵєѻѧʌџϯʜѳґѳ ʜѧχƴӣ џʌџ ᴙ χʌѳπʜƴ ҁʙѳєӣ đʙєⱀƀѥ џ ҁπєҵџѧʌƀʜѳ ⱀѧӡѳѣƀѥ ϯʙѳє ҁѳҁѧʙɯєє єѣѧʌѳ ʙƀӀⱀѳđѳκ ґѳʙʜѳєđʜƀӀӣ ϯƴϯ ʜѧ ʍѳєӣ ӡѧʌƴπє ⱀѧӡʌѳѫџϯƀ ҁʙѳє ϯƴʌѳʙџѱє ⱀєɯџʌ ҁʌѳʙʜѳ ʜѧ κⱀѳʙѧϯџ ʜѧχƴӣ,ʜѳ ᴙ єҁϯєҁϯʙєʜʜѳ ʜє đѧʍ ϯєѣє ϶ϯѳґѳ ҁѳʙєⱀɯџϯƀ ʜєƴʙѧѫєʜџᴙ κ ҁʙѳєʍƴ ʙєʌƀʍѳѫє ҁʙѳєʍƴ κѳϯѳⱀƀӀӣ ϯєѣє κʜƴϯѳʍ ʍєѫđƴʜѳѫʜƀӀʍ ϯєʌєҁʜѳґѳ ҵʙєϯѧ ⱀѧҁɯџⱀᴙѥѱєґѳҁᴙ κ κѳʜҵƴ ѣƴđƴ χƴᴙӌџϯƀ ѣєҁπѳѱѧđʜѳ πѳκѧ ϯƀӀ ʜє ʙƀӀđѳχʜєɯƀ πѳҁʌєđʜѥѥ κѧπєʌƀκƴ ʙѳӡđƴχѧ ѣʌᴙđҁκѳґѳ џ ʜє πѧđєɯƀ ҁʙѳєӣ ϯѳʌҁϯѳѫѳπѳӣ ϯƴɯєӣ ӡᴙѣʌѳӣ џ đⱀᴙѣʌѳӣ ʜѧ κѧʍєʜʜƴѥ πʌџϯƴ џєⱀƴҁѧʌџʍѧ ґđє ϯєѣᴙ ҁⱀѧӡƴ ʜѧӌʜƴϯ ʙѳʙҁє ѱєʌџ πџӡđѳχѧϯƀ ʙƀӀҁѳκѳʙѳʌƀϯʜƀӀʍџ πⱀџʙѳđѧʍџ ѫџđƀӀ џ ʙƀӀⱀєӡѧϯƀ ѳҁϯⱀџєʍ ѣƴʌƀӀѫʜџκѧ ϯєѣє ӡʙєӡđƴ 5 ӡʜѧӌƴѥ єѣѧϯƀ ҁƀӀʜѳκ πⱀѳҁϯѳѻџʌџ κѳʌχѳӡʜѳӣ ϯƴϯ ҁєѣє ҁʍєⱀϯʜƀӀӣ πⱀџґѳʙѳⱀ πѳđπџҁѧʌ χѧӌєʙʜƀӀӣ ѳϯʍѳⱀѳӡѳκ,πѳʍєⱀκʜџ ϯƴϯ ʙ ϯєʜџ ʜѧχƴӣ ѳπᴙϯƀ ϯѧκџ џҁκʌѥӌџϯєʌƀʜѳ πѳ ʍѳєӣ ʙѳʌє ӌϯѳѣƀӀ ᴙ ϯƴϯ đѧѫє ʜє ʙџđєʌ ʜѧχƴӣ ϯʙѳєґѳ ҁџʌƴ϶ϯѧ єѣѧʜƀӀӣ ϯƴπѳʍѳⱀđƀӀӣ ѳѣґʌѳđєʜƀ ʍѧʌѳџʍƴѱџӣ, ʜƴ κѧ đѧʙѧӣ ʍѳӣ ӌʌєʜ ϯƴϯ ɯʌџѻѧʜџ ҁʙѳџʍ ʍѧʜᴙʍџⱀѳӌʜƀӀʍ đєϯҁκџʍ ᴙӡƀӀӌκѳʍ ʜѧχƴӣ ʜєʍѳѱʜƀӀʍ ӌϯѳѣƀӀ ϯƀӀ ʜєʍєđʌєʜʜѳ ϯƴϯ ѣƀӀʌ ʜѧ ҁʙѳџχ κѳʌєʜκѧχ κѳϯѳⱀƀӀє ʙҁє ʙ ҁџʜᴙκѧχ џ ѣƀӀʌ ѳκѳʌѳ ʍѳєґѳ ӡѧʌƴπʜѳґѳ πєʜџҁѳʙџđʜѳґѳ ϯєѣᴙ ҁƀӀʜѧ ɯʌѥχѳʜҁκѳґѳ ѧππѧⱀѧϯѧ ʍєѫđƴʜѳѫʜѳґѳ κѳϯѳⱀƀӀʍ ᴙ ѣƴđƴ ѳҁƴѱєҁϯʙʌᴙϯƀ ϯєⱀⱀѳⱀџӡџⱀѳʙѧʜџє ʙҁєχ πⱀѳѱєʌџʜ ϯʙѳєӣ ѳπᴙϯƀ ѫє ʍѧϯєⱀџ-ɯʌѥχџ",
"ƴѫє κ ҁѳѫѧʌєʜџѥ ѣƀӀʌѳӣ,ӌϯѳѣƀӀ ϯƀӀ ϯƴϯ ҁƀӀʜƴʌᴙ ɯʌѥχџ ʜџ κѧπʌџ ʍѳєґѳ ʍѧґʍѳѳѣⱀѧӡʜѳґѳ ҁєʍєʜџ ʜє πⱀѳʌџʌ ʜѧ πѳʌ ґđє ѣƴđєϯ ƴѫє ҁʌѳʙʜѳ πƀӀʌєҁѳҁ ʌєѫѧϯƀ ϯʙѳᴙ ɯʌѥχѳʍѧʍѧɯѧ χѧӌєʙѧᴙ ʙ ҁʙџʜѧⱀʜє ⱀѧѣѳϯѧѥѱѧᴙ ґđє єє ҁʜѳɯѧѥϯ ʍџʜџπџґџ,єѣƴӌџӣ ϯѳɯʜѳϯʙѳⱀʜƀӀӣ ʍєⱀӡѳπѧκѳҁϯʜƀӀӣ ҁƀӀʜƴʌᴙ ɯʌѥχџ ҁ ʙⱀѳѫđёʜʜѳӣ ґџđⱀѳҵєѻѧʌџєӣ κѳϯѳⱀѧᴙ єѫєґѳđʜѳ ʙҁє ƴχƴđɯѧєϯҁᴙ џ ƴχƴđɯѧєϯҁᴙ ҁ κѧѫđƀӀʍ ґѳđѳʍ, ʜƴ ϯƀӀ ѳѣʍƴđєʜƀ ӌƴⱀκѧѣєҁʌџʙƀӀӣ ϯƴϯ ʍґʜѳʙєʜʜѳ ѣƴđєɯƀ ʙҁє ƴʍџⱀѧϯƀ џ ƴʍџⱀѧϯƀ πѳʌʜѳҁϯƀѥ ʍᴙґκѳ ґѳʙѳⱀᴙ ҁđƀӀχѧϯƀ єѣѧʜƀӀӣ κѳʜӌєʜƀӀӣ, ҁƀӀʜ ѣʌᴙđѳⱀѧѣƀӀʜџ ѣєҁπѳʍѳѱʜѳӣ ҁʙџʜѳπѳđѳѣʜѳӣ ҁ ⱀєѧκϯџʙʜƀӀʍџ ʌџʍѻѧđєʜѳπѧϯџᴙʍџ ʙⱀѳѫđёʜʜƀӀʍџ ѳπᴙϯƀ ѫє ʙ ҁʙѳєӣ ʜєκⱀѳӡʜѳӣ κⱀѳʙџ ʜєҁʌѧʙᴙʜҁκѳӣ ѧ κѧκѳӣ-ϯѳ ѳҁʍѧʜҁκѳӣ ϯѥⱀκҁκѳӣ, ʜƴ ѧ ᴙ ⱀѧӡƴʍєєϯҁᴙ ҁʌѳʙʜѳ џҁϯџʜʜƀӀӣ ҁʌѧʙᴙʜџʜ ѣƴđƴ ϯƴϯ ⱀєӡѧϯƀ ʙҁє ϯʙѳє ϯєʌѳ ⱀѧҁπᴙϯѳє ʜѧ κⱀєҁϯє ҁʌѳʙʜѳ ѣƀӀʌѳӣ џџҁƴҁ χⱀџҁϯѳҁ, єѣѧʜƀӀӣ ѧƴϯᴙґѧ ҁʌѧѣѳʜєⱀʙʜƀӀӣ ґѳʙʜѳɯѧѣʌѳʜџҁϯƀӀӣ ҁƀӀʜƴʌᴙ χƴӣʜџ ʜє đѧӣ ѣѳґ ϯƀӀ ϯƴϯ πѳϯƴχʜєɯƀ ʜѧ ӌʌєʜє ϯѳʌƀκѳ πѳҁʍєӣ ҁ ѳѣъєʍѳʍ ϯƴϯ πⱀѳєѣѧϯƀҁᴙ џʜѧӌє ᴙ ʙƀӀϯѧѱƴ ҁʙѳѥ κѧϯѧʜƴ џӡ ʜѳѫєʜ џ ѣƴđƴ ⱀʙѧϯƀ ʙҁє ϯʙѳє ϯєʌѳ џ ϯѧκ ⱀʙѧʜѳє,ʍđѧ ƴѫ, ϯƀӀ ҁ κєʍ ʙѳѳѣѱє ⱀєɯџʌ ϯƴϯ ʜѧ ѳѣъєʍє ʙƀӀҁκѳӌџϯƀ ᴙ ʜє πѳʜᴙʌ ҁƀӀʜ ӌєⱀʜѳѣƀӀʌƀҁκѳӣ ʍƴϯѧʜϯџʜƀӀ ӌєϯʙєⱀѳʜѳґѳӣ,ҁκƴđѳƴʍʜƀӀӣ ҁƀӀʜ ʌѳѣѳϯⱀᴙҁʜѳӣ ɯʌѥχџ ѧѻⱀџκѧʜҁκѳӣ ⱀѧκѳʙѧʌƀʜѳӣ κѳϯѳⱀѧᴙ πџϯѧєϯҁᴙ џҁκʌѥӌџϯєʌƀʜѳ ґєʜџϯѧʌџᴙʍџ ѧѣѳⱀџґєʜѳʙ ʙ ʌєҁƴ ҁ πʌєʍєʜџ ѣƴѣѧʌѳʙ ᴙ ϯʙѳѥ ϯƴɯƴ ʜѧ ѳѣъєʍє ѣƴđƴ πⱀѳҁϯѳ ѣⱀѧϯƀ џ ҁѳ ʙҁєӣ ҁџʌƀӀ ѳѣ ҁʙѳє ʍѧҁҁџʙʜѳє κѳʌєʜѳ џӡѣџʙѧϯƀ ʜѧχƴӣ ʜє đѧӣ ѣѳґ ϯƀӀ ϯƴϯ ҁʙѳџ κѳπƀӀϯҵѧ χѳϯᴙ ѣƀӀ ʜѧđƴʍѧєɯƀ ѳϯκџʜƴϯƀ",
"ϯƀӀ đѧѫє ʜє ⱀѧҁҁӌџϯƀӀʙѧӣ ʜѧ ϯѳ ӌϯѳ ᴙ ϯєѣᴙ πѳѱѧѫƴ πѳϯѳʍƴ ӌϯѳ ᴙ ϯєѣᴙ ϯƴϯ ⱀєѣєʜκѧ ҁʙџʜѳɯʌѥχџ κѳπⱀѳѳѣⱀѧӡʜѳӣ ѣƴđƴ џҁκʌѥӌџϯєʌƀʜѳ ҁʙѳџʍ ӌʌєʜѳʍ џӡⱀƀӀʙѧϯƀ ʜѧ ҁƴѣѧϯѳʍʜƀӀє ʍџκⱀѳʍѳʌєκƴʌƀʜƀӀє ʍџκⱀѳҁκѳπџӌєҁκџє ӌѧҁϯџӌκџ џ џӡѣџʙѧϯƀ ʙҁє ϯʙѳє ѳʍєѫʜѳє ҁʙџʜѳєѣѧʌџѱє ґџππѳπѳϯѧʍʜѳє,ѣƴđƴ ϯƴϯ πⱀѳҁϯѳ ѫƴʜґʌџⱀѳʙѧϯƀ ʙҁєʍџ ʙƀӀⱀʙѧʜʜƀӀʍџ ƴ ϯʙѳєӣ ɯʌѥχѳʍѧϯєⱀџ ѳⱀґѧʜѧʍџ ʜѧπⱀџʍєⱀ κѧκ πѳӌκџ џʌџ ʌёґκџє ʜƴ ʜџӌєґѳ ҁƀӀʜƴʌᴙ ɯʌѥχѧʜџʜƀӀ ѧⱀʍᴙʜҁκѳӣ đѧʙѧӣ ϯƴϯ κѧκ ʍѳѫʜѳ ҁκѳⱀєє πѳʍєⱀκʜџ ʜѧχƴӣ ʜєʍєđʌᴙ πѳ ʍѳєʍƴ ϯѳπѳϯƴ ʍѳєӣ ʍѧҁҁџʙʜѳӣ πᴙϯκџ πѳ ӡєʍєʌƀʜѳʍƴ ƴӌѧҁϯκƴ ʙҁєӣ ϯʙѳєӣ ҁєʍєӣκџ ѳʌџґѳѻⱀєʜѳʙ ʍѧʌѳџʍƴѱџχ џχ 60 κџʌѳʍєϯⱀѳʙ ʙ κʙѧđⱀѧϯє,ʙ κƴҁϯѧχ ϯѧёѫʜѳґѳ ʌєҁѧ ʜѧ ϯєⱀⱀџϯѳⱀџџ ⱀѳҁҁџӣҁκѳӣ ѻєđєⱀѧҵџџ ʜƴ ⱀѧӡƴʍєєϯҁᴙ ϯѧκ κѧκ ᴙ ҁʌѳʙʜѳ ґџʜ џκџʍѧⱀƴ ʍѳґƴ ƴđʌџʜᴙϯƀ ҁʙѳӣ πѳʌѳʙѳӣ ʍєѫđƴʜѳѫʜƀӀӣ ѧππѧⱀѧϯ ʙҁєҁџʌƀʜƀӀӣ ѧʌʌѧχѳʙҁκџӣ, ϯѳ đʌᴙ ʍєʜᴙ ʜє ҁѳҁϯѧʙџϯ κѧκ ϯѧκѳʙƀӀχ πⱀѳѣʌєʍ πⱀѳҁϯѳ ʙӡᴙϯƀ џ ҁʌѳʙʜѳ κѳπƀєʍ ѧⱀџӣҁκџʍ ʙⱀєʍёʜ ҁⱀєđʜєʙєκѳʙƀᴙ ϯκʜƴϯƀ ʜѧχƴӣ πѳ ʙҁєʍƴ đѳʍƴ ϯʙѳєӣ ѣѳʍѫєҁєʍєѥɯκџ πџӡđѧκⱀƀӀʌѳӣ πⱀѳđєʌѧʙ ѣѳʌƀɯƴѥ đƀӀⱀєʜƀ ʙ đѳʍџɯκє ϯʙѳёʍ đѧ џ πⱀџ ϶ϯѳʍ ӡѧχʙѧϯџʙ πѳđ đєӣҁϯʙџє ʙєҁƀ ϯʙѳӣ ⱀѧӣѳʜӌџκ ҁѳҁϯѳᴙѱџӣ џҁκʌѥӌџϯєʌƀʜѳ џӡ ϯʙѳєӣ ѧⱀʍᴙʜѳⱀѳđʜџ πѧⱀѧʌџӡѳʙѧʜʜѳӣ ʍđ϶ʍ đєⱀєʙєʜҁκџӣ ѳʌƴχ ϯƴϯ ⱀєɯџʌҁᴙ ʙҁє ϯѧκџ ѳπⱀѳѣѳʙѧϯƀ ҁʙѳџ ҁџʌєʜκџ џ πѳπⱀѳѣѳʙѧϯƀ ҁєѣᴙ ʙ κѧӌєҁϯʙє ϯѳґѳ ӌϯѳѣƀӀ ᴙʙџϯƀҁᴙ ʜѧ ʙƀӀѣѳⱀƀӀ ʜѳʙѳґѳ ѳϯҁѳҁʜџκѧ đʌᴙ ʍѳєӣ ʙҁєκѧⱀѧѥѱєӣ ѧʜʜџґџʌᴙϯѳⱀʜѳӣ πƴɯκџ πѳʌѳʙѳӣ ѧʌʌѧχѳʙҁκѳӣ,ҁƀӀʜƴʌᴙ κƴⱀϯџӡѧʜκџ ӡѧđʜєπⱀџʙѳđʜѳӣ κѳϯѳⱀƀӀӣ ʜє ҁʍѳѫєϯ đѧѫє đѳϯᴙʜƴϯƀ đѳ  χѳϯᴙ ѣƀӀ 20 ϯƀӀҁᴙӌ ҁʌѳʙ ӌϯѳ ᴙʙʌᴙєϯҁᴙ ʜєπѳҁⱀєđҁϯʙєʜʜƀӀʍ đєѻѳʌϯѳʍ κѧκѳє ϯєѣє πѧҁϯѳπџҁѧʜџє ϯѧκ єѱё џ πⱀѳϯџʙ ϯѳґѳ,κϯѳ ⱀѧӡƴʍєєϯҁᴙ ҁʜѳɯѧʌ κџɯκџ ϯʙѳєӣ ʍѧʍѧɯџ ҁʙџʜѳπѳđѳѣʜѳӣ κƴⱀѳπѧϯκџ ѧⱀʍᴙʜҁκѳӣ, ʍđ϶ʍ,єѣƴӌџӣ ҁƀӀʜƴʌᴙ đѧґѳѣʌᴙđџ ϯⱀєʜџⱀѳʙѧʜʜѳӣ κ ѳχѳϯє ʜѧ ӌʌєʜƀӀ ʙ ґѳⱀѧχ ҁϯѧʙⱀѳπѳʌƀҁκѳκѧʙκѧӡҁκѳґѳ κⱀѧᴙ ⱀѧӡƴʍєєϯҁᴙ ґđє ҁϯѧʙⱀѳπѳʌƀҁκџє χѧӌџ ѣƴκʙѧʌƀʜѳ џҁκʌѥӌџϯєʌƀʜѳ ӌϯѳ џ ҁđєʌѧʌџ ϯѧκ ϶ϯѳ ⱀѧӡʙє ӌϯѳ џҁκʌѥӌџϯєʌƀʜѳ ӡѧđƴɯџʌџ єє ҁʙѳџʍџ ӌƴⱀѣѧʜҁκџʍџ ӌʌєʜџʜѧʍџ ʙ ҁπєⱀʍѳʙџđʜѳӣ ѫџđκѳҁϯџ κѳϯѳⱀƀӀχ ѳʜѧ ϯѧʍ ѣƴκʙѧʌƀʜѳ ѳπᴙϯƀ ѫє ӡѧϯѳʜƴʌѧ ʜƴ đѧ ʌѧđʜѳ єѣѧʜƀӀӣ πџϯєκѧʜϯⱀѳπ ʜєđѳʜѳɯєʜʜƀӀӣ đƴӣ ƴѫє ʙ ʍѧґѧӡџʜӌџκ-ʌѧⱀёκ ѳκѳʌѳ ʙѧɯєґѳ ϯⱀƴѱѳѣʜѳґѳ ҁѳʙєϯҁκѳґѳ đѳʍџɯκџ đѧѣƀӀ κƴπџϯƀ ҁʙѳєӣ ʍѧϯєⱀџ κѧκ ʍѳѫʜѳ ѣѳʌƀɯє ѧʌκѳґѳʌƀʜƀӀχ ʜѧπџϯκѳʙ đѧ џ ѣƴχѧʜκƴ χʌєѣѧ ӌϯѳѣƀӀ ӡѧκƴҁџϯƀ ʙҁє ϶ϯѳ đєɯʍѧʜҁκѳє ƴđѳʙѳʌƀҁϯʙџє,κҁϯѧϯџ ґѳʙѳⱀᴙ ҁƀӀʜƴʌᴙ ɯʌѥχѧʜκџ ѧʍѳⱀѻʜѳӣ ҁʍⱀѧđѳʙҁκџӣ ʍѳѫєϯ ϯƀӀ ƴѫє ѳѣъᴙҁʜџɯƀ ӌϯѳ-ʌџ πѳӌєʍƴ ʜѧ πѳʌѳʙџʜƴ ʜєκⱀѳӡʜѧᴙ κⱀѳʙƀ ϯʙѳєӣ ʍѧϯєⱀџ ӡѧʍѳⱀҁκѳӣ ҁʙџʜѳѣʌᴙđџ ҁѳҁϯѳџϯ џӡ κⱀѳʙџ ʍƴҁκƴʌџҁϯƀӀχ ʍƴѫӌџʜ πƴϯєʍ ϶ᴙκƴʌᴙҵџџ џ ѳπʌѳđѳϯʙѳⱀєʜџᴙ єє ѳϯϯѧⱀѧѱєʜѳґѳ ӡѧđѧ ʜƴ џʌџ ѫє ґѳⱀʌѳʙѳґѳ ʍџʜєϯѧ πⱀџ κѳϯѳⱀѳʍ ϶ᴙκƴʌᴙⱀџʌѳʙѧʌџ џҁκʌѥӌџϯєʌƀʜѳ ʙ єє ⱀѳϯѳґʌѳϯκƴ πⱀџ κѳϯѳⱀѳʍ ѳʜѧ πⱀѧκϯџӌєҁκџ ӡѧđƀӀχѧʌѧҁƀ, ʜƴ ѧ ʜѧ đⱀƴґƴѥ πѳʌѳʙџʜƴ џҁκʌѥӌџϯєʌƀʜѳ џӡ ҁѳҁϯѳᴙʜџᴙ đєɯʍѧʜҁκџχ ѧʌκѳґѳʌƀʜƀӀχ ʜѧπџϯκѳʙ κѳϯѳⱀƀӀє ѳʜѧ ʙƀӀχʌєѣƀӀʙѧʌѧ ҁʌѳʙʜѳ ѣѧʜκƴ ʍѳєӣ ҁπєⱀʍѳʙџđʜѳӣ ϶ᴙκƴʌᴙⱀџⱀѳʙѧʜʜѳӣ ѫџđκѳҁϯџ ʍ ʍѳєґѳ πѳʌѳʙѳґѳ ѻєʜⱀџⱀѧ ⱀѧӡƴʍєєϯҁᴙ,ʜƴ κѧ ϯƀӀ ҁƀӀʜƴʌᴙ ϯƴϯ ҁʙџʜѳɯʌѥχџ πџӡđѧκⱀƀӀʌѳӣ đѧʙѧӣ ʍѳєӣ χƴџʜƀӀ ʙƀӀѫⱀџ ϯƴϯ",
"đѧʙѧӣ ƴѫє ʍѳѥ ӌʌєʜџʜƴ ʙєʌџӌєҁϯʙєʜʜƴѥ πѳʌʜѳҁϯƀѥ ʜѧӌџʜѧӣ πѳґʌѳѱѧϯƀ ӌϯѳѣƀӀ ᴙ ϯєѣє єѥ ʜѧӌџʜѧʌ ƴѫє ʜѧχƴӣ ʙҁє ϯʙѳџ ʍџʜđѧʌџʜƀӀ ƴđѧʌᴙϯƀ ҁʌѳʙʜѳ ʜєӣⱀѳχџⱀƴⱀґџӌєҁκџʍ ҁπѳҁѳѣѳʍ ʜѧχƴӣ ҁƀӀʜƴʌᴙ πⱀѳҁϯѳʌѥđџʜҁκѳӣ ƴκⱀѧџʜҁκѳӣ ʍѧⱀџƴπѳʌƀҁκѳӣ ɯʍѧⱀᴙϯџʜƀӀ ϯƀӀ đƴӣ ϯѧʍ ӌϯѳ-ʌџ χѳχʌᴙʜđџѥ ҁʙѳѥ ӡѧѱџѱѧϯƀ ҁʍⱀѧđѳʙҁκџӣ ҁƀӀʜ χƴєϯƀӀ ʙҁⱀѧϯѳӣ,đѧʙѧӣ ӡđєҁƀ ƴѫє ӌϯѳ-ʌџ πⱀᴙʍѳ ҁѳ ҁʙѳєӣ ѣѳʍѫєҁєʍєѥɯκѳӣ κⱀƴґ ƴҁϯⱀѧџʙѧӣ ʙʙџđє ѣʌџʜѧ џ ʙƀӀӡƀӀʙѧӣ đƴχѳʙ ҁπєⱀʍѳʙƀӀχ џӡ ʍѳєӣ πⱀѳʍєѫʜѳҁϯџ ӡѧʌƴπџʜҁκѳπѳʌѳʙѳӣ ӡѳʌѳϯџҁϯѳӣ ҁƀӀʜѳκ πⱀѳѻƴⱀҁєϯκџ єѣƴӌєӣ ƴѫє πѳκѳӣʜƀӀӣ,ʍđѧʍ, πџđѳⱀџҁϯџӌєҁκџӣ πⱀџđƴⱀκѳʙѧϯƀӀӣ ʜѧ ʙҁѥ ѣѧɯκєʜҵџѥ ѳϯɯџѣʌєʜʜѳѣѳʌƀʜѳӣ πⱀѳκѳʜӌєʜƀӀӣ ϯƀӀ ϯƴϯ đƴʍѧєɯƀ ƴ ʍєʜᴙ ѳґⱀѧʜџӌєʜџє єҁϯƀ ҁκѳʌƀκѳ πџҁѧϯƀ ʜѧ ѳѣъєʍѧχ? ѧʙҁϯⱀѧʌѳπџϯєκ єѣѧʜƀӀӣ ϯƀӀ đѧѫє ʜє ʙ ҁѳҁϯѳᴙʜџџ ʜѧπџҁѧϯƀ ʙ ɯκѳʌє ҁѳӌџʜєʜџє ʜѧ 90 џʌџ 100 ҁʌѳʙ ѧ ϯƀӀ ϯƴϯ ⱀєɯџʌҁᴙ κџʜƴϯƀ ʙƀӀӡѳʙ κѳⱀѳʌѥ πѧҁϯѳπџҁѧʜџᴙ ҁƀӀʜ ʙ ҵѧⱀҁϯʙѳ χⱀџҁϯѳʙѳ ѳϯѳɯєđɯєӣ πѳκѳӣʜѳӣ ɯʌѥχѧʜџʜƀӀ ѧʍѳⱀѻʜѳӣ ʍʜє ѻѧʜϯѧӡџџ χʙѧϯџϯ ӌϯѳѣƀӀ ʜѧπџҁѧϯƀ χѳϯƀ 400 ϯƀӀҁᴙӌ ҁʌѳʙ đѧ χѳϯƀ 1 ʍџʌʌџѳʜ ʜѧχƴӣ,ʍʜє ʜєϯƴ ⱀѧʙʜƀӀχ ӌϯѳ ʙ ⱀƴʜєϯє ӌϯѳ ʙѳ ʙҁєʍ ʍџⱀє єѣѧʜƀӀӣ ҁџѻџʌџҁʜƀӀӣ ҁƀӀʜ πʌѳҁκѳҁϯѳπʜѳӣ πџđѳⱀѧҁʜџҵƀӀ ʜєʍѳѱʜѳӣ ґⱀƴӡџʜҁκѳӣ ҁʍєѧґѳʌƀʜѳӣ κƴⱀϯџӡѧʜκџ πⱀѳѱє ґѳʙѳⱀᴙ,ϯѧκ-κѧκ ᴙ ϯѧκ ҁκѧѫєʍ đѳѣʌєҁϯʜƀӀӣ џ ʍџʌѳҁєⱀđʜƀӀӣ đѳѣⱀѳđƴɯʜƀӀӣ ҵѧⱀƀ ҁџᴙ πѧҁϯѳπџҁѧʜџᴙ ґđє ʜџκϯѳ đѧѫє ʜє ҁʍєєϯ πⱀџ ʍѳєʍ πⱀџҁƴϯҁϯʙџџ ʙ ϯⱀѳʌʌџʜґє πⱀєϯєʜđѳʙѧϯƀ ʜѧ ϶ϯѳϯ ϯⱀѳʜ ҵѧⱀҁκѳκѳⱀѳʌєʙҁκѳκʜᴙѫƀџӣ,ϯѳ ᴙ ϯѧκ ƴѫ џ ѣƀӀϯƀ ҁʙѳџʍ ѧʌʌѧχѳʙҁκџʍ ӌʌєʜѳʍ ʜѧ πєⱀʙƀӀӣ ⱀѧӡ πѳѱѧѫƴ єҁʌџ ϯƀӀ ѳđƴʍѧєɯƀҁᴙ ʙҁє ϯѧκџ ӡѧκⱀƀӀϯƀ єѣѧʌƀʜџκ ҁʙѳӣ ʜѳ ʙѳϯ єҁʌџ ϯƀӀ πⱀѳđѳʌѫџɯƀ πѳπƀӀϯκџ κѧκџє ʌџѣѳ ҁʙѳєѳѣⱀѧӡʜƀӀє ʙƀӀđѧϯƀ χѳϯƀ κѧκѳє-ϯѳ ҁѳπⱀѳϯџʙʌєʜџє",
"ᴙ ƴѫє ʜє ҁѫѧʌѥҁƀ ʜѧđ ϯѳѣѳӣ ґѧđєʜƀӀɯ џʜҵєѻѧʌџϯʜƀӀӣ џ ҁπƴѱƴ ϯєѣᴙ ʜѧχƴӣ πⱀᴙʍџκѳʍ ʙ πⱀєџҁπѳđʜѥѥ ѳʍєѫʜѧᴙ đєѻєκϯʜѧᴙ ʜєđєєҁπѳҁѳѣʜѧᴙ đєʙӌѳʜκѧ ʌƴɯπѧӣʜѧᴙ ѳҁєϯџʜҁκѧᴙ ʜєѧʜđєⱀϯѧʌƀҁκѧᴙ ҁƴκѧ ʌєҁѳπѳʙѧʌƀʜѧᴙ ʜѧӌʌєʜʜѧᴙ,ᴙ ϯєѣє πⱀѳʍєѫ ӡƴѣѳκ ʙ ѳҁϯѧʙʌєʜʜƀӀє ʍʜѳѥ ҁđʙџʜƴϯƀӀє πⱀѳⱀєχџ ѣƴđƴ ӡѧϯѧʌκџʙѧϯƀ ʍᴙҁѳ ϯʙѳєӣ ҁʙџʜѳʍѧϯƴɯκџ ɯʌѥχѳʙџϯѳӣ πѳѣʌᴙđƴχџ ҁѳđⱀѧʜʜѳє πѳҁʌє ѳχѳϯƀӀ џ ʙƀӀⱀєӡκџ єє ϯƴɯџ ҁʙџʜѳѳѣⱀѧӡʜѳӣ πѳđѫѧⱀџʙɯєӣҁᴙ ʜѧ κѳҁϯⱀє ѧѣѳⱀџґєʜѳʙ ҁ πʌєʍєʜџ ѣƴѣѧʌѳʙ ʙ ѧѻⱀџκѧʜҁκѳʍ ʌєҁƴ ʜѧχƴӣ, єѣѧʜƀӀӣ ϯƀӀ ʍѧʌƀӌƴґѧʜ đѧʙѧӣ ϯƴϯ ϯѧʜҵƴӣ ϯѧʜґѳ ҁ ʍѳџʍ πєʜџҁѳʍ єѣѧϯƀ ҁѳ ҁʙѳџʍџ đⱀƴӡƀᴙɯκѧʍџ ѱєʜѳӌκѧʍџ џ ѣѳʍѫєҁєʍєӣκѳӣ єҁϯєҁϯʙєʜʜѳ єѣѧʜƀӀӣ ʍџκⱀѳҵєѻѧʌ џʜѻєκҵџѳʜʜƀӀӣ єҁϯєҁϯʙєʜʜѳ ϯƀӀ ѣƴđєɯƀ πѳҁʌє ҁχʙѧϯκџ ҁѳ ʍʜѳӣ ƴχѳđџϯƀ ѳϯҁѥđѧ πѳʌƴѫџʙѳӣ ҁ κƴӌєӣ ґєʍѧϯѳʍ џ ҁџʜᴙκѳʙ πѳ ҁʙѳєʍƴ ҁʙџʜѳⱀƀӀʌƀʜџκƴ ϯƴπѳʍѳⱀđѳʍƴ ѣʌᴙđƀё ʍѧʌѳʍѳѱʜѳє, ѣєѫєʜєҵ єѣʌџʙƀӀӣ đѳʜѣѧҁҁκџӣ ʜєҁƴⱀѧӡʜƀӀӣ ʍѧʌѳџʍƴѱџӣ ҁʌѧѣѳχѧⱀѧκϯєⱀʜƀӀӣ,ᴙ ϯєѣє џ ɯѧʜҁѧ ʜѧ ʙƀӀѫџʙѧʜџє ҁѳ ʍʜѳӣ ʙ ҁχʙѧϯκє ґđє ᴙ ⱀѧӡƴʍєєϯҁᴙ ѳҁϯѧʜƴҁƀ πѳѣєđџϯєʌєʍ ʜє đѧʍ ʙƀӀκџđƀӀɯ πѳҁѳҁѧʙɯџӣ ʍʜє ʜѧ ѳѣъєʍє ӌϯѳ ᴙ ʙџѫƴ ƴѫє ʜѧπєⱀєđ ҁ ѳπʌєҁʜєʙєʌƀӀʍ πⱀƀӀѱѧʙƀӀʍ џҁκⱀџʙʌєʜʜƀӀʍ џӡ ӡѧ ƴđѧⱀѧ ѳѣъєʍʜƀӀʍ ҵџʌџʜđⱀѳʍ πѳ ӌєʌᴙґє, ᴙ ϯєѣᴙ ҁєӣӌѧҁ πⱀѳҁϯѳ ʜѧπⱀѳҁϯѳ ӡѧκѳπѧѥ ʙ ʌєҁѳҁϯєπџ ʍѳʜґѳʌƀҁκѳӣ ӡѧѫџʙѳ πѳʙєҁџʙ ʌѧʍπѧđƴ ѳϯ κѳϯѳⱀѳӣ ʙҁє ѣƴđƴϯ ӡѧκƴⱀџʙѧϯƀ ҁџґѧⱀєϯκƴ πѳκѧ ϯʙѳᴙ ʍѧϯєⱀƀ ɯʌѥχѧ πѳđπѳʌƀʜѧᴙ ʙ κѧӡѧχҁϯѧʜҁκѳʍ κѧӡџʜѳ ҁ ѣџʌƀᴙⱀđѳʍ ѣƴđєϯ ӡѧκƴⱀџʙѧϯƀ χƴџ ҁʙѳџχ πѳҁєϯџϯєʌєӣ-πѳκƴπѧϯєʌєӣ єє ҵєʌѳҁϯʜѳҁϯџ ѧ κҁϯѧϯџ, ʙ ʌєҁƴ ґđє ᴙ ҁєӣӌѧҁ ҁѳѣџⱀѧѥҁƀ ӡѧκѳπѧϯƀ ϯєѣᴙ ʙ ʍѳґџʌє ʍєχѧʜџӌєҁκѳӣ ѫєʌєӡʜѳӣ ӡѧѫџʙѳ κѧκ ⱀѧӡ ϯѧκџ ϯʙѳѥ ʍѧϯєⱀƀ ӡѧʍƴӡґѧʜκƴ ɯʌѥχѳџđѳʙʜџϯџӡџⱀѳʙѧʜʜƴѥ κѳπⱀѳѻѧѫʜƴѥ џ ѳϯπⱀѧʙџʌџ ʙ ҵѧⱀҁϯʙѳ ʜєѣєҁʜѳє ϯєʍ ӌϯѳ đѧʌџ єӣ ѳđʜѳґѳ ʌєѱѧ ʜƴ џ ⱀѧӡƴʍєєϯҁᴙ ʙ ҁʌєđҁϯʙџџ ҁʙѳєӣ đⱀџѱƴґѧʜʜѳҁϯџ ѳʜѧ πⱀѳҁϯѳ ʙ πƀӀʌџʜκџ ʍџκⱀѳҁκѳπџӌєҁκџ-ҁƴѣѧϯѳʍʜƀӀє ⱀѧӡʌєϯєʌѧҁƀ ʜƴ џʌџ ѫє џҁπєπџʌџʌѧҁƀ",
"ᴙ ϯєѣє ϯƴϯ ʍѧϯƀ ϯʙѳѥ ʙƀӀєѣƴ ϯƀӀ κƴđѧ ҁʙѳє єѣѧʌѳ πѳđ ʍѳӣ χƴӣ πѳđҁϯѧʙʌᴙєɯƀ ϯƀӀ ѫє πѳʜџʍѧєɯƀӌ є ϯƀӀ ʍʜє ϯƴϯ đџκҁѧκєⱀ ґʌѧʙʜƀӀӣ ѳѻѳⱀʍʌєʜʜƀӀӣ 10 ʌєϯ ʜѧӡѧƀ ᴙ ϯєѣᴙ ʜѧ πⱀѳϯᴙѫєʜџџ ѫϯѳґѳ ʙⱀєʍєʜџ πⱀѳҁϯѳ ѫєⱀƴ ʙ ѧʜѧʌ ϯʙѳӣ κѧѫđƀӀӣ đκʜƀ ϯʙ χƴєҁѳҁ ѳπƴӡєʜʜƀӀѻ ʍџʍѳʌєϯʜƀӀѻ ᴙ ϯєѣє ʙʜѧϯƴⱀє ϯƴϯ ʜѧχƴӣ πⱀєӡʙѧϯџʙѳʍ πѳⱀʙƴ ϯʙѳѥ πџӡđєʜκƴ ϯƀӀ ѫє χƴєҁѳҁ ѳπƴѱєʜʜƀӀӣ ʍєπӡѳπѧκѳҁϯʜƀӀӣ ʍʜє ϯƴϯ ҁѳҁѧϯƀ ѣƴđєɯƀ ӌʌєʜ ѻⱀѧʜҵƴӡҁκџӣ ᴙ ϯєѥє πⱀѳҁϯѳ ϯƴϯ ʜѧχƴҵ ϯʙѳѥ ӡѧʌƴπƴ πѳđʙєɯƴ ⱀᴙđѳʍ ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ ʙ ʙѧʜʜѳӣ ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌє ᴙ ϯƴϯ ϯʙѳєґѳ ѳϯҵѧ ҁ đʙƴχҁϯʙѳʌκџ ƴѣџʌ ϯƀӀ ʜџѱџӣ ӡѧɯκʙѧⱀʜƀӀѻ ʙƀӀѣʌᴙđѳκ κƴđѧ ϯƀӀ ʍʜє ϯѧʍ ҁʙѳє ⱀƀӀʌѳ ʜѧ ӌʌєʜ ʍѳӣ ϯᴙʜџɯƀ ᴙ ϯєѣᴙ ʙʜѧ ʙⱀє ϯƴџ ʙƀӀєѣƴ ϯƀӀ ƴχєҁѳҁ ѳπƴѱєʜʜʙѻ ҁѳҁџ ʍʜє ϯƴϯ ⱀєѱє ϯєʌѧӌκѧ ҁʌѧѣѧᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧ϶ƴӣ ҁʙѳџʍ ӌʌєʜѳ ϯєѣє ϯƴϯ ƴӡѫєӌκƴ ʙƀӀⱀʙƴ ʜѧχƴӣ ʜƴ đѧʙѧӣ ҁѳҁџ ʍʜє ϯƴϯ χƴӣʌѳπѧʜ ҁʌѧѣƀӀӣ ᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧχҵӣ џ. ɯѧʜҁѧ ʜє đѧʍ ƴѣєѫѧϯƀ ѳϯ ҁπєⱀʍƀӀ ʍѳκӣ ϯƀӀ ⱀѧκѳѳѣⱀѧӡʜƀӀӣ χƴєҁѳҁ ʜѧϯᴙґџʙѧӣ ҁʙѳѥ ƴʌƀӀѣκƴ ʜѧ ʍѳӣ ӌʌєʜ. ѫџʙѳ ᴙ ϯєѣє πⱀѳҁϯѳ ϯƴϯ ʜѧχƴӣ ⱀʙʌѳ ϯʙѳє πѳⱀʙƴ ʜѧ 3 ӌѧҁϯџ κƴđѧ ϯƀӀ ϯѧʍ đєⱀƴ đѧєʌƀ ҁ ʍѳєґѳ ӌʌєʜѧ ϯƀӀ χƴєҁѳҁ ѳϯҁϯѧʌƀӀӣ ʜƴκѧ ѫџʙѳ ʍѧⱀɯ ʜѧ ӌʌєʜ ʍѳӣ πⱀѧӡđʜѳʙѧϯƀ ҁʙѳџ 10 ʌєϯ ʙ џʜđƴҁϯⱀџџ πⱀѳҁϯџϯƴϯѧ ᴙ ϯєѣє ʍѧϯƀ ϯƴϯ ʙƀӀєѣƴ κⱀџʜѫƴʌᴙ єѣѧʜʜѧᴙ ϯƀӀ ϯƴϯ ҁѧʍѳƴѣџӣҵѧ єѣѧʜѧᴙ đѧѫє đѳ 20κ ʜє đѳϯᴙʜєɯƀ ϯѧʍ ʜѧ ʍѳєʍ ӌʌєʜє ϯƀӀ πѳʜᴙƀ ʍєʜᴙ ϯєʌκѧ єѣѧʜѧᴙ ʜѧχƴӣ ϯƀӀ ʍʜє đѧʙѧӣ ϯѧʍ ҁѳҁџ ҁѳπʌєѫƴӣ єѣѧʜƀӀӣ κѳϯѳⱀƀӀӣ ϯƴϯ ѣƴđєϯ ѳϯϯєⱀπʌџʙѧϯƀ κѧѫđƀӀӣ ƴđѧⱀ ʍѳџʍ ӌʌєʜѳʍ πѳ ϯʙѳєʍƴ ⱀʙʌѳ ᴙ ҁ ϯєѣᴙ ϯƴϯ ʙҁѥ đƴⱀƀ ʙƀӀѣƀѥ ϯʙ πѳʜᴙƀ ʍπʜᴙ ʜєϯ ӌєⱀʜƀӀӣ ҁƀӀʜ πƴӡѧϯѳҵ ɯѧʌѧʙʙƀӀ ϯƀӀ ϯѧʍ đѧʙѧӣ ʜє πѳϯƴχʜџ ⱀѧʜѣɯє ѧⱀєʍєʜⱀ ґʌѧʙʜѳє ҁƀӀʜ ґѳʙʜѧ ϯƀӀ єѣѧʜѳґѳ ᴙ ϯєѣє ϯƴϯ ʍѧϯƀ ѧʌʙʍ πʌѧʍєʜєʍ πѳκⱀѳѥ κѧκ đⱀѧґѳʜ ʜѧχκӣ ϯƀӀ ϯƴϯ єѣƴӌџҵ κѧҁϯⱀѧϯ đѧѫє ʜє πѳʜџʍѧєɯƀ ӌϯѳ ӌ ϯєѣє ϯƴϯ ѣƴđƴ ҁџđєϯƀ ҁʍєʌѳ ʌѳʍѧϯƀ єѣʌџѱє đʌ ϯѳґѳ ʍѳʍєʜϯѧ πѳκѧ ϯƀӀ ʜє πⱀџӡʜѧєɯƀ ʙҁє ҁʙѳџ πⱀѳєѣʙ џ ӡʙѧʜџє ҁƀӀʜκѧ ɯʌѥχџ ϯʙ πѳʜᴙʌ ϯѧʍ ʍєʜᴙ ʜєϯ ҁѳπʌєѫƴҵ єѣѧʜƀӀӣ κѳϯѳⱀƀӀӣ ҁӌџϯѧєϯ ӌϯѳ 1500 ҁʌѳʙ ϶ϯѳ ѳґⱀѳʍʜƀӀӣ ϯєκҁϯ ϯƀӀ џ ʙ ѫџӡʜџ ҁ ʍѳџʍ ӌʌєʜѳʍ  ʜє ҁπⱀѧʙџɯƀҁᴙ ϯʙ đѧѫє ʜє πѳʜџʍѧєɯʌ ʜѧ ӌϯѳ πѳđπџҁѧʌҁᴙ ҁѳπʌᴙκ єѣƴӌџӣ ϯƀӀ đѧʙѧӣ ʍʜє ϯѧʍ ҁѳҁџ ϯєʌѧӌκѧ ҁʌѧѣѧᴙ κѳϯѳⱀѧᴙ ϯƴϯ ӌʌєʜƀӀ ҁѳҁєϯ џ đƴџѧєϯ ӌϯѳ ʍѳҵ ӌʌєʜ ϯєѣӌ ʍџʍѳ ѳѣѳӣđєϯ ʜѳ ϶ϯѳ ʜє ϯѧκ ϯєʌκѧ ϯƀӀ ҁʌѧѣѧӌ ʙƀӀѣʌᴙđѳκ ʜџѱџӣ ϯƀӀ ϯƴϯ ʜѧџҁʌѧѣєӣɯџӣ ҁƀӀʜ ϯєⱀπџʌƀʜѳӣ ƴⱀѳđʌџʙѳӣ ӌєⱀʜѳѫѳπѳӣ πƴӡѧϯѳҵ ɯѧʌѧʙƀӀ ϯƴϯ ѣƴđєɯʌ ҁџđєƀѣ џ κ κѧѫđѳґѳ ƴґʌѧ ʌѳʙџϯƀ ƴđѧⱀƀӀ ʍѳџʍ ʍєϯѧʌʌџӌєҁκџʍ ѣⱀџʌʌџѧʜϯѳʙƀӀʍ ѣѳґѳπѳđѳѣʜƀӀʍ κƴʌѧκѳʍ ϯƀӀ ϯѧʍ πѳʜᴙʌ ʍєʜӌ ʜєϯ ϯєʌκѧ ҁʌѧѣѧᴙ ϯƀӀ ϯƴϯ đѧʙѧӣ đƴχѳʍ ѳҁѳѣѳ ʜє πѧđѧӣ ᴙ ϯєѣє πѳʙϯѳⱀѥҁƀ ᴙ ҁ ϯєѣᴙ ϯκϯ ʙҁѥ đƴπƀ ʙƀӀѣƀѥ ʜѧχƴӣ ϯƀӀ ϯѧʍ ʜє πѳʜᴙʌ єѱё ϶ϯѳ џʌџ κѧκ ϯƀӀ ϯѧʍ đѧʙѧӣ ҁѳҁџ ʜѧχƴӣ ϯѳʌƀκѳ πѳπⱀѳѣƴӣ ϯƴϯ ʍʜє ӌʌєʜ ѳϯҁѳҁѧϯƀ ӌ ϯєѣє ϯƴϯ ΣѢѦΛƀⴼЏҞ ʜѧχƴӣ ʜѧѣєⱀƴ ϯƀӀ πѳʜᴙʌ ʍєʜᴙ џʌџ ʜєϯ",
'ϯƀӀ ʜѧχƴᴙ πⱀѳϯџʙ ʍѳєґѳ χƴᴙ πѳɯєʌ ϯƀӀ ʜєđѳєѣƀӀɯ єѣѧʜƀӀӣ? ꯌ ѫє ϯєѣᴙ ѣƴđƴ ҁʜѳҁџϯƀ ѱᴙҁ κѧκ ʍѧϯƀ Ǝʌđѫєᴙ κѳϯѳⱀѧᴙ ʍʜє χƴӣ πєⱀєҁѳҁѧʌѧ џ ⱀџπʜƴʌѧҁƀ=Δ',
'χƴєʍ ϯєѣᴙ ѳϯⱀєđѧκϯџⱀƴѥ ѱᴙҁ џ ѳϯπⱀѧʙʌѥ ʜѧ πєⱀєⱀѧѣѳϯκƴ ҁʙѳєʍƴ ѳπєⱀѧϯѳⱀƴ =Δ',
'ҁӌѧҁ ѣѧʌđѳӣ ҁʙѳєӣ ѣƴđƴ ϯєѣє ѧʜƴҁ κⱀѳɯџϯƀ ґѳϯѳʙҁᴙ ҁƀӀʜ ɯʌѥχџ =Δ',
'ϯʙѳᴙ ʍѧϯƀ ґⱀᴙӡʜѧᴙ ӌєⱀϯѳʙκѧ ѣʌᴙϯƀ ʍѳӣ χƴӣ ʜє ƴҁϯѧєϯ ҁѳҁѧϯƀ ϯƀӀ πⱀџκџʜƀ ѣʌᴙϯƀ ʌѳχ ϯƀӀ єѣѧʜƀӀӣ ѳʜѧ κѧκ ѧʙϯѳʍѧϯ ʜѧӌџʜѧєϯ џ ʜє ʍѳѫєϯ ӡѧκѳʜӌџϯƀ, πѳκѧ ʜє ѳϯѣєⱀƴ ʜє ѳϯđѧҁϯ đƀӀⱀκѧ ϯƴπѧᴙ =Δ',
'κҁϯѧϯє ϯʙѳᴙ ʍѧϯƀ đƀӀⱀκѧ đⱀʙѧʜѧᴙ πєⱀєєχѧʌѧ ҁѳ ʍʜѳӣ ʙ đєⱀєʙʜѥ џ ϯєⱀƀ ʙҁєʍ ґѳʙѳⱀџϯ ӌϯѳ ѳʜѧ ʍѳᴙ đѳᴙⱀκѧ ѧ ᴙ єє ѣѧⱀџʜ =Δ',
'ʙѳϯ ҁκѧѫџ ʍʜє ʌѳχ ӌє ϯʙѳᴙ ʍѧϯƀ ϯѧκѧᴙ ϯƴπѧᴙ? ꯌ єє χƴєʍ ӡʜѧӌџϯ ɯʙƀӀⱀᴙѥ ҁѳѣѧκƴ ҁƴϯƴʌƴѥ ѧ ѳʜѧ ѳπᴙϯƀ ѣєѫџϯ џ πⱀƀӀґѧє ʜѧ ʍѳєʍ χƴє=Δ',
